d','s:8:\"&#32;und\";'),('de','messages:anoncontribs','s:9:\"Beitrge\";'),('de','messages:anoneditwarning','s:264:\"<strong>Warnung:</strong> Du bist nicht angemeldet. Deine IP-Adresse wird bei Bearbeitungen ffentlich sichtbar. <strong>[$1 Melde dich an]</strong> oder <strong>[$2 erstelle ein Benutzerkonto]</strong>, damit Bearbeitungen deinem Benutzernamen zugeordnet werden.\";'),('de','messages:anonnotice','s:1:\"-\";'),('de','messages:anononlyblock','s:11:\"nur Anonyme\";'),('de','messages:anonpreviewwarning','s:107:\"\'\'Du bist nicht angemeldet. Beim Speichern wird deine IP-Adresse in der Versionsgeschichte aufgezeichnet.\'\'\";'),('de','messages:anontalk','s:16:\"Diskussionsseite\";'),('de','messages:anontalkpagetext','s:586:\"----\n<em>Diese Seite dient dazu, einem nicht angemeldeten Benutzer Nachrichten zu hinterlassen.</em>\nEs wird seine IP-Adresse zur Identifizierung verwendet.\nIP-Adressen knnen von mehreren Benutzern gemeinsam verwendet werden.\nWenn du mit den Kommentaren auf dieser Seite nichts anfangen kannst, richten sie sich vermutlich an einen frheren Inhaber deiner IP-Adresse und du kannst sie ignorieren.\nDu kannst dir auch ein [[Special:CreateAccount|Benutzerkonto erstellen]] oder dich [[Special:UserLogin|anmelden]], um knftig Verwechslungen mit anderen anonymen Benutzern zu vermeiden.\";'),('de','messages:anonuser','s:33:\"Anonymer {{SITENAME}}-Benutzer $1\";'),('de','messages:anonusers','s:79:\"{{PLURAL:$2|unangemeldetem|unangemeldeten}} {{PLURAL:$2|Benutzer|Benutzern}} $1\";'),('de','messages:anonymous','s:77:\"{{PLURAL:$1|Unangemeldeter Benutzer|Unangemeldete Benutzer}} auf {{SITENAME}}\";'),('de','messages:api-clientside-error-aborted','s:30:\"Die Anfrage wurde abgebrochen.\";'),('de','messages:api-clientside-error-http','s:52:\"Der Server hat einen Fehler zurckgegeben: HTTP $1.\";'),('de','messages:api-clientside-error-invalidresponse','s:30:\"Ungltige Antwort vom Server.\";'),('de','messages:api-clientside-error-noconnect','s:149:\"Es konnte keine Verbindung zum Server hergestellt werden. Stelle sicher, dass du eine funktionierende Internetverbindung hast und versuche es erneut.\";'),('de','messages:api-clientside-error-timeout','s:60:\"Der Server hat nicht innerhalb der erwarteten Zeit reagiert.\";'),('de','messages:api-credits','s:412:\"API-Entwickler:\n* Roan Kattouw (Hauptentwickler von September 2007 bis 2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Yuri Astrakhan (Autor, Hauptentwickler von September 2006 bis September 2007)\n* Brad Jorsch (Hauptentwickler seit 2013)\n\nBitte sende deine Kommentare, Vorschlge und Fragen an mediawiki-api@lists.wikimedia.org\noder reiche einen Fehlerbericht auf https://phabricator.wikimedia.org/ ein.\";'),('de','messages:api-credits-header','s:12:\"Danksagungen\";'),('de','messages:api-error-badtoken','s:42:\"Interner Fehler: Der Token ist fehlerhaft.\";'),('de','messages:api-error-emptypage','s:53:\"Es ist nicht erlaubt, neue leere Seiten zu erstellen.\";'),('de','messages:api-error-publishfailed','s:79:\"Interner Fehler: Der Server konnte die temporre Datei nicht verffentlichen.\";'),('de','messages:api-error-stashfailed','s:68:\"Interner Fehler: Der Server konnte keine temporre Datei speichern.\";'),('de','messages:api-error-unknown-warning','s:29:\"Unbekannte Warnung: $1.\";'),('de','messages:api-error-unknownerror','s:28:\"Unbekannter Fehler: $1\";'),('de','messages:api-exception-trace','s:16:\"$1 bei $2($3)\n$4\";'),('de','messages:api-feed-error-title','s:11:\"Fehler ($1)\";'),('de','messages:api-format-prettyprint-header','s:469:\"Dies ist die Darstellung des $1-Formats in HTML. HTML ist gut zur Fehlerbehebung geeignet, aber unpassend fr die Nutzung durch Anwendungen.\n\nGib den Parameter <var>format</var> an, um das Ausgabeformat zu ndern. Lege <kbd>format=$2</kbd> fest, um die von HTML abweichende Darstellung des $1-Formats zu erhalten.\n\nSiehe auch die [[mw:Special:MyLanguage/API|vollstndige Dokumentation der API]] oder die [[Special:ApiHelp/main|API-Hilfe]] fr weitere Informationen.\";'),('de','messages:api-format-prettyprint-header-hyperlinked','s:377:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-header-only-html','s:219:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-status','s:60:\"Diese Antwort wird mit dem HTTP-Status $1 $2 zurckgegeben.\";'),('de','messages:api-format-title','s:22:\"MediaWiki-API-Ergebnis\";'),('de','messages:api-help-authmanager-general-usage','s:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('de','messages:api-help-authmanagerhelper-additional-params','s:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('de','messages:api-help-authmanagerhelper-continue','s:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('de','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('de','messages:api-help-authmanagerhelper-messageformat','s:53:\"Zu verwendendes Format zur Rckgabe von Nachrichten.\";'),('de','messages:api-help-authmanagerhelper-preservestate','s:65:\"Preserve state from a previous failed login attempt, if possible.\";'),('de','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('de','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('de','messages:api-help-authmanagerhelper-returnurl','s:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('de','messages:api-help-datatype-boolean','s:168:\"Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),('de','messages:api-help-datatype-expiry','s:230:\"Expiry values be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). For no expiry, use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> or <kbd>never</kbd>.\";'),('de','messages:api-help-datatype-timestamp','s:388:\"Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),('de','messages:api-help-datatypes-header','s:10:\"Datentypen\";'),('de','messages:api-help-datatypes-top','s:616:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),('de','messages:api-help-examples','s:33:\"{{PLURAL:$1|Beispiel|Beispiele}}:\";'),('de','messages:api-help-flag-deprecated','s:26:\"Dieses Modul ist veraltet.\";'),('de','messages:api-help-flag-generator','s:49:\"Dieses Modul kann als Generator verwendet werden.\";'),('de','messages:api-help-flag-internal','s:110:\"<strong>Dieses Modul ist intern oder instabil.</strong> Seine Operationen werden ohne Kenntnisnahme gendert.\";'),('de','messages:api-help-flag-mustbeposted','s:42:\"Dieses Modul akzeptiert nur POST-Anfragen.\";'),('de','messages:api-help-flag-readrights','s:34:\"Dieses Modul erfordert Leserechte.\";'),('de','messages:api-help-flag-writerights','s:37:\"Dieses Modul erfordert Schreibrechte.\";'),('de','messages:api-help-flags','s:0:\"\";'),('de','messages:api-help-help-urls','s:0:\"\";'),('de','messages:api-help-lead','s:165:\"Dies ist eine automatisch generierte MediaWiki-API-Dokumentationsseite.\n\nDokumentation und Beispiele: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page\";'),('de','messages:api-help-license','s:17:\"Lizenz: [[$1|$2]]\";'),('de','messages:api-help-license-noname','s:25:\"Lizenz: [[$1|Siehe Link]]\";'),('de','messages:api-help-license-unknown','s:54:\"Lizenz: <span class=\"apihelp-unknown\">unbekannt</span>\";'),('de','messages:api-help-main-header','s:10:\"Hauptmodul\";'),('de','messages:api-help-no-extended-description','s:0:\"\";'),('de','messages:api-help-open-in-apisandbox','s:38:\"<small>[in Spielwiese ffnen]</small>\";'),('de','messages:api-help-param-continue','s:72:\"Falls weitere Ergebnisse verfgbar sind, dies zum Fortfahren verwenden.\";'),('de','messages:api-help-param-default-empty','s:51:\"Standard: <span class=\"apihelp-empty\">(leer)</span>\";'),('de','messages:api-help-param-deprecated','s:9:\"Veraltet.\";'),('de','messages:api-help-param-direction','s:174:\"In which direction to enumerate:\n;newer:List oldest first. Note: $1start has to be before $1end.\n;older:List newest first (default). Note: $1start has to be later than $1end.\";'),('de','messages:api-help-param-disabled-in-miser-mode','s:83:\"Deaktiviert aufgrund des [[mw:Special:MyLanguage/Manual:$wgMiserMode|Miser-Modus]].\";'),('de','messages:api-help-param-internal','s:9:\"Internal.\";'),('de','messages:api-help-param-limited-in-miser-mode','s:226:\"<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('de','messages:api-help-param-multi-all','s:48:\"Um alle Werte anzugeben, verwende <kbd>$1</kbd>.\";'),('de','messages:api-help-param-multi-separate','s:88:\"Werte mit <kbd>|</kbd> trennen oder [[Special:ApiHelp/main#main/datatypes|Alternative]].\";'),('de','messages:api-help-param-no-description','s:55:\"<span class=\"apihelp-empty\">(keine Beschreibung)</span>\";'),('de','messages:api-help-param-templated','s:112:\"Dies ist ein [[Special:ApiHelp/main#main/templatedparams|Vorlagenparameter]]. Bei der Erstellung der Anfrage $2.\";'),('de','messages:api-help-param-templated-var','s:54:\"<var>&#x7B;$1&#x7D;</var> mit Werten von <var>$2</var>\";'),('de','messages:api-help-param-templated-var-first','s:94:\"<var>&#x7B;$1&#x7D;</var> im Parameternamen sollte mit Werten von <var>$2</var> ersetzt werden\";'),('de','messages:api-help-param-token','s:90:\"Ein $1-Token abgerufen von [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('de','messages:api-help-param-token-webui','s:98:\"Aus Kompatibilittsgrnden wird der in der Weboberflche verwendete Token ebenfalls akzeptiert.\";'),('de','messages:api-help-param-type-enum','s:141:\"{{PLURAL:$1|1=Einer der folgenden Werte|2=Werte (mit <kbd>{{!}}</kbd> trennen oder [[Special:ApiHelp/main#main/datatypes|Alternative]])}}: $2\";'),('de','messages:api-help-param-type-expiry','s:103:\"Type: {{PLURAL:$1|1=expiry|2=list of expiries}} ([[Special:ApiHelp/main#main/datatype/expiry|details]])\";'),('de','messages:api-help-param-type-limit','s:33:\"Typ: Ganzzahl oder <kbd>max</kbd>\";'),('de','messages:api-help-param-type-presenceboolean','s:70:\"Type: boolean ([[Special:ApiHelp/main#main/datatype/boolean|details]])\";'),('de','messages:api-help-param-type-timestamp','s:125:\"Typ: {{PLURAL:$1|1=Zeitstempel|2=Liste von Zeitstempeln}} ([[Special:ApiHelp/main#main/datatype/timestamp|erlaubte Formate]])\";'),('de','messages:api-help-parameters','s:24:\"{{PLURAL:$1|Parameter}}:\";'),('de','messages:api-help-permissions','s:42:\"{{PLURAL:$1|Berechtigung|Berechtigungen}}:\";'),('de','messages:api-help-permissions-granted-to','s:29:\"{{PLURAL:$1|Gewhrt an}}: $2\";'),('de','messages:api-help-right-apihighlimits','s:185:\"Hhere Beschrnkungen in API-Anfragen verwenden (langsame Anfragen: $1; schnelle Anfragen: $2). Die Beschrnkungen fr langsame Anfragen werden auch auf Mehrwertparameter angewandt.\";'),('de','messages:api-help-source','s:10:\"Quelle: $1\";'),('de','messages:api-help-source-unknown','s:54:\"Quelle: <span class=\"apihelp-unknown\">unbekannt</span>\";'),('de','messages:api-help-templatedparams','s:560:\"Templated parameters support cases where an API module needs a value for each value of some other parameter. For example, if there were an API module to request fruit, it might have a parameter <var>fruits</var> to specify which fruits are being requested and a templated parameter <var>{fruit}-quantity</var> to specify how many of each fruit to request. An API client that wants 1 apple, 5 bananas, and 20 strawberries could then make a request like <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.\";'),('de','messages:api-help-templatedparams-header','s:17:\"Vorlagenparameter\";'),('de','messages:api-help-title','s:19:\"MediaWiki-API-Hilfe\";'),('de','messages:api-help-undocumented-module','s:44:\"Keine Dokumentation fr das Modul $1.\";'),('de','messages:api-login-fail-aborted','s:277:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see [[Special:BotPasswords]]. To continue using main-account login, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:api-login-fail-aborted-nobotpw','s:170:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To log in, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:api-login-fail-badsessionprovider','s:28:\"Cannot log in when using $1.\";'),('de','messages:api-login-fail-sameorigin','s:57:\"Cannot log in when the same-origin policy is not applied.\";'),('de','messages:api-pageset-param-converttitles','s:171:\"Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";'),('de','messages:api-pageset-param-generator','s:166:\"Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('de','messages:api-pageset-param-pageids','s:64:\"Eine Liste der Seitenkennungen, an denen gearbeitet werden soll.\";'),('de','messages:api-pageset-param-redirects-generator','s:151:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('de','messages:api-pageset-param-redirects-nogenerator','s:102:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('de','messages:api-pageset-param-revids','s:66:\"Eine Liste der Versionskennun