m eine Datei ber den <var>xml</var>-Parameter zu senden.\";'),('de','messages:apihelp-import-param-assignknownusers','s:87:\"Weist Bearbeitungen lokalen Benutzern zu, wo der benannte Benutzer lokal vorhanden ist.\";'),('de','messages:apihelp-import-param-fullhistory','s:100:\"Fr Interwiki-Importe: importiere die komplette Versionsgeschichte, nicht nur die aktuelle Version.\";'),('de','messages:apihelp-import-param-interwikipage','s:47:\"Fr Interwiki-Importe: zu importierende Seite.\";'),('de','messages:apihelp-import-param-interwikiprefix','s:164:\"Fr hochgeladene Importe: Auf unbekannte Benutzernamen anzuwendendes Interwiki-Prfix (und bekannte Benutzer, falls <var>$1assignknownusers</var> festgelegt ist).\";'),('de','messages:apihelp-import-param-interwikisource','s:61:\"Fr Interwiki-Importe: Wiki, von dem importiert werden soll.\";'),('de','messages:apihelp-import-param-namespace','s:97:\"In diesen Namensraum importieren. Kann nicht zusammen mit <var>$1rootpage</var> verwendet werden.\";'),('de','messages:apihelp-import-param-rootpage','s:105:\"Als Unterseite dieser Seite importieren. Kann nicht zusammen mit <var>$1namespace</var> verwendet werden.\";'),('de','messages:apihelp-import-param-summary','s:42:\"Importzusammenfassung des Logbucheintrags.\";'),('de','messages:apihelp-import-param-tags','s:118:\"Auf den Eintrag im Import-Logbuch und die Nullversion bei den importierten Seiten anzuwendende nderungsmarkierungen.\";'),('de','messages:apihelp-import-param-templates','s:68:\"Fr Interwiki-Importe: importiere auch alle eingebundenen Vorlagen.\";'),('de','messages:apihelp-import-param-xml','s:23:\"Hochgeladene XML-Datei.\";'),('de','messages:apihelp-import-summary','s:70:\"Importiert eine Seite aus einem anderen Wiki oder von einer XML-Datei.\";'),('de','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('de','messages:apihelp-json-param-callback','s:154:\"Falls angegeben, wird die Ausgabe in einen angegebenen Funktionsaufruf eingeschlossen. Aus Sicherheitsgrnden sind benutzerspezifische Daten beschrnkt.\";'),('de','messages:apihelp-json-param-formatversion','s:218:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Modern format.\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('de','messages:apihelp-json-param-utf8','s:208:\"Falls angegeben, kodiert die meisten (aber nicht alle) Nicht-ASCII-Zeichen als UTF-8 anstatt sie mit hexadezimalen Escape-Sequenzen zu ersetzen. Standard, wenn <var>formatversion</var> nicht <kbd>1</kbd> ist.\";'),('de','messages:apihelp-json-summary','s:30:\"Daten im JSON-Format ausgeben.\";'),('de','messages:apihelp-jsonfm-summary','s:55:\"Daten im JSON-Format ausgeben (schngedruckt in HTML).\";'),('de','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('de','messages:apihelp-linkaccount-example-link','s:67:\"Start the process of linking to an account from <kbd>Example</kbd>.\";'),('de','messages:apihelp-linkaccount-summary','s:79:\"Verbindet ein Benutzerkonto von einem Drittanbieter mit dem aktuellen Benutzer.\";'),('de','messages:apihelp-login-example-login','s:8:\"Anmelden\";'),('de','messages:apihelp-login-extended-description','s:299:\"Diese Aktion sollte nur in Kombination mit [[Special:BotPasswords]] verwendet werden. Die Verwendung fr die Anmeldung beim Hauptkonto ist veraltet und kann ohne Warnung fehlschlagen. Um sich sicher beim Hauptkonto anzumelden, verwende <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-extended-description-nobotpasswords','s:140:\"This action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-param-domain','s:18:\"Domain (optional).\";'),('de','messages:apihelp-login-param-name','s:13:\"Benutzername.\";'),('de','messages:apihelp-login-param-password','s:9:\"Passwort.\";'),('de','messages:apihelp-login-param-token','s:57:\"Anmeldetoken, den du in der ersten Anfrage erhalten hast.\";'),('de','messages:apihelp-login-summary','s:49:\"Anmelden und Authentifizierungs-Cookies beziehen.\";'),('de','messages:apihelp-logout-example-logout','s:32:\"Meldet den aktuellen Benutzer ab\";'),('de','messages:apihelp-logout-summary','s:41:\"Abmelden und alle Sitzungsdaten lschen.\";'),('de','messages:apihelp-main-extended-description','s:1320:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Dokumentation]]\n* [[mw:Special:MyLanguage/API:FAQ|Hufig gestellte Fragen]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailingliste]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API-Ankndigungen]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Fehlerberichte und Anfragen]\n</div>\n<strong>Status:</strong> Die MediaWiki-API ist eine ausgereifte und stabile Schnittstelle, die aktiv untersttzt und verbessert wird. Whrend wir versuchen, dies zu vermeiden, knnen wir gelegentlich Breaking Changes erforderlich machen. Abonniere die [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ MediaWiki-API-Ankndigungs-Mailingliste] fr Mitteilungen zu Aktualisierungen.\n\n<strong>Fehlerhafte Anfragen:</strong> Wenn fehlerhafte Anfragen an die API gesendet werden, wird ein HTTP-Header mit dem Schlssel MediaWiki-API-Error gesendet. Der Wert des Headers und der Fehlercode werden auf den gleichen Wert gesetzt. Fr weitere Informationen siehe [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Fehler und Warnungen]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testen:</strong> Zum einfachen Testen von API-Anfragen, siehe [[Special:ApiSandbox]].</p>\";'),('de','messages:apihelp-main-param-action','s:22:\"Auszufhrende Aktion.\";'),('de','messages:apihelp-main-param-assert','s:204:\"Sicherstellen, dass der Benutzer eingeloggt ist, wenn <kbd>user</kbd> gesetzt, <em>nicht</em> angemeldet, wenn auf <kbd>anon</kbd> gesetzt, oder das Bot-Benutzerrecht hat, wenn auf <kbd>bot</kbd> gesetzt.\";'),('de','messages:apihelp-main-param-assertuser','s:64:\"berprft, ob der aktuelle Benutzer der benannte Benutzer ist.\";'),('de','messages:apihelp-main-param-curtimestamp','s:39:\"Aktuellen Zeitstempel mit zurckgeben.\";'),('de','messages:apihelp-main-param-errorformat','s:393:\"Zu verwendendes Format zur Ausgabe von Warnungen und Fehlertexten.\n; plaintext: Wikitext mit entfernten HTML-Tags und ersetzten Entitten.\n; wikitext: Ungeparster Wikitext.\n; html: HTML.\n; raw: Nachrichtenschlssel und Parameter.\n; none: Keine Textausgabe, nur die Fehlercodes.\n; bc: Vor MediaWiki 1.29 verwendetes Format. <var>errorlang</var> und <var>errorsuselocal</var> werden ignoriert.\";'),('de','messages:apihelp-main-param-errorlang','s:385:\"Zu verwendende Sprache fr Warnungen und Fehler. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Luste von Sprachcode zurck, oder spezifiziere <kbd>content</kbd>, um die Inhaltssprache des Wikis zu verwenden, oder spezifiziere <kbd>uselang</kbd>, um denselben Wert wie den <var>uselang</var>-Parameter zu verwenden.\";'),('de','messages:apihelp-main-param-errorsuselocal','s:100:\"Falls angegeben, verwenden Fehlertexte lokalisierte Nachrichten aus dem {{ns:MediaWiki}}-Namensraum.\";'),('de','messages:apihelp-main-param-format','s:19:\"Format der Ausgabe.\";'),('de','messages:apihelp-main-param-maxage','s:118:\"Den <code>max-age</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.\";'),('de','messages:apihelp-main-param-maxlag','s:557:\"maxlag kann verwendet werden, wenn MediaWiki auf einem datenbankreplizierten Cluster installiert ist. Um weitere Replikationsrckstnde zu verhindern, lsst dieser Parameter den Client warten, bis der Replikationsrckstand kleiner als der angegebene Wert (in Sekunden) ist. Bei einem grerem Rckstand wird der Fehlercode <samp>maxlag</samp> zurckgegeben mit einer Nachricht wie <samp>Waiting for $host: $lag seconds lagged</samp>.<br />Siehe [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Handbuch: Maxlag parameter]] fr weitere Informationen.\";'),('de','messages:apihelp-main-param-origin','s:1133:\"Beim Zugriff auf die API mit einer Kreuz-Domain-AJAX-Anfrage (CORS) muss dies als entstehende Domne festgelegt werden. Dies muss in jeder Vorfluganfrage mit eingeschlossen werden und deshalb ein Teil der Anfragen-URI sein (nicht des POST-Krpers).\n\nFr authentifizierte Anfragen muss dies exakt einem der Ursprnge im Header <code>Origin</code> entsprechen, so dass es auf etwas wie <kbd>https://de.wikipedia.org</kbd> oder <kbd>https://meta.wikimedia.org</kbd> festgelegt werden muss. Falls dieser Parameter nicht mit dem Header <code>Origin</code> bereinstimmt, wird eine 403-Antwort zurckgegeben. Falls dieser Parameter mit dem Header <code>Origin</code> bereinstimmt und der Ursprung weigelistet ist, werden die Header <code>Access-Control-Allow-Origin</code> und <code>Access-Control-Allow-Credentials</code> festgelegt.\n\nGib fr nicht authentifizierte Anfragen den Wert <kbd>*</kbd> an. Dies verursacht, dass der Header <code>Access-Control-Allow-Origin</code> festgelegt wird, aber <code>Access-Control-Allow-Credentials</code> wird <code>false</code> sein und alle benutzerspezifischen Daten werden beschrnkt.\";'),('de','messages:apihelp-main-param-requestid','s:114:\"Der angegebene Wert wird mit in die Antwort aufgenommen und kann zur Unterscheidung von Anfragen verwendet werden.\";'),('de','messages:apihelp-main-param-responselanginfo','s:102:\"Bezieht die fr <var>uselang</var> und <var>errorlang</var> verwendeten Sprachen im Ergebnis mit ein.\";'),('de','messages:apihelp-main-param-servedby','s:47:\"Namen des bearbeitenden Hosts mit zurckgeben.\";'),('de','messages:apihelp-main-param-smaxage','s:121:\"Den <code>s-maxage</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gepuffert.\";'),('de','messages:apihelp-main-param-uselang','s:348:\"Zu verwendende Sprache fr Nachrichtenbersetzungen. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Liste der Sprachcodes zurck. Gib <kbd>user</kbd> zum Verwenden der aktuellen Benutzerspracheinstellung oder <kbd>content</kbd> an, um die Inhaltssprache des Wikis zu verwenden.\";'),('de','messages:apihelp-main-summary','s:0:\"\";'),('de','messages:apihelp-managetags-example-activate','s:136:\"Aktiviert eine Markierung namens <kbd>spam</kbd> mit der Begrndung <kbd>For use in edit patrolling</kbd> (fr die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-create','s:135:\"Erstellt eine Markierung namens <kbd>spam</kbd> mit der Begrndung <kbd>For use in edit patrolling</kbd> (fr die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-deactivate','s:124:\"Deaktiviert eine Markierung namens <kbd>spam</kbd> mit der Begrndung <kbd>No longer required</kbd> (nicht mehr bentigt).\";'),('de','messages:apihelp-managetags-example-delete','s:84:\"Lscht die <kbd>vandlaism</kbd>-Markierung mit der Begrndung <kbd>Misspelt</kbd>.\";'),('de','messages:apihelp-managetags-param-ignorewarnings','s:43:\"Warnungen whrend des Vorgangs ignorieren.\";'),('de','messages:apihelp-managetags-param-operation','s:540:\"Welcher Vorgang soll ausgefhrt werden:\n;create:Ein neues nderungsschlagwort zum manuellen Gebrauch erstellen.\n;delete:Ein nderungsschlagwort aus der Datenbank entfernen. Einschlielich dem Entfernen des Schlagworts von allen berarbeitungen, krzlichen nderungseintrgen und Logbuch-Eintrgen, in denen es genutzt wird.\n;activate:Ein nderungsschlagwort aktivieren und damit Benutzern erlauben es manuell anzuwenden.\n;deactive:Ein nderungsschlagwort deaktivieren und damit die manuelle Verwendung durch Benutzer unterbinden.\";'),('de','messages:apihelp-managetags-param-reason','s:96:\"optionale Begrndung fr das Erstellen, Lschen, Aktivieren oder Deaktivieren der Markierung.\";'),('de','messages:apihelp-managetags-param-tag','s:369:\"Schlagwort zum Erstellen, Lschen, Aktivieren oder Deaktivieren. Zum Erstellen darf das Schlagwort noch nicht vorhanden sein. Zur Lschung muss das Schlagwort vorhanden sein. Zur Aktivierung muss das Schlagwort vorhanden sein, darf aber nicht von einer Erweiterung in Gebrauch sein. Zur Deaktivierung muss das Schlagwort gegenwrtig aktiv und manuell definiert sein.\";'),('de','messages:apihelp-managetags-param-tags','s:87:\"Auf den Eintrag im Markierungs-Verwaltungs-Logbuch anzuwendende nderungsmarkierungen.\";'),('de','messages:apihelp-managetags-summary','s:58:\"Ermglicht Verwaltungsaufgaben zu nderungsmarkierungen.\";'),('de','messages:apihelp-mergehistory-example-merge','s:96:\"Fgt alle Versionen von <kbd>Oldpage</kbd> der Versionsgeschichte von <kbd>Newpage</kbd> hinzu.\";'),('de','messages:apihelp-mergehistory-example-merge-timestamp','s:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('de','messages:apihelp-mergehistory-param-from','s:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),('de','messages:apihelp-mergehistory-param-fromid','s:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),('de','messages:apihelp-mergehistory-param-reason','s:55:\"Grund fr die Zusammenfhrung der Versionsgeschichten\";'),('de','messages:apihelp-mergehistory-param-timestamp','s:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('de','messages:apihelp-mergehistory-param-to','s:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('de','messages:apihelp-mergehistory-param-toid','s:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('de','messages:apihelp-mergehistory-summary','s:47:\"Fhrt Versionsgeschichten von Seiten zusammen.\";'),('de','messages:apihelp-move-example-move','s:96:\"<kbd>Badtitle</kbd> nach <kbd>Goodtitle</kbd> verschieben, ohne eine Weiterleitung zu erstellen.\";'),('de','messages:apihelp-move-param-from','s:96:\"Titel der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1fromid</var> verwendet werden.\";'),('de','messages:apihelp-move-param-fromid','s:102:\"Seitenkennung der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1from</var> verwendet werden.\";'),('de','messages:apihelp-move-param-ignorewarnings','s:26:\"Alle Warnungen ignorieren.\";'),('de','messages:apihelp-move-param-movesubpages','s:40:\"Unterseiten verschieben, falls mglich.\";'),('de','messages:apihelp-move-param-movetalk','s:49:\"Verschiebt die Diskussionsseite, falls vorhanden.\";'),('de','messages:apihelp-move-param-noredirect','s:30:\"Keine Weiterleitung erstellen.\";'),('de','messages:apihelp-move-param-reason','s:27:\"Grund fr die Umbenennung.\";'),('de','messages:apihelp-move-param-tags','s:111:\"Auf den Eintrag im Verschiebungs-Logbuch und die Nullversion der Zielseite anzuwendende nderungsmarkierungen.\";'),('de','messages:apihelp-move-param-to','s:46:\"Titel, zu dem die Seite umbenannt werden soll.\";'),('de','messages:apihelp-move-param-unwatch','s:80:\"Die Seite und die entstandene Weiterleitung von der Beobachtungsliste entfernen.\";'),('de','messages:apihelp-move-param-watch','s:78:\"Die Seite und die entstandene Weiterleitung zur Beobachtungsliste hinzufgen.\";'),('de','messages:apihelp-move-param-watchlist','s:157:\"Die Seite in jedem Fall zur Beobachtungsliste hinzufgen oder davon entfernen, die Voreinstellungen dafr nutzen oder den Beobachtungsstatus nicht ndern.\";'),('de','messages:apihelp-move-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('de','messages:apihelp-move-summary','s:23:\"Eine Seite verschieben.\";'),('de','messages:apihelp-no-such-module','s:30:\"Modul $1 nicht gefunden.\";'),('de','messages:apihelp-none-summary','s:16:\"Nichts ausgeben.\";'),('de','messages:apihelp-opensearch-example-te','s:46:\"Seiten finden, die mit <kbd>Te</kbd> beginnen.\";'),('de','messages:apihelp-opensearch-param-format','s:23:\"Das Format der Ausgabe.\";'),('de','messages:apihelp-opensearch-param-limit','s:45:\"Maximale Anzahl zurckzugebender Ergebnisse.\";'),('de','messages:apihelp-opensearch-param-namespace','s:119:\"Zu durchsuchende Namensrume. Wird ignoriert, falls <var>$1search</var> mit einem gltigen Namensraumprfix beginnt.\";'),('de','messages:apihelp-opensearch-param-redirects','s:295:\"Wie mit Weiterleitungen umgegangen werden soll:\n;return:Gibt die Weiterleitung selbst zurck.\n;resolve:Gibt die Zielseite zurck. Kann weniger als $1limit Ergebnisse zurckgeben.\nAus Kompatibilittsgrnden ist fr $1format=json die Vorgabe \"return\" und \"resolve\" fr alle anderen Formate.\";'),('de','messages:apihelp-opensearch-param-search','s:18:\"Such-Zeichenfolge.\";'),('de','messages:apihelp-opensearch-param-suggest','s:23:\"Nicht lnger verwendet\";'),('de','messages:apihelp-opensearch-param-warningsaserror','s:109:\"Wenn Warnungen mit <kbd>format=json</kbd> auftreten, gib einen API-Fehler zurck, anstatt ihn zu ignorieren.\";'),('de','messages:apihelp-opensearch-summary','s:56:\"Das Wiki mithilfe des OpenSearch-Protokolls durchsuchen.\";'),('de','messages:apihelp-options-example-change','s:67:\"ndert die Einstellungen <kbd>skin</kbd> und <kbd>hideminor</kbd>.\";'),('de','messages:apihelp-options-example-complex','s:89:\"Setzt alle Einstellungen zurck, dann <kbd>skin</kbd> und <kbd>nickname</kbd> festlegen.\";'),('de','messages:apihelp-options-example-reset','s:32:\"Alle Einstellungen zurcksetzen\";'),('de','messages:apihelp-options-extended-description','s:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('de','messages:apihelp-options-param-change','s:423:\"Liste von nderungen, die mit name=wert formatiert sind (z.&nbsp;B. skin=vector). Falls kein Wert angegeben wurde (ohne einem Gleichheitszeichen), z.&nbsp;B. Optionname|AndereOption|, wird die Option auf ihren Standardwert zurckgesetzt. Falls ein bergebener Wert ein Trennzeichen enthlt (<kbd>|</kbd>), verwende den [[Special:ApiHelp/main#main/datatypes|alternativen Mehrfachwerttrenner]] zur korrekten Bedienung.\";'),('de','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('de','messages:apihelp-options-param-optionvalue','s:74:\"Der Wert fr die Option, die durch <var>$1optionname</var> angegeben ist.\";'),('de','messages:apihelp-options-param-reset','s:53:\"Setzt die Einstellungen auf Websitestandards zurck.\";'),('de','messages:apihelp-options-param-resetkinds','s:94:\"Liste von zurckzusetzenden Optionstypen, wenn die <var>$1reset</var>-Option ausgewhlt ist.\";'),('de','messages:apihelp-options-summary','s:58:\"Die Voreinstellungen des gegenwrtigen Benutzers ndern.\";'),('de','messages:apihelp-paraminfo-example-1','s:271:\"Zeige Info fr <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, und <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('de','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('de','messages:apihelp-paraminfo-param-formatmodules','s:111:\"Liste von Formatmodulnamen (Wert des Parameters <var>format</var>). Stattdessen <var>$1modules</var> verwenden.\";'),('de','messages:apihelp-paraminfo-param-helpformat','s:31:\"Format der Hilfe-Zeichenfolgen.\";'),('de','messages:apihelp-paraminfo-param-mainmodule','s:109:\"Auch Informationen ber die Hauptmodule (top-level) erhalten. Benutze <kbd>$1modules=main</kbd> stattdessen.\";'),('de','messages:apihelp-paraminfo-param-modules','s:245:\"Liste von Modulnamen (Werte der Parameter <var>action</var> und <var>format</var> oder <kbd>main</kbd>). Kann Untermodule mit einem <kbd>+</kbd> oder alle Untermodule mit <kbd>+*</kbd> oder alle Untermodule rekursiv mit <kbd>+**</kbd> bestimmen.\";'),('de','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('de','messages:apihelp-paraminfo-param-querymodules','s:184:\"Liste von Abfragemodulnamen (Werte von <var>prop</var>-, <var>meta</var>- oder <var>list</var>-Parameter). Benutze <kbd>$1modules=query+foo</kbd> anstatt <kbd>$1querymodules=foo</kbd>.\";'),('de','messages:apihelp-paraminfo-summary','s:39:\"Ruft Informationen ber API-Module ab.\";'),('de','messages:apihelp-parse-example-page','s:18:\"Eine Seite parsen.\";'),('de','messages:apihelp-parse-example-summary','s:27:\"Parst eine Zusammenfassung.\";'),('de','messages:apihelp-parse-example-text','s:16:\"Wikitext parsen.\";'),('de','messages:apihelp-parse-example-texttitle','s:54:\"Parst den Wikitext ber die Eingabe des Seitentitels.\";'),('de','messages:apihelp-parse-extended-description','s:500:\"See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</