ges:apihelp-query+recentchanges-param-tag','s:68:\"Listet nur nderungen auf, die mit dieser Markierung markiert sind.\";'),('de','messages:apihelp-query+recentchanges-param-title','s:42:\"Filter entries to those related to a page.\";'),('de','messages:apihelp-query+recentchanges-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('de','messages:apihelp-query+recentchanges-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('de','messages:apihelp-query+recentchanges-param-type','s:53:\"Welche Typen von nderungen angezeigt werden sollen.\";'),('de','messages:apihelp-query+recentchanges-param-user','s:47:\"Listet nur nderungen von diesem Benutzer auf.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:79:\"Markiert kontrollierbare Bearbeitungen als automatisch kontrolliert oder nicht.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:155:\"Fgt den Kommentar fr die Bearbeitung hinzu. Wenn der Kommentar versionsgelscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurckgegeben.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:43:\"Ergnzt Markierungen fr die Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:68:\"Adds the page ID, recent changes ID and the new and old revision ID.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:60:\"Adds log information (log ID, log type, etc) to log entries.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:135:\"Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:57:\"Tags patrollable edits as being patrolled or unpatrolled.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:32:\"Tags edit if page is a redirect.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:160:\"Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:42:\"Adds the new and old page length in bytes.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:41:\"Listet Markierungen fr den Eintrag auf.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:46:\"Ergnzt den Zeitstempel fr die Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:41:\"Ergnzt den Seitentitel der Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:158:\"Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:134:\"Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-summary','s:35:\"Listet die letzten nderungen auf.\";'),('de','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('de','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('de','messages:apihelp-query+redirects-param-limit','s:55:\"Wie viele Weiterleitungen zurckgegeben werden sollen.\";'),('de','messages:apihelp-query+redirects-param-namespace','s:49:\"Schliet nur Seiten in diesen Namensrumen ein.\";'),('de','messages:apihelp-query+redirects-param-prop','s:31:\"Zurckzugebende Eigenschaften:\";'),('de','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:48:\"Teil einer jeden Weiterleitung, falls vorhanden.\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:40:\"Seitenkennung einer jeden Weiterleitung.\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-title','s:32:\"Titel einer jeden Weiterleitung.\";'),('de','messages:apihelp-query+redirects-summary','s:41:\"Returns all redirects to the given pages.\";'),('de','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('de','messages:apihelp-query+revisions+base-param-diffto','s:218:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('de','messages:apihelp-query+revisions+base-param-difftotext','s:254:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('de','messages:apihelp-query+revisions+base-param-difftotextpst','s:177:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('de','messages:apihelp-query+revisions+base-param-expandtemplates','s:146:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('de','messages:apihelp-query+revisions+base-param-generatexml','s:207:\"Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('de','messages:apihelp-query+revisions+base-param-limit','s:42:\"Limit how many revisions will be returned.\";'),('de','messages:apihelp-query+revisions+base-param-parse','s:187:\"Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('de','messages:apihelp-query+revisions+base-param-prop','s:45:\"Zurckzugebende Eigenschaften jeder Version:\";'),('de','messages:apihelp-query+revisions+base-param-section','s:49:\"Only retrieve the content of this section number.\";'),('de','messages:apihelp-query+revisions+base-param-slots','s:203:\"Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:149:\"Kommentar des Benutzers fr die Version. Wenn der Kommentar versionsgelscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurckgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:139:\"Inhalt eines jeden Versionsschlitzes. Wenn der Inhalt versionsgelscht wurde, wird die Eigenschaft <samp>texthidden</samp> zurckgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:52:\"Inhaltsmodell-Kennung eines jeden Versionsschlitzes.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:29:\"Versionsmarkierungen (klein).\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:24:\"Die Kennung der Version.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:142:\"Parsed comment by the user for the revision. If the comment has been revision deleted, a <sa