nutzerkonto oder deine IP-Adresse ist fr das Durchfhren dieser Aktion gesperrt. Du kannst mglicherweise noch andere Sachen in diesem Wiki, wie z.B. bestimmte Seiten, bearbeiten.</strong> Du kannst die vollstndigen Einzelheiten in deinen [[Special:MyContributions|Benutzerbeitrgen]] einsehen.\n\nDie Sperre wurde von $1 durchgefhrt.\n\nDie angegebene Begrndung lautet: <em>$2</em>.\n\n* Beginn der Sperre: $8\n* Ablauf der Sperre: $6\n* Sperre betrifft: $7\n* Sperrkennung: #$5\";'),('de','messages:blockedtitle','s:21:\"Benutzer ist gesperrt\";'),('de','messages:blockip','s:52:\"IP-Adresse/{{GENDER:$1|Benutzer|Benutzerin}} sperren\";'),('de','messages:blockipsuccesssub','s:29:\"Die Sperrung war erfolgreich.\";'),('de','messages:blockipsuccesstext','s:169:\"Der Benutzer / die IP-Adresse [[Special:Contributions/$1|$1]] wurde gesperrt.<br />\nZur Aufhebung der Sperre siehe die [[Special:BlockList|Liste aller aktiven Sperren]].\";'),('de','messages:blockiptext','s:490:\"Mit diesem Formular sperrst du eine IP-Adresse oder einen Benutzernamen, so dass von dort keine nderungen mehr vorgenommen werden knnen.\nDies sollte nur erfolgen, um Vandalismus zu verhindern und in bereinstimmung mit den [[{{MediaWiki:Policy-url}}|Richtlinien]].\nBitte gib den Grund fr die Sperre an.\nDu kannst IP-Bereiche mit der [https://de.wikipedia.org/wiki/Classless_Inter-Domain_Routing CIDR]-Syntax sperren; der grte erlaubte Bereich ist /$1 fr IPv4 und /$2 fr IPv6.\";'),('de','messages:blocklink','s:7:\"Sperren\";'),('de','messages:blocklist','s:18:\"Gesperrte Benutzer\";'),('de','messages:blocklist-addressblocks','s:40:\"Sperren einzelner IP-Adressen ausblenden\";'),('de','messages:blocklist-by','s:12:\"Gesperrt von\";'),('de','messages:blocklist-editing','s:10:\"Bearbeiten\";'),('de','messages:blocklist-editing-ns','s:12:\"Namensrume\";'),('de','messages:blocklist-editing-page','s:6:\"Seiten\";'),('de','messages:blocklist-editing-sitewide','s:28:\"Bearbeiten (gesamte Website)\";'),('de','messages:blo