ffne diesen Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* dir gehrt, folge diesem Link,\num die E-Mail-Besttigung abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_body_set','s:528:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos $2 auf {{SITENAME}} zu dieser E-Mail-Adresse abgendert.\n\nUm zu besttigen, dass dieses Benutzerkonto wirklich zu dir gehrt\nund um die E-Mail-Funktionen auf {{SITENAME}} zu aktivieren, ffne bitte den folgenden Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* zu dir gehrt, bitte den nachfolgenden Link ffnen,\num die Besttigung der E-Mail-Adresse abzubrechen:\n\n$5\n\nDieser Besttigungscode ist gltig bis $4.\";'),('de','messages:confirmemail_invalid','s:138:\"Ungltiger Besttigungscode. Mglicherweise ist der Besttigungszeitraum verstrichen. Versuche bitte, die Besttigung zu wiederholen.\";'),('de','messages:confirmemail_invalidated','s:48:\"Die E-Mail-Adressbesttigung wurde abgebrochen.\";'),('de','messages:confirmemail_loggedin','s:50:\"Deine E-Mail-Adresse wurde erfolgreich besttigt.\";'),('de','messages:confirmemail_needlogin','s:57:\"Du musst dich $1, um deine E-Mail-Adresse zu besttigen.\";'),('de','messages:confirmemail_noemail','s:112:\"Du hast keine gltige E-Mail-Adresse in deinen [[Special:Preferences|persnlichen Einstellungen]] eingetragen.\";'),('de','messages:confirmemail_oncreate','s:198:\"Ein Besttigungs-Code wurde an deine E-Mail-Adresse gesandt. Dieser Code wird fr die Anmeldung nicht bentigt, jedoch wird er zur Aktivierung der E-Mail-Funktionen innerhalb des Wikis gebraucht.\";'),('de','messages:confirmemail_pending','s:212:\"Es wurde dir bereits ein Besttigungscode per E-Mail zugeschickt.\nWenn du dein Benutzerkonto erst vor kurzem erstellt hast, warte bitte noch ein paar Minuten auf die E-Mail, bevor du einen neuen Code anforderst.\";'),('de','messages:confirmemail_send','s:28:\"Besttigungscode zuschicken\";