rschoben werden.\";'),('de','messages:movepage-source-doesnt-exist','s:62:\"Die Seite $1 existiert nicht und kann nicht verschoben werden.\";'),('de','messages:movepage-summary','s:0:\"\";'),('de','messages:movepagebtn','s:17:\"Seite verschieben\";'),('de','messages:movepagetalktext','s:293:\"Falls du dieses Kstchen aktivierst, wird die dazugehrige Diskussionsseite automatisch auf den neuen Titel verschoben, sofern nicht bereits eine nicht-leere Diskussionsseite dort vorhanden ist.\n\nIn diesem Fall musst du die Seite manuell verschieben oder zusammenfhren, falls erforderlich.\";'),('de','messages:movepagetext','s:1065:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nDu kannst Weiterleitungen, die auf den Originaltitel verlinken, automatisch korrigieren lassen.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|defekten Weiterleitungen]] berprfst.\nDu bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird <strong>nicht</strong> verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, letztere ist eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite berschreiben.\n\n<strong>Hinweis:</strong>\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetext-noredirectfixer','s:966:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|defekten Weiterleitungen]] berprfst.\nDu bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird <strong>nicht</strong> verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite berschreiben.\n\n<strong>Hinweis:</strong>\nDie Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movepagetext-noredirectsupport','s:698:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst. Du bist dafr verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen. \n\nDie Seite wird <strong>nicht</strong> verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt. Dies bedeutet, dass du die Umbenennung rckgngig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite berschreiben.\n\n<strong>Hinweis:</strong> Die Verschiebung kann weitreichende und unerwartete Folgen fr hufig besuchte Seiten haben. Du solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfhrst.\";'),('de','messages:movereason','s:6:\"Grund:\";'),('de','messages:movesubpage','s:36:\"{{PLURAL:$1|Unterseite|Unterseiten}}\";'),('de','messages:movesubpagetalktext','s:138:\"Die dazugehrige Diskussionsseite hat {{PLURAL:$1|eine Unterseite, die unten angezeigt wird|$1 Unterseiten, die unten angezeigt werden}}.\";'),('de','messages:movesubpagetext','s:56:\"Diese Seite hat $1 {{PLURAL:$1|Unterseite|Unterseiten}}.\";'),('de','messages:movetalk','s:52:\"Sofern mglich, die Diskussionsseite mitverschieben\";'),('de','messages:movethispage',