bst angefordert hast. Das alte Passwort bleibt weiterhin gltig.\";'),('de','messages:passwordremindertitle','s:63:\"Neues temporres Passwort fr dein {{SITENAME}}-Benutzerkonto\";'),('de','messages:passwordreset','s:22:\"Passwort zurcksetzen\";'),('de','messages:passwordreset-disabled','s:68:\"Das Zurcksetzen von Passwrtern wurde in diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-domain','s:7:\"Domain:\";'),('de','messages:passwordreset-email','s:15:\"E-Mail-Adresse:\";'),('de','messages:passwordreset-emaildisabled','s:57:\"Die E-Mail-Funktionen wurden auf diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-emailelement','s:44:\"Benutzername: \n$1\n\nTemporres Passwort: \n$2\";'),('de','messages:passwordreset-emailtext-ip','s:688:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat eine Zurcksetzung deines Passworts bei {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporre Passwort luft|Diese temporren Passwrter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab.\n\nDu solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage gettigt hat oder du dich wieder an dein ursprngliches Passwort erinnern kannst und es nicht lnger ndern mchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtext-require-email','s:344:\"Wenn du diese Anfrage jedoch nicht generiert hast und unerwnschte E-Mails verhindern mchtest, kannst du deine E-Mail-Optionen ber\n$1\naktualisieren.\nDu kannst festlegen, dass sowohl Benutzername als auch E-Mail-Adresse bentigt werden, um die Passwort-Zurcksetzen-Email zu veranlassen. Dies kann die Anzahl solcher Vorflle verringern.\";'),('de','messages:passwordreset-emailtext-user','s:652:\"Benutzer $1 bei {{SITENAME}} hat eine Zurcksetzung deines Passworts bei {{SITENAME}} angefordert ($4)