:318:\"Softwarefehler knnen auf <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a> gemeldet werden. Die Dokumentation zum <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Reporting_bugs\">Melden von Softwarefehlern</a> bietet eine Anleitung zum Verfassen eines effektiven Fehlerberichts.\";'),('de','messages:smw-admin-configutation-tab-namespaces','s:12:\"Namensrume\";'),('de','messages:smw-admin-configutation-tab-schematypes','s:11:\"Schematypen\";'),('de','messages:smw-admin-configutation-tab-settings','s:27:\"Konfigurationseinstellungen\";'),('de','messages:smw-admin-db','s:20:\"Datenbankeinrichtung\";'),('de','messages:smw-admin-db-preparation','s:227:\"Die Initialisierung der Datenbanktabellen wird gerade durchgefhrt. Es kann etwas dauern, bis die Ergebnisse angezeigt werden. Der Zeitbedarf ist abhngig von der Gre und ggf. dem Optimierungsbedarf der Datenbanktabellen.\";'),('de','messages:smw-admin-dbbutton','s:42:\"Tabellen initialisieren oder aktualisieren\";'),('de','messages:smw-admin-dbdocu','s:711:\"Semantic MediaWiki bentigt weitere Datentabellen in der von MediaWiki genutzten Datenbank, um die semantischen Daten speichern zu knnen. Die folgende Sonderaufgabe gewhrleistet, dass die Datenbank richtig eingerichtet wird. Die Datenbanknderungen, die in diesem Schritt durchgefhrt werden, beeintrchtigen den brigen Teil der von MediaWiki genutzten Datenbank nicht. Sie knnen, sofern dies gewnscht ist, leicht rckgngig gemacht werden.\nDiese Sonderaufgabe zur Einrichtung der Datentabellen kann mehrere Male ausgefhrt werden, ohne Schaden zu verursachen. Indes ist es lediglich notwendig, sie einmal whrend der Installation oder der Aktualisierung von Semantic MediaWiki durchzufhren.\";'),('de','messages:smw-admin-deprecation-notice-config-notice','s:112:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> ist veraltet und wird mit Version $2 entfernt.\";'),('de','messages:smw-admin-deprecation-notice-config-notice