essages:smw-admin-deprecation-notice-title-notice-explanation','s:201:\"Die im folgenden Abschnitt angegebenen Konfigurationsparameter werden in der Konfigurationsdatei des Wikis verwendet, indes mit knftigen Softwareverffentlichungen entweder verndert oder entfernt.\";'),('de','messages:smw-admin-deprecation-notice-title-removal','s:34:\"Entfallene Konfigurationsparameter\";'),('de','messages:smw-admin-deprecation-notice-title-removal-explanation','s:155:\"Die im folgenden Abschnitt angegebenen Konfigurationsparameter wurden entfernt. Sie sollten umgehend aus der Konfigurationsdatei des Wikis entfernt werden.\";'),('de','messages:smw-admin-deprecation-notice-title-replacement','s:48:\"Ersetzte oder umbenannte Konfigurationsparameter\";'),('de','messages:smw-admin-deprecation-notice-title-replacement-explanation','s:193:\"Die im folgenden Abschnitt angegebenen Konfigurationsparameter wurden entweder umbenannt oder anderweitig verndert. Sie sollten umgehend in der Konfigurationsdatei des Wikis angepasst werden.\";'),('de','messages:smw-admin-docu','s:400:\"Diese Spezialseite bietet whrend Installation, Aktualisierung, Wartung und Nutzung sowie bei weiteren administrativen Funktionen und Aufgaben von <a href=\"https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki__Startseite\">Semantic MediaWiki</a> Untersttzung. Ebenso werden Statistiken bereitgestellt. Wichtige Daten sollten vor der Ausfhrung administrativer Funktionen gesichert werden.\";'),('de','messages:smw-admin-environment','s:16:\"Softwareumgebung\";'),('de','messages:smw-admin-feature-disabled','s:209:\"Diese Funktion wurde auf diesem Wiki deaktiviert. Hierzu knnen Informationen auf der <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">entsprechenden Hilfeseite</a> eingesehen werden.\";'),('de','messages:smw-admin-fulltext-active','s:98:\"Ein Auftrag zur Neuerstellung des Suchindexes fr die Volltextsuche wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-fulltext-button','s:50:\"Auftrag zur Neuerstellung des Suchindexes erzeugen\";'),('de','messages:smw-admin-fulltext-intro','s:349:\"Erstellt den Suchindex der Attributtabellen mit einem fr die [https://www.semantic-mediawiki.org/wiki/Full-text Volltextsuche] vorgesehenen Datentyp neu. nderungen an den Indexregeln wie bspw. genderte Stoppwrter, neuer Stemmer usw., und/oder das Hinzufgen oder ndern einer Tabelle erfordern das erneute Ausfhren dieser Spezialaufgabe.\";'),('de','messages:smw-admin-fulltext-title','s:37:\"Index der Volltextsuche neu erstellen\";'),('de','messages:smw-admin-helplink','s:70:\"https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki\";'),('de','messages:smw-admin-iddispose-docu','s:407:\"Die Bereinigung einer Objektkennung wird nach der Besttigung unbeschrnkt durchgefhrt, d. h. das Objekt wird nach erfolgter Besttigung direkt mitsamt allen Verknpfungen aus der Datenbank entfernt. Diese Aktion sollte daher nur mit groer \'\'\'Vorsicht\'\'\' und nur nach Einsicht in die [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal entsprechende Dokumentation] durchgefhrt werden.\";'),('de','messages:smw-admin-iddispose-done','s:60:\"Die Objektkennung $1 wurde aus der Datenbank entfernt.\";'),('de','messages:smw-admin-iddispose-no-references','s:63:\"Der Eintrag $1 wurde in keiner Datenbanktabelle gefunden.\";'),('de','messages:smw-admin-iddispose-references','s:105:\"Die Kennung $1 hat {{PLURAL:$2|keinen|mindestens einen}} aktiven Verweis auf eine Datenbanktabelle:\";'),('de','messages:smw-admin-iddispose-references-multiple','s:83:\"Liste der Kennungen mit mindestens einem aktiven Verweis auf eine Datenbanktabelle.\";'),('de','messages:smw-admin-iddispose-title','s:11:\"Bereinigung\";'),('de','messages:smw-admin-idlookup-docu','s:348:\"In diesem Abschnitt werden die technischen Einzelheiten zu einem Objekt (Wikiseite, Unterobjekt, Attribut usw.) in Semantic MediaWiki angezeigt. Die Eingabe kann eine zutreffende Kennung oder Zeichenkette sein. Diese Kennungen und Zeichenketten sind nicht zu verwechseln mit den von MediaWiki verwendeten Seitenbezeichnungen oder Versionskennungen.\";'),('de','messages:smw-admin-idlookup-input','s:6:\"Suche:\";'),('de','messages:smw-admin-idlookup-title','s:10:\"Ermittlung\";'),('de','messages:smw-admin-installfile','s:350:\"Sofern beim Installieren Probleme auftreten, knnten die in der Datei <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL</a> und die auf der Seite mit der <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Installation\">Installationsdokumentation</a> enthaltenen Informationen weiterhelfen.\";'),('de','messages:smw-admin-job-scheduler-note','s:466:\"Die meisten in diesem Abschnitt angegebenen Aktivitten werden als Hintergrundauftrag ausgefhrt, um Probleme whrend deren Ausfhrung zu vermeiden. Die [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue Auftragswarteschlange] ist fr deren Verarbeitung verantwortlich und es ist wichtig, dass das hierfr genutzte Wartungsskript runJobs.php (siehe auch Konfigurationsparameter <code>$wgRunJobsAsync</code>) angemessen eingerichtet wird.\";'),('de','messages:smw-admin-main-title','s:25:\"Semantic MediaWiki  $1\";'),('de','messages:smw-admin-maintenance-no-description','s:36:\"Es ist keine Beschreibung vorhanden.\";'),('de','messages:smw-admin-maintenance-script-description-disposeoutdatedentities','s:47:\"Veraltete Eintrge und Abfragelinks entfernen.\";'),('de','messages:smw-admin-maintenance-script-description-dumprdf','s:62:\"Ermglicht den RDF-Export der vorhandenen semantische Tripel.\";'),('de','messages:smw-admin-maintenance-script-description-populatehashfield','s:97:\"Ermglicht das Befllen des Datenbankfelds <code>smw_hash</code> in der relationalen Datenbank.\";'),('de','messages:smw-admin-maintenance-script-description-purgeentitycache','s:86:\"Ermglicht das Lschen des Caches fr bekannte Objekte und ihre zugehrigen Daten.\";'),('de','messages:smw-admin-maintenance-script-description-rebuildconceptcache','s:92:\"Ermglicht die Verwaltung (Erstellung, Lschung und Aktualisierung) semantischer Konzepte.\";'),('de','messages:smw-admin-maintenance-script-description-rebuilddata','s:101:\"Ermglicht das Erstellen oder Aktualisieren aller in der Datenbank gespeicherten semantischen Daten.\";'),('de','messages:smw-admin-maintenance-script-description-rebuildelasticindex','s:160:\"Ermglicht das Erstellen oder Aktualisieren aller im Index von Elasticsearch gespeicherten semantischen Daten, sofern Elasticsearch als Datenbank genutzt wird.\";'),('de','messages:smw-admin-maintenance-script-description-rebuildelasticmissingdocuments','s:135:\"Ermglicht das Ermitteln fehlender Datenobjekte und erstellt diese von Elasticsearch, sofern Elasticsearch als Datenbank genutzt wird.\";'),('de','messages:smw-admin-maintenance-script-description-rebuildfulltextsearchtable','s:141:\"Ermglicht das Erstellen oder Aktualisieren aller im Suchindex der Volltextsuche gespeicherten Daten, sofern die Volltextsuche genutzt wird.\";'),('de','messages:smw-admin-maintenance-script-description-rebuildpropertystatistics','s:64:\"Ermglicht das Aktualisieren der Statistik zur Attributnutzung.\";'),('de','messages:smw-admin-maintenance-script-description-removeduplicateentities','s:124:\"Ermglicht das Entfernen von Datenobjektduplikaten, die in der Datenbank ber keine aktiven Verknpfungen mehr verfgen.\";'),('de','messages:smw-admin-maintenance-script-description-runimport','s:152:\"Anlegen und importieren von automatisch entdeckten Inhalten von  [https://www.semantic-mediawiki.org/wiki/Help:$smwgImportFileDirs $smwgImportFileDirs].\";'),('de','messages:smw-admin-maintenance-script-description-setupstore','s:147:\"Richtet die fr die Speicherung semantischer Daten konfigurierte Datenbank, entsprechend der Festlegung in der Datei LocalSettings.php, ein.\";'),('de','messages:smw-admin-maintenance-script-description-updateentitycollation','s:262:\"Ermglicht das Aktualisieren des Datenbankfelds <code>smw_sort</code> in der relationalen Datenbank (in bereinstimmung mit der [https://www.semantic-mediawiki.org/wiki/Help:$smwgEntityCollation Konfiguration des Parameters <code>$smwgEntityCollation</code>]).\";'),('de','messages:smw-admin-maintenance-script-description-updatequerydependencies','s:270:\"Ermglicht das Aktualisieren von Abfragen sowie von Daten, die von Abfragen abhngen. Siehe hierzu auch den [https://www.semantic-mediawiki.org/wiki/Help:$smwgEnabledQueryDependencyLinksStore Konfigurationsparameter <code>$smwgEnabledQueryDependencyLinksStore</code>.]\";'),('de','messages:smw-admin-maintenance-script-section-intro','s:127:\"Die folgenden Wartungsskripte knnen nur von einem Systemadministrator ber die Kommandozeile des Servers ausgefhrt werden:\";'),('de','messages:smw-admin-maintenance-script-section-rebuild','s:21:\"Neuerstellungsskripte\";'),('de','messages:smw-admin-maintenance-script-section-title','s:34:\"Liste verfgbarer Wartungsskripte\";'),('de','messages:smw-admin-maintenance-script-section-update','s:22:\"Aktualisierungsskripte\";'),('de','messages:smw-admin-maintenance-tab-scripts','s:15:\"Wartungsskripte\";'),('de','messages:smw-admin-maintenance-tab-tasks','s:16:\"Wartungsaufgaben\";'),('de','messages:smw-admin-maintenancealerts-invalidentities-alert','s:493:\"Das System hat $1 [https://www.semantic-mediawiki.org/wiki/Invalid_entities {{PLURAL:$1|ungltigen Eintrag|ungltige Eintrge}}] in einem [https://www.semantic-mediawiki.org/wiki/Unmaintained_namespace nicht gewarteten Namensraum] gefunden. Es wird empfohlen, entweder das Wartungsskript [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php disposeOutdatedEntities.php] oder [https://www.semantic-mediawiki.org/wiki/rebuildData.php rebuildData.php] auszufhren.\";'),('de','messages:smw-admin-maintenancealerts-invalidentities-alert-title','s:23:\"Ungltige Datenobjekte\";'),('de','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert','s:388:\"Die letzte [https://www.semantic-mediawiki.org/wiki/Table_optimization Optimierung der Datenbanktabellen] wurde vor $2 Tagen durchgefhrt (Eintrag vom $1). Der Schwellwert von $3 Tagen ist somit berschritten. Eine Optimierung der Datenbanktabellen fhrt zu effizienteren Ausfhrungen von Abfragen. Es wird empfohlen regelmig eine Optimierung der Datenbanktabellen durchzufhren.\";'),('de','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert-title','s:24:\"Datentabellenoptimierung\";'),('de','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert','s:358:\"Das System hat $1 [https://www.semantic-mediawiki.org/wiki/Outdated_entities veraltete Dateiobjekte] ermittelt. Der kritische Wert von $2 nicht durchgefhrten Wartungsaufgaben ist daher berschritten. Es wird empfohlen, das Wartungsskript [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php disposeOutdatedEntities.php] auszufhren.\";'),('de','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert-title','s:22:\"Veraltete Datenobjekte\";'),('de','messages:smw-admin-maintenancealerts-section-intro','s:161:\"Die Beachtung folgender Meldungen und Hinweise ist nicht essenziell. Deren Beachtung untersttzt sowie verbessert indes die Wartung und den Betrieb des Systems.\";'),('de','messages:smw-admin-objectid','s:8:\"Kennung:\";'),('de','messages:smw-admin-operational-statistics','s:248:\"Diese Seite zeigt Statistiken, die bezglich der Nutzung oder zum Betrieb von Semantic MediaWiki ermittelt wurden. Eine erweiterte bersicht wikispezifischer Statistiken ist auf der Spezialseite [[Special:Statistics|<b>Statistik</b>]] verfgbar.\";'),('de','messages:smw-admin-other-functions','s:19:\"Weitere Statistiken\";'),('de','messages:smw-admin-outdateddisposal-active','s:76:\"Ein Auftrag zur Bereinigung veralteter Objekte wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-outdateddisposal-button','s:32:\"Auftrag zur Bereinigung erzeugen\";'),('de','messages:smw-admin-outdateddisposal-intro','s:489:\"Einige Aktivitten, wie bspw. das ndern des Datentyps eines Attributs, das Lschen von Seiten oder das Korrigieren fehlerhafter Datenwerte, fhren zu [https://www.semantic-mediawiki.org/wiki/Outdated_entities veralteten Datenobjekten]. Es ist empfehlenswert, diese periodisch in der Datenbank zu bereinigen. Es kann etwas dauern, bis der Auftrag zur Bereinigung ausgefhrt und abgeschlossen ist. Dies ist davon abhngig, in welchem zeitlichen Intervall Auftrge ausgefhrt werden.\";'),('de','messages:smw-admin-outdateddisposal-title','s:28:\"Veraltete Objekte bereinigen\";'),('de','messages:smw-admin-permission-missing','s:271:\"Der Zugriff auf diese Seite wurde aufgrund fehlender Berechtigungen verwehrt. Bitte lies die Hilfeseite zu den [https://www.semantic-mediawiki.org/wiki/Help:Permissions Berechtigungen], um Informationen bezglich der hierfr notwendigen Einstellungen zu erhalten.\";'),('de','messages:smw-admin-permissionswarn','s:626:\"Sofern diese Aktion mit einem SQL-Fehler abbricht, knnte es sein, dass der Datenbankbenutzer, mit dem das Wiki auf die Datenbank zugreift (siehe die Datei LocalSettings.php), ber keine ausreichenden Rechte verfgt.\nUm das Problem zu beheben, ist es notwendig, entweder dem Datenbankbenutzer zustzliche Rechte zur Erstellung und Lschung von Datenbanktabellen einzurumen, den Datenbankadministrator zeitweilig in die Datei LocalSettings.php einzutragen, oder aber das Wartungsskript setupStore.php zu nutzen, das von einem Serveradministrator mit Administrationsberechtigung ausgefhrt werden kann.\";'),('de','messages:smw-admin-propertystatistics-active','s:81:\"Ein Auftrag zur Neuerstellung der Attributstatistik wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-propertystatistics-button','s:58:\"Auftrag zur Neuerstellung der Attributstatistiken erzeugen\";'),('de','messages:smw-admin-propertystatistics-intro','s:221:\"Erstellt die gesamten Statistiken zu Attributen neu und aktualisiert sowie korrigiert die [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count Anzahl zugeordneter Attributwerte] auf den Seiten der Attribute.\";'),('de','messages:smw-admin-propertystatistics-title','s:39:\"Statistiken zu Attributen neu erstellen\";'),('de','messages:smw-admin-questions','s:191:\"Im Fall von Fragen oder Anregungen kann man sich an den Diskussionen auf der <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">Mailingliste fr Nutzer</a> beteiligen.\";'),('de','messages:smw-admin-settings-docu','s:312:\"Diese Seite zeigt eine Liste der Standardeinstellungen sowie der fr dieses Wiki angepassten Einstellungen zur Konfiguration von Semantic MediaWiki an. Weitergehende Informationen sind auf der Hilfeseite zu den [https://www.semantic-mediawiki.org/wiki/Help:Configuration Konfigurationseinstellungen] verfgbar.\";'),('de','messages:smw-admin-setupsuccess','s:33:\"Die Datenbank wurde eingerichtet.\";'),('de','messages:smw-admin-smwhomepage','s:200:\"Die Dokumentation fr die Nutzer von Semantic MediaWiki ist auf <b><a href=\"https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_%E2%80%93_Startseite\">semantic-mediawiki.org</a></b> verfgbar.\";'),('de','messages:smw-admin-statistics','s:11:\"Statistiken\";'),('de','messages:smw-admin-statistics-extra','s:11:\"Statistiken\";'),('de','messages:smw-admin-statistics-job-docu','s:353:\"Die Statistiken zu Auftrgen zeigen Informationen zu noch nicht ausgefhrten Auftrgen an, die von Semantic MediaWiki geplant wurden. Die Anzahl der Auftrge kann geringfgig ungenau sein oder auch Fehlversuche enthalten. Weitere Informationen befinden sind in der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue Dokumentation].\";'),('de','messages:smw-admin-statistics-job-title','s:25:\"Statistiken zu Auftrgen\";'),('de','messages:smw-admin-statistics-querycache-disabled','s:174:\"Das [https://www.semantic-mediawiki.org/wiki/QueryCache Cachen von Abfragen] wurde fr dieses Wiki nicht aktiviert. Daher sind keine diesbezglichen Statistiken verfgbar.\";'),('de','messages:smw-admin-statistics-querycache-legend','s:1163:\"Die Statistiken zum Abfragencache enthalten vernderliche wie auch abgeleitete Daten, darunter:\n* Fehlversuche (misses)  Die Zahl der direkten Abrufe von Abfrageergebnissen aus der Datenbank, da sie nicht im Cache verfgbar waren.\n* Lschungen (deletes)  Die Zahl der Lschungen des Caches, entweder durch den Nutzer oder durch entsprechende Mechanismen der Software.\n* Treffer (hits)  Die Zahl der Abrufe von Abfrageergebnissen aus dem Cache, da sie dort verfgbar waren, aufgeteilt nach auf Seiten eingebetteten Abfragen (embedded) und nicht eingebetteten Abfragen (nonEmbedded) auf der Spezialseite Semantische Suche oder ber die API.\n* Mittlere Antwortzeit fr Abfrageergebnisse (medianRetrievalResponseTime)  Die mittlere Antwortzeit fr gecachte und nicht gecachte Abrufe von Abfrageergebnissen in Sekunden whrend des Erhebungszeitraums der Statistiken zum Abfragencache.\n* Kein Cache (noCache)  Die Zahl der Abrufe von Abfrageergebnissen aus der Datenbank aufgrund entsprechender Vorgaben, d. h. durch die Nutzung der Abfrageoptionen <code>limit=0</code> oder <code>no-cache</code>.\";'),('de','messages:smw-admin-statistics-querycache-title','s:13:\"Abfragencache\";'),('de','messages:smw-admin-statistics-section-explain','s:72:\"Dieser Abschnitt stellt Administratoren zustzliche Statistiken bereit.\";'),('de','messages:smw-admin-statistics-semanticdata-overview','s:10:\"bersicht\";'),('de','messages:smw-admin-supplementary-duplookup-docu','s:342:\"Diese Seite listet Datenobjekte, die in der Datenbank als [https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities doppelt vorhanden] kategorisiert wurden. Doppelte Datenobjekte sollten, wenn berhaupt, nur in seltenen Fllen auftreten, und entstehen zumeist aufgrund unterbrochener oder gescheiterter Datenaktualisierungsvorgnge.\";'),('de','messages:smw-admin-supplementary-duplookup-helplink','s:63:\"https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities\";'),('de','messages:smw-admin-supplementary-duplookup-intro','s:37:\"$1  Zeigt doppelte Datenobjekte an\";'),('de','messages:smw-admin-supplementary-duplookup-title','s:31:\"Doppelten Datenobjekte anzeigen\";'),('de','messages:smw-admin-supplementary-elastic-config','s:13:\"Konfiguration\";'),('de','messages:smw-admin-supplementary-elastic-docu','s:259:\"Diese Seite bietet Informationen zu Einstellungen, Mappings, Betriebsstatus sowie Indexstatistiken des Elasticsearch-Clusters, der von Semantic MediaWiki ber dessen [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore ElasticStore] genutzt wird.\";'),('de','messages:smw-admin-supplementary-elastic-endpoints','s:9:\"Endpunkte\";'),('de','messages:smw-admin-supplementary-elastic-functions','s:24:\"Untersttzte Funktionen\";'),('de','messages:smw-admin-supplementary-elastic-indices-intro','s:88:\"$1  Bietet einen berblick zu den genutzten Indizes mitsamt zugehriger Statistiken\";'),('de','messages:smw-admin-supplementary-elastic-indices-title','s:7:\"Indizes\";'),('de','messages:smw-admin-supplementary-elastic-intro','s:70:\"$1  Informiert detailliert ber Einstellungen und Indexstatistiken\";'),('de','messages:smw-admin-supplementary-elastic-mappings-docu','s:318:\"Diese Seite enthlt Einzelheiten zu den Feldmappings, die vom aktuellen Index verwendet werden. Die Zusammenfassung der Feldmappings sollte in Verbindung mit dem Konfigurationsparameter <code>index.mapping.total_fields.limit</code> berwacht werden, der die maximale Anzahl der zulssigen Felder eines Index angibt.\";'),('de','messages:smw-admin-supplementary-elastic-mappings-docu-extra','s:297:\"Der Wert zu <code>property_fields</code> bezieht sich auf die Anzahl indexierter Hauptfelder, whrend sich der Wert zu <code>nested_fields</code> auf die kumulierte Anzahl zustzlicher Felder bezieht, die einem Hauptfeld zugewiesen sind, um spezifische strukturierte Suchmuster zu untersttzen.\";'),('de','messages:smw-admin-supplementary-elastic-mappings-fields','s:12:\"Feldmappings\";'),('de','messages:smw-admin-supplementary-elastic-mappings-intro','s:61:\"$1  Zeigt die Liste der genutzten Indizes und Feldmappings\";'),('de','messages:smw-admin-supplementary-elastic-mappings-summary','s:15:\"Zusammenfassung\";'),('de','messages:smw-admin-supplementary-elastic-mappings-title','s:8:\"Mappings\";'),('de','messages:smw-admin-supplementary-elastic-no-connection','s:303:\"Das Wiki kann derzeit \'\'\'keine\'\'\' Verbindung zur Elasticsearch-Datenbank herstellen. Dies verhindert aktuell die Datenabfragen im Wiki. Der Systemadministrator des Wikis mu kontaktiert werden, damit das Problem behoben werden kann und die erforderliche Indexierung des Wikis wieder durchgefhrt wird.\";'),('de','messages:smw-admin-supplementary-elastic-nodes-intro','s:46:\"$1  Zeigt Statistiken des genutzten Knotens\";'),('de','messages:smw-admin-supplementary-elastic-nodes-title','s:6:\"Knoten\";'),('de','messages:smw-admin-supplementary-elastic-replication-docu','s:416:\"Diese Seite stellt Informationen zum [https://www.semantic-mediawiki.org/wiki/Help:Replication_monitoring Replikationsstatus] von Datenobjekten bereit, bei denen Probleme in Zusammenhang mit der Elasticsearch-Datenbank bestehen. Es wird empfohlen, die aufgelisteten Datenobjekte zu berprfen und den Cache der betreffenden Seiten zu leeren. Sofern das Problem dadurch gelst wurde, bestand es nur vorbergehend.\";'),('de','messages:smw-admin-supplementary-elastic-replication-files','s:7:\"Dateien\";'),('de','messages:smw-admin-supplementary-elastic-replication-files-docu','s:253:\"Die [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/File_ingestion Indexierung von Dateien] erfolgt in einem gesonderten Schritt. Erst nachdem diese Aufgabe vollstndig ausgefhrt wurde, sind die Inhalte der Dateien im Suchindex verfgbar.\";'),('de','messages:smw-admin-supplementary-elastic-replication-function-title','s:16:\"Datenreplikation\";'),('de','messages:smw-admin-supplementary-elastic-replication-header-title','s:23:\"Datenreplikationsstatus\";'),('de','messages:smw-admin-supplementary-elastic-replication-intro','s:68:\"$1  Zeigt Informationen zu fehlgeschlagenen Datenreplikationen an\";'),('de','messages:smw-admin-supplementary-elastic-replication-pages','s:6:\"Seiten\";'),('de','messages:smw-admin-supplementary-elastic-section-subtitle','s:13:\"Elasticsearch\";'),('de','messages:smw-admin-supplementary-elastic-settings-intro','s:148:\"$1  Zeigt eine bersicht der Einstellungen, die von Elasticsearch verwendet werden, um die von Semantic MediaWiki genutzten Indizes zu verwalten\";'),('de','messages:smw-admin-supplementary-elastic-settings-title','s:13:\"Einstellungen\";'),('de','messages:smw-admin-supplementary-elastic-statistics-docu','s:438:\"Diese Seite bietet Einblick in die Statistiken zu den verschiedenen Betriebsablufen auf der Betriebsebene der genutzten Indizes. Die Statistiken werden fr die Gesamtebene des jeweiligen Index sowie fr dessen primre Unterebenen zusammengefasst ausgegeben. Die [https://www.elastic.co/guide/en/elasticsearch/reference/current/indices-stats.html Hilfeseite] enthlt eine ausfhrliche Beschreibung der verfgbaren Indexstatistiken.\";'),('de','messages:smw-admin-supplementary-elastic-statistics-intro','s:40:\"$1  Zeigt Statistiken der Indexebenen\";'),('de','messages:smw-admin-supplementary-elastic-statistics-title','s:11:\"Statistiken\";'),('de','messages:smw-admin-supplementary-elastic-status-file-ingest-job-count','s:58:\"Rckstand an Dateiindexierungsauftrgen: $1 (Schtzung)\";'),('de','messages:smw-admin-supplementary-elastic-status-last-active-replication','s:43:\"Zuletzt durchgefhrte Datenreplikation: $1\";'),('de','messages:smw-admin-supplementary-elastic-status-rebuild-lock','s:68:\"Replikation gesperrt: $1 (Datenwiederherstellung wird durchgefhrt)\";'),('de','messages:smw-admin-supplementary-elastic-status-recovery-job-count','s:64:\"Rckstand an Datenwiederherstellungsauftrgen: $1 (Schtzung)\";'),('de','messages:smw-admin-supplementary-elastic-status-refresh-interval','s:29:\"Aktualisierungszeitspanne: $1\";'),('de','messages:smw-admin-supplementary-elastic-status-replication','s:27:\"Status der Datenreplikation\";'),('de','messages:smw-admin-supplementary-elastic-status-replication-monitoring','s:45:\"berwachung der Datenreplikation (aktiv): $1\";'),('de','messages:smw-admin-supplementary-elastic-title','s:13:\"Elasticsearch\";'),('de','messages:smw-admin-supplementary-elastic-version-info','s:7:\"Version\";'),('de','messages:smw-admin-supplementary-idlookup-intro','s:76:\"$1  Bietet Funktionen zum Ermitteln und Bereinigen einzelner Datenobjekte\";'),('de','messages:smw-admin-supplementary-idlookup-short-title','s:28:\"Objektsuche und -bereinigung\";'),('de','messages:smw-admin-supplementary-idlookup-title','s:37:\"Datenobjekte ermitteln und bereinigen\";'),('de','messages:smw-admin-supplementary-operational-statistics-cache-intro','s:50:\"$1  Zeigt Statistiken zur Nutzung des Caches an\";'),('de','messages:smw-admin-supplementary-operational-statistics-cache-title','s:21:\"Statistiken zum Cache\";'),('de','messages:smw-admin-supplementary-operational-statistics-intro','s:61:\"$1  Zeigt zu Semantic MediaWiki verfgbare Statistiken an\";'),('de','messages:smw-admin-supplementary-operational-statistics-short-title','s:19:\"Betriebsstatistiken\";'),('de','messages:smw-admin-supplementary-operational-statistics-title','s:34:\"Statistiken zu Nutzung und Betrieb\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-explain','s:229:\"Dieser Abschnitt enthlt ausgewhlte Statistiken zu Datentabellen, um Administratoren und Datenkuratoren dabei zu untersttzen, informierte Entscheidungen bezglich des Status der Datenbank sowie der Suchdatenbank zu treffen.\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-intro','s:44:\"$1  Zeigt Statistiken zu Datentabellen an\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-legend','s:84:\"Diese Legende erklrt die einzelnen Schlagwrter der Statistiken zu Datentabellen:\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-legend-blob-table','s:455:\"* <code>unique_terms_occurrence_in_percent</code>  Der Prozentsatz der Begriffe, die einmalig sind (Ein niedriger Prozentsatz bedeutet, da viele Begriffswiederholungen in Datentabelle und Index vorhanden sind.).\n* <code>rows.terms_occurrence.single_occurrence_total_count</code>  Die Anzahl der Begriffe, die einmalig vorkommen.\n* <code>rows.terms_occurrence.multi_occurrence_total_count</code>  Die Anzahl der Begriffe, die mehrmals vorkommen.\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-legend-general','s:94:\"* <code>total_row_count</code>  Anzahl der Zeilen, die in einer Datentabelle vorhanden sind\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-legend-id-table','s:899:\"* <code>last_id</code>  Die letzte Kennung, die derzeit in Verwendung ist. \n* <code>duplicate_count</code>  Die Anzahl der Duplikate, die in der Datentabelle <code>id_table</code> vorhanden sind (siehe auch [[Special:SemanticMediaWiki/duplicate-lookup|Suche nach doppelten Datenobjekten]]).\n* <code>rows.rev_count</code>  Die Anzahl der Zeilen, die eine Versionskennung aufweisen und somit auf einen direkten Link zu einer Seite haben.\n* <code>rows.smw_namespace_group_by_count</code>  Die Anzahl der Zeilen je Namensraum, die verwendet werden.\n* <code>rows.smw_proptable_hash.query_match_count</code>  Die Anzahl der Subobjekte zu Abfragen, die ber einen zugehrigen Verweis in der Datentabelle verfgen. \n* <code>rows.smw_proptable_hash.query_null_count</code>  Die Anzahl der Subobjekte zu Abfragen, die ber keinen zugehrigen Verweis in der Datentabelle verfgen.\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-short-title','s:19:\"Tabellenstatistiken\";'),('de','messages:smw-admin-supplementary-operational-table-statistics-title','s:23:\"Statistiken zu Tabellen\";'),('de','messages:smw-admin-supplementary-section-intro','s:377:\"In diesem Abschnitt werden weitere Funktionen zustzlich zu denen der Wartung bereitgestellt. Es ist mglich, dass einige in der [https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki/Supplementary_functions Dokumentation] gelisteten Funktionen entweder zugriffsbeschrnkt oder nicht verfgbar sind und deshalb nicht auf diesem Wiki genutzt werden knnen.\";'),('de','messages:smw-admin-supplementary-section-subtitle','s:21:\"Allgemeine Funktionen\";'),('de','messages:smw-admin-supplementary-section-title','s:23:\"Zustzliche Funktionen\";'),('de','messages:smw-admin-supplementary-settings-intro','s:110:\"$1  Zeigt eine Liste der verfgbaren und von Semantic MediaWiki verwendeten Konfigurationseinstellungen an\";'),('de','messages:smw-admin-supplementary-settings-title','s:27:\"Konfigurationseinstellungen\";'),('de','messages:smw-admin-support','s:23:\"Untersttzung erhalten\";'),('de','messages:smw-admin-supportdocu','s:86:\"Verschiedene Hilfen und Hinweise wurden erstellt, um im Fall eines Problems zu helfen:\";'),('de','messages:smw-admin-tab-alerts','s:9:\"Meldungen\";'),('de','messages:smw-admin-tab-general','s:10:\"bersicht\";'),('de','messages:smw-admin-tab-maintenance','s:7:\"Wartung\";'),('de','messages:smw-admin-tab-notices','s:26:\"Hinweise zur Konfiguration\";'),('de','messages:smw-admin-tab-registry','s:17:\"Wikiregistrierung\";'),('de','messages:smw-admin-tab-supplement','s:23:\"Zustzliche Funktionen\";'),('de','messages:smw-api-invalid-parameters','s:30:\"Ungltige Parameter: $1\";'),('de','messages:smw-apihelp-smwtask-example-update','s:96:\"Beispiel zur Ausfhrung einer Aktualisierungsaufgabe bezglich eines bestimmten Datensubjekts:\";'),('de','messages:smw-ask-condition-change-info','s:177:\"Die Abfragebedingungen wurden gendert. Es ist daher eine erneute Ausfhrung der Abfrage notwendig, um die den neuen Abfragebedingungen entsprechenden Ergebnisse zu ermitteln.\";'),('de','messages:smw-ask-condition-input-assistance','s:280:\"Es wird eine [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Eingabeuntersttzung] in den Feldern fr die Ausgabeanweisungen, Sortieranweisungen und Abfragebedingungen angeboten. Das Feld fr Abfragebedingungen erfordert die Nutzung eines der folgenden Prfixe:\";'),('de','messages:smw-ask-condition-input-assistance-category','s:52:\"<code>c:</code> zur Aktivierung einer Kategoriesuche\";'),('de','messages:smw-ask-condition-input-assistance-concept','s:52:\"<code>con:</code> zur Aktivierung einer Konzeptsuche\";'),('de','messages:smw-ask-condition-input-assistance-property','s:89:\"<code>p:</code> zur Aktivierung einer Attributsuche (z.&nbsp;B. <code>[[p:Hat </code>)\";'),('de','messages:smw-ask-debug','s:13:\"Fehleranalyse\";'),('de','messages:smw-ask-debug-desc','s:52:\"Erzeugt Informationen zur Fehleranalyse von Abfragen\";'),('de','messages:smw-ask-delete','s:9:\"Entfernen\";'),('de','messages:smw-ask-download-link-desc','s:48:\"Ermittelte Ergebnisse im Format $1 herunterladen\";'),('de','messages:smw-ask-empty','s:23:\"Alle Eintrge lschen\";'),('de','messages:smw-ask-extra-other','s:8:\"Weiteres\";'),('de','messages:smw-ask-extra-query-log','s:15:\"Abfrage-Logbuch\";'),('de','messages:smw-ask-format','s:6:\"Format\";'),('de','messages:smw-ask-format-change-info','s:180:\"Das Ausgabeformat wurde gendert. Es ist daher eine erneute Ausfhrung der Abfrage notwendig, um die den neuen Darstellungsoptionen entsprechenden Ergebnisse anzeigen zu knnen.\";'),('de','messages:smw-ask-format-export-info','s:160:\"Das ausgewhlte Ergebnisformat dient dem Datenexport und verfgt ber keine visuelle Darstellung. Die Ergebnisse werden nur zum Herunterladen bereitgestellt.\";'),('de','messages:smw-ask-format-help-link','s:73:\"Ausgabeformat [https://www.semantic-mediawiki.org/wiki/Help:$1_format $1]\";'),('de','messages:smw-ask-format-options','s:27:\"Ausgabeformate und Optionen\";'),('de','messages:smw-ask-format-selection-help','s:27:\"Hilfe zum Ausgabeformat: $1\";'),('de','messages:smw-ask-help','s:657:\"Dieser Abschnitt enthlt einige Links zur Erluterung der Nutzung der von Semantic MediaWiki bereitgestellten Abfragesyntax (<code>#ask:</code>-Syntax):\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Seiten auswhlen] beschreibt, wie Seiten ausgewhlt und Abfragebedingungen erstellt werden\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Search_operators Suchoperatoren] listet verfgbare Suchoperatoren inklusive solcher fr Bereichs- und Platzhalterabfragen auf\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Displaying_information Informationen anzeigen] erlutert die Nutzung der Ausgabeanweisungen und Formatierungsoptionen\";'),('de','messages:smw-ask-input-assistance','s:21:\"Eingabeuntersttzung\";'),('de','messages:smw-ask-message-keyword-type','s:77:\"Diese Suche entspricht der Abfragebedingung <code><nowiki>$1</nowiki></code>.\";'),('de','messages:smw-ask-no-cache','s:21:\"Abfragecache lschen\";'),('de','messages:smw-ask-no-cache-desc','s:53:\"Ergebnisse ohne Verwendung des Abfragecaches anzeigen\";'),('de','messages:smw-ask-options','s:8:\"Optionen\";'),('de','messages:smw-ask-options-sort','s:18:\"Sortierbedingungen\";'),('de','messages:smw-ask-order-rand','s:9:\"Zufllig\";'),('de','messages:smw-ask-otheroptions-collapsed-info','s:104:\"Bitte auf das kleine Plus-Symbol klicken, um sich die weiteren verfgbaren Optionen anzeigen zu lassen.\";'),('de','messages:smw-ask-otheroptions-info','s:190:\"Dieser Abschnitt enthlt Optionen, mit denen die Ergebnisausgabe gesteuert werden kann. Die Beschreibungen der Ausgabeparameter werden angezeigt, wenn man die Maus ber deren Namen fhrt.\";'),('de','messages:smw-ask-parameters','s:9:\"Parameter\";'),('de','messages:smw-ask-query-search-info','s:199:\"Die Abfrage <code><nowiki>$1</nowiki></code> wurde von der Datenbank {{PLURAL:$3|1=$2