:\"Attributgruppen anzeigen\";'),('de','messages:smw-category','s:9:\"Kategorie\";'),('de','messages:smw-category-change-propagation-locked-error','s:717:\"Die Kategorie $1 wurde solcherart verndert, dass die zugeordneten Datenobjekte mit einem [https://www.semantic-mediawiki.org/wiki/Change_propagation Datennderungsvorgang] neu verarbeitet werden mssen. Daher ist die Seite der Kategorie bis zu dem Zeitpunkt fr Bearbeitungen gesperrt, an dem dieser Vorgang abgeschlossen wurde. Hierdurch werden ggf. mgliche Funktionsstrungen oder widersprchliche Datenanzeigen verhindert. Da der Datennderungsvorgang abhngig vom Umfang sowie der Abarbeitungsfrequenz der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue Auftragswarteschlange] ist, kann es einen Moment dauern, bis die Seite freigegeben wird und wieder bearbeitet werden kann.\";'),('de','messages:smw-category-change-propagation-locked-warning','s:674:\"Die Kategorie $1 wurde solcherart verndert, dass die zugeordneten Datenobjekte mit einem [https://www.semantic-mediawiki.org/wiki/Change_propagation Datennderungsvorgang] neu verarbeitet werden mssen. Daher sollte die Seite dieser Kategorie nicht bearbeitet werden, bis dieser Vorgang abgeschlossen wurde. Hierdurch werden ggf. mgliche Funktionsstrungen oder widersprchliche Datenanzeigen verhindert. Da der Datennderungsvorgang abhngig vom Umfang sowie der Abarbeitungsfrequenz der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue Auftragswarteschlange] ist, kann es einen Moment dauern, bis die Seite wieder bearbeitet werden kann.\";'),('de','messages:smw-category-change-propagation-pending','s:431:\"Es {{PLURAL:$1|muss|mssen}} noch ungefhr [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue {{PLURAL:$1|ein Datennderungsauftrag|$1 Datennderungsauftrge}}] durchgefhrt werden. Daher sollte die Seite dieser Kategorie so lange nicht bearbeitet werden, bis kein Datennderungsauftrag mehr vorhanden ist. Hierdurch werden ggf. mgliche Funktionsstrungen oder widersprchliche Datenanzeigen verhindert.\";'),('de','messages:smw-category-invalid-redirect-target','s:128:\"Die Kategorie $1 enthlt ein Weiterleitungsziel, das sich nicht im Namensraum Kategorie befindet und daher ungltig ist.\";'),('de','messages:smw-category-invalid-value-assignment','s:95:\"$1 wurde nicht als gltige Kategorie oder als Annotation eines gltigen Wertes erkannt.\";'),('de','messages:smw-change-propagation-protection','s:472:\"Diese Seite ist gesperrt, um unbeabsichtigte nderungen an Daten zu verhindern, whrend ein [https://www.semantic-mediawiki.org/wiki/Change_propagation Datennderungsvorgang] ausgefhrt wird. Da der Datennderungsvorgang abhngig vom Umfang sowie der Abarbeitungsfrequenz der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue Auftragswarteschlange] ist, kann es einen Moment dauern, bis die Seite freigegeben wird und wieder bearbeitet werden kann.\";'),('de','messages:smw-cheat-sheet','s:13:\"Hilfestellung\";'),('de','messages:smw-clipboard-copy-link','s:35:\"Link in die Zwischenablage kopieren\";'),('de','messages:smw-collapse','s:10:\"Einklappen\";'),('de','messages:smw-concept-cache-count','s:148:\"Der [https://www.semantic-mediawiki.org/wiki/Help:Konzeptcaching Konzeptcache] enthlt {{PLURAL:$1|\'\'\'ein\'\'\' Objekt|\'\'\'$1\'\'\' Objekte}} (Stand: $2).\";'),('de','messages:smw-concept-cache-header','s:15:\"Cacheverwendung\";'),('de','messages:smw-concept-cache-text','s:106:\"Das Konzept enthlt {{PLURAL:$1|eine Seite|$1 Seiten}} und wurde letztmalig am $2 um $3 Uhr aktualisiert.\";'),('de','messages:smw-concept-indicator-cache-update','s:76:\"Anzahl der Seiten dieses Konzepts (gecachter Wert)\n\nZuletzt aktualisiert: $1\";'),('de','messages:smw-concept-no-cache','s:22:\"Kein Cache verfgbar.\";'),('de','messages:smw-concept-tab-errors','s:6:\"Fehler\";'),('de','messages:smw-concept-tab-list','s:5:\"Liste\";'),('de','messages:smw-constraint-error','s:27:\"Dateneinschrnkungsproblem\";'),('de','messages:smw-constraint-error-allows-value-list','s:118:\"$1 befindet sich nicht in der Liste ($2) [[Property:Allows value|zulssiger Werte]] fr das Attribut $3.\";'),('de','messages:smw-constraint-error-allows-value-range','s:194:\"$1 liegt nicht innerhalb des zulssigen Bereichs $2, der durch die Einschrnkung mit [[Property:Allows value|zulssigen Werten]] fr das Attribut $3 festgelegt wurde.\";'),('de','messages:smw-constraint-error-limit','s:76:\"Die Liste wird maximal $1 Fehler bezglich Dateneinschrnkungen enthalten.\";'),('de','messages:smw-constraint-error-suggestions','s:168:\"Die aufgelisteten Fehler bei Annotationen mssen geprft werden. Es ist sicherzustellen, da alle Datenwerte den Anforderungen an die Dateneinschrnkungen gengen.\";'),('de','messages:smw-constraint-schema-category-invalid-type','s:120:\"Das annotierte Schema $1 kann nicht fr Kategorien genutzt werden. Es muss der Schematyp $2 genutzt werden.\";'),('de','messages:smw-constraint-schema-property-invalid-type','s:120:\"Das annotierte Schema $1 kann nicht fr Kategorien genutzt werden. Es muss der Schematyp $2 genutzt werden.\";'),('de','messages:smw-constraint-violation-allowed-namespace-no-match','s:446:\"Die Beschrnkung <code>allowed_namespaces</code> wurde fr das Attribut [[Property:$1|$1]] festgelegt. Dies bedeutet, dass dem Datenobjekt nur ein Datenwert als Seite aus bestimmten Namensrumen zugeordnet werden darf. Die Seite $2 befindet sich nicht im festgelegten Namensraum und verstt somit gegen die festgelegt Beschrnkung. Nur Seiten in den Namensrumen $3 sind gem der festgelegten Beschrnkung zulssig.\";'),('de','messages:smw-constraint-violation-allowed-namespaces-requires-page-type','s:102:\"Die Beschrnkung <code>allowed_namespaces</code> erfordert ein Attribut mit dem Datentyp Seite.\";'),('de','messages:smw-constraint-violation-class-mandatory-properties-constraint','s:241:\"Die Beschrnkung <code>mandatory_properties</code> wurde fr die Kategorie [[:Category:$1|$1]] festgelegt. Dies bedeut