ication-error','s:24:\"Datenreplikationsproblem\";'),('de','messages:smw-es-replication-error-bad-request-exception','s:211:\"Der Verbindungshandler fr Elasticsearch hat einen Fehler ausgegeben (HTTP-Status 400: Fehlerhafte Anfrage). Dies deutet auf ein Weitergabeproblem whrend der Datenreplikation sowie bei Suchanfragen hin.\";'),('de','messages:smw-es-replication-error-divergent-date','s:185:\"Whrend der berwachung der Datenreplikation wurde festgestellt, dass die Seite $1 (Kennung: $2) in der Elasticsearch-Datenbank ein abweichendes <b>nderungsdatum</b> aufweist.\";'),('de','messages:smw-es-replication-error-divergent-date-detail','s:53:\"nderungsdatum:\n* Elasticsearch: $1 \n* Datenbank: $2\";'),('de','messages:smw-es-replication-error-divergent-date-short','s:70:\"Die folgenden Datumsinformationen wurden fr den Vergleich verwendet:\";'),('de','messages:smw-es-replication-error-divergent-revision','s:147:\"Mit Hilfe der Replikationsberwachung wurde festgestellt, dass die <b>zugehrige Version</b> der Seite $1 (Kennung: $2) eine Abweichung aufweist.\";'),('de','messages:smw-es-replication-error-divergent-revision-detail','s:51:\"Seitenversion:\n* Elasticsearch: $1 \n* Datenbank: $2\";'),('de','messages:smw-es-replication-error-divergent-revision-short','s:73:\"Die folgenden verbundenen Revisionen wurden fr den Vergleich verwendet:\";'),('de','messages:smw-es-replication-error-file-ingest-missing-file-attachment','s:270:\"Mit Hilfe der Replikationsberwachung wurde festgestellt, dass der Seite $1 die Annotation des [[Property:File attachment|Dateianhangs]] fehlt. Mit dieser Annotation wird angezeigt, dass die Dateiindexierung noch nicht gestartet wurde oder noch nicht beendet ist.\";'),('de','messages:smw-es-replication-error-file-ingest-missing-file-attachment-suggestions','s:231:\"Es muss sichergestellt sein, dass der Auftrag zur [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/File_ingestion Dateiindexierung] erzeugt und ausgefhrt wurde, bevor Annotation und Dateiindex verfgbar gemacht werden.\";'),('de','messages:smw-es-replication-error-maintenance-mode','s:316:\"Die Replikation von Elasticsearch ist derzeit eingeschrnkt, da sie im [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Maintenance_mode <b>Wartungsmodus</b>] luft. nderungen an Datenobjekten und Seiten sind daher <b>nicht</b> sofort sichtbar. Zudem knnten Abfragen veraltete Informationen ausgeben.\";'),('de','messages:smw-es-replication-error-missing-id','s:169:\"Whrend der berwachung der Datenreplikation wurde festgestellt, dass die Seite $1 (Kennung: <code>$2</code>) nicht in der Elasticsearch-Datenbank enthalten ist.\";'),('de','messages:smw-es-replication-error-no-connection','s:141:\"Die Replikationsberwachung kann keine Prfungen durchfhren, da keine Verbindung mit der Elasticsearch-Datenbank hergestellt werden kann.\";'),('de','messages:smw-es-replication-error-other-exception','s:72:\"Der Elasticserach-Handler hat den folgenden Fehler ausgegeben: $1.\";'),('de','messages:smw-es-replication-error-suggestions','s:247:\"Es wird empfohlen, die Seite zu bearbeiten oder deren Cache zu leeren, um die Unstimmigkeit zu beseitigen. Sofern das Problem weiterhin besteht, ist der Elasticsearch-Cluster selbst (Datenzuteilung, Fehlermeldungen, Speicherplatz usw.) zu prfen.\";'),('de','messages:smw-es-replication-error-suggestions-exception','s:175:\"Die Logbcher von Elasticsearch mssen eingesehen werden, um Informationen zu dessen Status, dessen Indizes und mglichen Problemen wie einer Fehlkonfiguration zu erhalten.\";'),('de','messages:smw-es-replication-error-suggestions-maintenance-mode','s:344:\"Der Systemadministrator des Wikis mu kontaktiert werden, damit geprft wird, ob derzeit entweder eine [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Index_rebuild Neuerstellung des Index] ausgefhrt wird oder der Indexierungsintervall (<code>refresh_interval</code>) ggf. nicht mit dem bentigten Standardwert festgelegt wurde.\";'),('de','messages: