ehenden Wartungsaufgaben vorhanden.\";'),('de','messages:smw-pendingtasks-setup-tasks','s:16:\"Wartungsaufgaben\";'),('de','messages:smw-pendingtasks-tab-setup','s:12:\"Installation\";'),('de','messages:smw-personal-jobqueue-watchlist','s:43:\"Beobachtungsliste zur Auftragswarteschlange\";'),('de','messages:smw-personal-jobqueue-watchlist-explain','s:150:\"Bei den Zahlen handelt es sich um ungefhre Angaben zu den noch offenen Eintrgen in der Auftragswarteschlange, die noch ausgefhrt werden mssen.\";'),('de','messages:smw-populatehashfield-incomplete','s:383:\"Das Befllen des Datentabellenfelds <code>smw_hash</code> wurde whrend der Installation oder Aktualisierung bersprungen. In der Folge erfordert dies das Ausfhren des Wartungsskripts [https://www.semantic-mediawiki.org/wiki/Help:populateHashField.php populateHashField.php], damit die vorhanden Datenstze aktualisiert und somit weiterhin korrekt genutzt werden knnen.\";'),('de','messages:smw-postproc-queryref','s:105:\"Die Software Semantic MediaWiki wird diese Seite neu laden und so eine Aktualisierung der Daten bewirken.\";'),('de','messages:smw-prefs-ask-options-compact-view-basic','s:27:\"Kompakte Ansicht aktivieren\";'),('de','messages:smw-prefs-ask-options-tooltip-display','s:121:\"Beschreibung der mglichen Ausgabeparameter als Tooltip auf der Spezialseite [[Special:Ask|Semantische Suche]] anzeigen.\";'),('de','messages:smw-prefs-general-options-disable-editpage-info','s:57:\"Hinweise whrend des Bearbeitens von Seiten deaktivieren\";'),('de','messages:smw-prefs-general-options-disable-search-info','s:88:\"Hinweise zur fr die Suche nutzbaren Wikisyntax auf der Standard-Suchseite deaktivieren\";'),('de','messages:smw-prefs-general-options-jobqueue-watchlist','s:91:\"Auftragswarteschlangen-Beobachtungsliste in meiner persnlichen Navigationsleiste anzeigen\";'),('de','messages:smw-prefs-general-options-suggester-textinput','s:49:\"Eingabehilfen fr semantische Objekte aktivieren\";'),('de','messages:smw-prefs-general-options-time-correction','s:145:\"Zeitkorrektur fr Spezialseiten mithilfe der lokalen [[Special:Preferences#mw-prefsection-rendering|Einstellung zum Zeitunterschied]] aktivieren\";'),('de','messages:smw-prefs-help-ask-options-compact-view-basic','s:135:\"Falls aktiviert, wird auf der Spezialseite Semantische Suche in der kompakten Ansicht eine reduzierte Anzahl von Links angezeigt.\";'),('de','messages:smw-prefs-help-general-options-jobqueue-watchlist','s:219:\"Falls aktiviert, wird eine [https://www.semantic-mediawiki.org/wiki/Help:Job_queue_watchlist Liste ausstehender Softwareauftrge] zusammen mit dem geschtzten Umfang der entsprechenden Auftragswarteschlange angezeigt.\";'),('de','messages:smw-prefs-help-general-options-suggester-textinput','s:190:\"Falls aktiviert, ist es von Eingabefeldern aus mglich, eine [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Eingabehilfe] zu Attributen, Konzepten und Kategorien aufzurufen.\";'),('de','messages:smw-prefs-intro-text','s:360:\"[https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki__Startseite Semantic MediaWiki] und zugehrige Erweiterungen bieten die Mglichkeit individueller Einstellungen fr ausgewhlte Funktionen. Siehe hierzu auch die entsprechende [https://www.semantic-mediawiki.org/wiki/Help:Benutzereinstellungen Hilfeseite] fr eine ausfhrliche Beschreibung.\";'),('de','messages:smw-preparing','s:15:\"Vorbereiten \";'),('de','messages:smw-prev','s:26:\"vorherige {{PLURAL:$1|$1}}\";'),('de','messages:smw-printername-feed','s:15:\"Feed (RSS/Atom)\";'),('de','messages:smw-processing','s:20:\"Verarbeite Daten \";'),('de','messages:smw-processingerrorlist-helplink','s:62:\"https://www.semantic-mediawiki.org/wiki/Help:Processing_errors\";'),('de','messages:smw-processingerrorlist-intro','s:385:\"Die folgende Liste bietet eine bersicht ber die [https://www.semantic-mediawiki.org/wiki/Processing_errors Verarbeitungsfehler], die beim Nutzen von [https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki/de Semantic MediaWiki] aufgetreten sind. Es wird empfohlen, diese Liste regelmig einzusehen und ungltige Attribut-Datenwert-Zuweisungen (Annotationen) zu korrigieren.\";'),('de','messages:smw-property-indicator-last-count-update','s:86:\"Ungefhre Anzahl der Datenwertzuordnungen zu diesem Attribut\nZuletzt aktualisiert: $1\";'),('de','messages:smw-property-indicator-type-info','s:87:\"{{PLURAL:$1|Von einem Benutzer festgelegtes Attribut|Vom System vorgegebenes Attribut}}\";'),('de','messages:smw-property-label-similarity-docu','s:796:\"Diese Spezialseite vergleicht die [https://www.semantic-mediawiki.org/wiki/Property_similarity syntaktische hnlichkeit], nicht aber die semantische hnlichkeit, zwischen zwei Attributbezeichnungen und gibt diese an. Diese Analyse kann beim Ermitteln von orthografisch falsch geschriebenen oder gleichwertigen Attributen helfen, die konzeptionell gleichbedeutend sind. Siehe auch die Spezialseite [[Special:Properties|Attribute]], um Konzeption und Nutzung der hier angegebenen Attribute weiter zu klren. Der Schwellenwert fr die Analyse kann angepasst werden, um die hnlichkeits- und Distanzmae entweder zu erweitern oder zu verringern. Zudem kann das Attribut [[Property:$1|$1]] dazu genutzt werden bestimmte Attribute von der hier durchgefhrten Analyse auszuschlieen.\";'),('de','messages:smw-property-label-similarity-intro','s:77:\"<u>$1</u> ermittelt hnlichkeiten zwischen vorhandenen Attributbezeichnungen\";'),('de','messages:smw-property-label-similarity-noresult','s:51:\"Den Auswahlkriterien entsprechend keine Ergebnisse.\";'),('de','messages:smw-property-label-similarity-threshold','s:14:\"Schwellenwert:\";'),('de','messages:smw-property-label-similarity-title','s:49:\"Bericht zur hnlichkeit von Attributbezeichungen\";'),('de','messages:smw-property-label-similarity-type','s:33:\"Bezeichner des Datentyps anzeigen\";'),('de','messages:smw-property-label-uniqueness','s:218:\"Die Bezeichnung $1 entspricht mindestens der eines weiteren Attributs. Siehe hierzu die [https://www.semantic-mediawiki.org/wiki/Help:Property_uniqueness Hilfeseite] mit Informationen zur Lsung dieses Problems.\";'),('de','messages:smw-property-name-invalid','s:77:\"Das Attribut $1 kann nicht verwendet werden (ungltiger Attributname).\";'),('de','messages:smw-property-name-reserved','s:258:\"$1 ist als reservierter Name gelistet und sollte nicht als Attributname verwendet werden. Die folgende [https://www.semantic-mediawiki.org/wiki/Help:Property_naming Hilfeseite] knnte Informationen darber enthalten, warum dieser Name reserviert ist.\";'),('de','messages:smw-property-namespace-disabled','s:217:\"Der [https://www.semantic-mediawiki.org/wiki/Help:$smwgNamespacesWithSemanticLinks Namensraum Attribut] ist inaktiv. Es ist nicht mglich, einen Datentyp oder andere Eigenschaften zu einem Attribut festzulegen.\";'),('de','messages:smw-property-page-filter-note','s:710:\"Der [https://www.semantic-mediawiki.org/wiki/Help:Property_page/Filter Filter fr die Suche nach Datenwerten zu Attributen] untersttzt die Nutzung von [https://www.semantic-mediawiki.org/wiki/Help:Query_expressions Abfrageausdrcken] wie bpsw. <code>~</code> oder <code>!</code>. Je nach genutzter [https://www.semantic-mediawiki.org/wiki/Query_engine Abfragedatenbank] werden auch die gro- und kleinschreibungsunabhngige Suche oder auch folgende weitere Abfrageausdrcke untersttzt:\n\n* <code>in:</code>: Das Ergebnis soll den angegebenen Begriff enthalten, wie bspw. <code>in:Foo</code>\n\n* <code>not:</code>: Das Ergebnis soll den angegebenen Begriff nicht enthalten, wie bpsw. <code>not:Bar</code>\";'),('de','messages:smw-property-page-list-count','s:131:\"Unterhalb {{PLURAL:$1|wird eine Seite|werden $1 Seiten}} angezeigt, auf denen fr dieses Attribut ein Datenwert gespeichert wurde.\";'),('de','messages:smw-property-page-list-search-count','s:133:\"Es {{PLURAL:$1|wird eine Seite|werden $1 Seiten}} angezeigt, auf denen fr dieses Attribut der Datenwert $2 gespeichert wurde.\";