idator-inaccessible','s:242:\"Der JSON-Validator <b>$1</b> ist nicht aufrufbar oder wurde nicht installiert. Dies ist der Grund, warum die Datei $2 nicht verarbeitet werden kann. Dies verhindert, da die aktuelle Seite verndert oder gespeichert werden kann.\";'),('de','messages:smw-schema-error-violation','s:20:\"[$1, $2]\";'),('de','messages:smw-schema-namespace-edit-protection','s:217:\"Diese Seite ist bearbeitungsgeschtzt, um unbeabsichtigte Vernderungen an Inhalten zu verhindern. Sie kann deshalb nur von Benutzern mit der hierfr notwendigen Berechtigung smw-schemaedit bearbeitet werden.\";'),('de','messages:smw-schema-namespace-edit-protection-by-import-performer','s:206:\"Diese Seite wurde mit einem [https://www.semantic-mediawiki.org/wiki/Import_performer Importwerkzeug] importiert. Der Inhalt dieser Seite kann daher nur von den hier angegebenen Benutzern verndert werden.\";'),('de','messages:smw-schema-namespace-editcontentmodel-disallowed','s:130:\"Das ndern des Inhaltsmodells der [https://www.semantic-mediawiki.org/wiki/Help:Schema Seite zu einem Schema] ist nicht mglich.\";'),('de','messages:smw-schema-summary-title','s:15:\"Zusammenfassung\";'),('de','messages:smw-schema-tag','s:31:\"{{PLURAL:$1|Schemakennzeichen}}\";'),('de','messages:smw-schema-title','s:6:\"Schema\";'),('de','messages:smw-schema-type','s:9:\"Schematyp\";'),('de','messages:smw-schema-type-description','s:27:\"Beschreibung des Schematyps\";'),('de','messages:smw-schema-type-help-link','s:59:\"https://www.semantic-mediawiki.org/wiki/Help:Schema/Type/$1\";'),('de','messages:smw-schema-usage','s:12:\"Annotationen\";'),('de','messages:smw-schema-validation-error','s:167:\"Der Datentype $1 ist unbekannt und kann nicht fr Inhalte im [https://www.semantic-mediawiki.org/wiki/Help:Schema Namensraum smw/schema] verwendet werden.\";'),('de','messages:smw-schema-validation-schema-title','s:11:\"JSON-Schema\";'),('de','messages:smw-search-help-ask','s:461:\"Die folgenden Links verweisen auf Seiten, auf denen die semantische Abfragesyntax (<code>#ask:</code>-Syntax) erlutert wird:\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Seiten auswhlen] beschreibt, wie Seiten ausgewhlt und Abfragebedingungen erstellt werden\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Search_operators Suchoperatoren] listet verfgbare Suchoperatoren inklusive solcher fr Bereichs- und Platzhalterabfragen auf\";'),('de','messages:smw-search-help-input-assistance','s:407:\"Fr das Eingabefeld wird eine [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Eingabeuntersttzung] angeboten. Diese erfordert die Nutzung eines der folgenden Prfixe:\n\n* <code>p:</code> zur Aktivierung einer Attributsuche (z.&nbsp;B. <code><nowiki>[[p:Has ...</nowiki></code>)\n\n* <code>c:</code> zur Aktivierung einer Kategoriesuche\n\n* <code>con:</code> zur Aktivierung einer Konzeptsuche\";'),('de','messages:smw-search-help-intro','s:318:\"Eine Eingabe von <code><nowiki>[[ ... ]]</nowiki></code> bewirkt, dass die strukturierte Suche von Semantic MediaWiki genutzt wird. Die Kombination von <code><nowiki>[[ ... ]]</nowiki></code> mit einer unstrukturierten Textsuche wie bspw. <code><nowiki>[[ ... ]] OR Lorem ipsum</nowiki></code> wird nicht untersttzt.\";'),('de','messages:smw-search-help-proximity','s:361:\"Nherungssuchanfragen (ein Attribut ist unbekannt, \'\'\'nur\'\'\' verfgbar fr solche Datenbanken, die eine Volltextsuche bereitstellen):\n\n* <code><nowiki>[[in:lorem ipsum]]</nowiki></code> (sucht in allen indexierten Dokumenten nach lorem und ipsum)\n\n* <code><nowiki>[[phrase:lorem ipsum]]</nowiki></code> (sucht nach lorem ipsum als Ausdruck)\";'),('de','messages:smw-search-help-structured','s:363:\"Strukturierte Suchanfragen:\n\n*<code><nowiki>[[Category:Lorem ipsum]]</nowiki></code>, <code><nowiki>[[Has number::123]]</nowiki></code> (als [https://www.semantic-mediawiki.org/wiki/Help:Search#Filter_context Filterung])\n\n*<code><nowiki>[[Has text::~*lorem*]]</nowiki></code> (mit einer [https://www.semantic-mediawiki.org/wiki/Help:Search#Query_context Abfrage])\";'),('de','messages:smw-search-hide','s:10:\"Ausblenden\";'),('de','messages:smw-search-input','s:17:\"Eingabe und Suche\";'),('de','messages:smw-search-input-assistance','s:167:\"Die [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Eingabehilfe] ist ebenfalls aktiviert, um die Auswahl von Attributen und Kategorien zu vereinfachen.\";'),('de','messages:smw-search-profile','s:5:\"Extra\";'),('de','messages:smw-search-profile-extended-help-find-forms','s:21:\"verfgbare Formulare\";'),('de','messages:smw-search-profile-extended-help-form','s:257:\"Formulare werden Benutzern zur Verfgung gestellt, um spezielle Nutzungsflle bei der Suche abzudecken. Formulare knnen unterschiedliche Attribut- und Werteingabefelder enthalten, um es Benutzern leichter zu machen, eine Suche durchzufhren. (siehe $1)\";'),('de','messages:smw-search-profile-extended-help-intro','s:268:\"Das [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch/Extended_profile erweiterte Suchprofil] bietet auf der Seite Spezial:Suche Zugriff auf Suchfunktionen, die spezifisch fr die Erweiterung Semantic MediaWiki sind. Die Suchfunktionen bestehen aus:\";'),('de','messages:smw-search-profile-extended-help-namespace','s:187:\"Der Auswahlkasten fr Namensrume wird ausgeblendet, sobald ein Formular ausgewhlt wurde. Dieser kann jedoch mithilfe der Schaltflchen Anzeigen wieder sichtbar gemacht werden.\";'),('de','messages:smw-search-profile-extended-help-query','s:66:\"<code><nowiki>$1</nowiki></code> wurde fr die Abfrage verwendet.\";'),('de','messages:smw-search-profile-extended-help-query-link','s:25:\"Weitere Einzelheiten: $1.\";'),('de','messages:smw-search-profile-extended-help-search-syntax','s:212:\"Das Eingabefeld der Suche untersttzt die Nutzung der von Semantic MediaWiki bereitgestellten Abfragesyntax (<code>#ask:</code>-Syntax) zur Durchfhrung einer semantischen Suche. Ntzliche Suchausdrcke sind:\";'),('de','messages:smw-search-profile-extended-help-search-syntax-note','s:149:\"\'\'Einige der gelisteten Suchausdrcke sind nur in Verbindung mit einem aktivierten Volltextsuchindex oder einer ElasticSearch-Datenbank ntzlich.\'\'\";'),('de','messages:smw-search-profile-extended-help-search-syntax-prefix','s:101:\"* Zustzliche benutzerdefinierte Suchausdrcke sind verfgbar und definiert wie beispielsweise: $1\";'),('de','messages:smw-search-profile-extended-help-search-syntax-reserved','s:79:\"* Einige Suchausdrcke sind reserviert wie beispielsweise: <nowiki>$1</nowiki>\";'),('de','messages:smw-search-profile-extended-help-search-syntax-simplified-has','s:190:\"* <code>has:</code>, um alle Objekte eines angegebenen Attributs \"\" zu finden (z.&nbsp;B.: <code>has:(Foo && Bar)</code> entspricht <code><nowiki>[[Foo::+]] && [[Bar::+]]</nowiki></code>)\";'),('de','messages:smw-search-profile-extended-help-search-syntax-simplified-in','s:304:\"* <code>in:</code>, um alles zu finden, was die Eingabe \"\" enthlt. Dies ist insbesondere ntzlich, wenn die gesuchten Begriffe nicht eindeutig und/oder die Attribute unbekannt sind (z.&nbsp;B.:<code>in:(lorem && ipsum)</code> entspricht <code><nowiki>[[~~*lorem*]] && [[~~*ipsum*]]</nowiki></code>)\";'),('de','messages:smw-search-profile-extended-help-search-syntax-simplified-not','s:84:\"* <code>not:</code>, um keines der Objekte zu finden, das die Eingabe \"\" enthlt\";'),('de','messages:smw-search-profile-extended-help-search-syntax-simplified-phrase','s:82:\"* <code>phrase:</code>, um alles zu finden, was exakt der Eingabe \"\" entspricht\";'),('de','messages:smw-search-profile-extended-help-sort','s:98:\"Ermglicht die Anpassung der Anzeige von Suchergebnissen mit den folgenden Auswahlmglichkeiten:\";'),('de','messages:smw-search-profile-extended-help-sort-best','s:265:\"* Beste Treffer  verwendet die [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Relevancy Relevanz von Seiten] als Sortierkriterium. Die Relevanz sttzt sich auf sogenannte Scores, die von Elasticsearch ermittelt und bereitgestellt werden.\";'),('de','messages:smw-search-profile-extended-help-sort-recent','s:281:\"* Aktuellste Treffer  verwendet den Zeitpunkt der letzten nderung als Sortierkriterium. Ergebnisse aus Unterobjekten werden indes nicht angezeigt, da sie generell nicht mit dem notwendigen Attribut [[Property:Modification date|Zuletzt gendert]] annotiert werden.\";'),('de','messages:smw-search-profile-extended-help-sort-title','s:78:\"* Titel  verwendet den Seiten- oder Anzeigetitel als Sortierkriterium\";'),('de','messages:smw-search-profile-extended-section-form','s:9:\"Formulare\";'),('de','messages:smw-search-profile-extended-section-namespace','s:10:\"Namensraum\";'),('de','messages:smw-search-profile-extended-section-query','s:7:\"Abfrage\";'),('de','messages:smw-search-profile-extended-section-search-syntax','s:11:\"Sucheingabe\";'),('de','messages:smw-search-profile-extended-section-sort','s:14:\"Sortieren nach\";'),('de','messages:smw-search-profile-link-caption-query','s:17:\"Abfragengenerator\";'),('de','messages:smw-search-profile-sort-best','s:13:\"Beste Treffer\";'),('de','messages:smw-search-profile-sort-recent','s:18:\"Aktuellste Treffer\";'),('de','messages:smw-search-profile-sort-title','s:5:\"Titel\";'),('de','messages:smw-search-profile-tooltip','s:51:\"Suchfunktionen in Verbindung mit Semantic MediaWiki\";'),('de','messages:smw-search-show','s:8:\"Anzeigen\";'),('de','messages:smw-search-syntax','s:6:\"Syntax\";'),('de','messages:smw-search-syntax-support','s:223:\"Die Sucheingabe untersttzt die Nutzung der von Semantic MediaWiki bereitgestellten [https://www.semantic-mediawiki.org/wiki/Help:Semantic_search Abfragesyntax] (<code>#ask:</code>-Syntax) zum Ermitteln der Suchergebnisse.\";'),('de','messages:smw-section-collapse','s:20:\"Abschnitt einklappen\";'),('de','messages:smw-section-expand','s:20:\"Abschnitt ausklappen\";'),('de','messages:smw-semantics-not-enabled','s:70:\"Momentan kann 