n oder Hinzufgen von Tabellenindizes, und\n* sofern aktiviert, das Ausfhren von Tabellenoptimierungen.\";'),('de','messages:smw-upgrade-maintenance-note','s:341:\"Die vom Wiki genutzte Softwareerweiterung [https://www.semantic-mediawiki.org/ Semantic MediaWiki] wird momentan mitsamt der zugehrigen Datenbank [https://www.semantic-mediawiki.org/wiki/Help:Upgrade aktualisiert]. Wir bitten daher um Geduld, bis dieser Vorgang abgeschlossen ist, und das Wiki wieder zugnglich gemacht werden kann.\";'),('de','messages:smw-upgrade-maintenance-title','s:37:\"Aktualisierungs- und Wartungsarbeiten\";'),('de','messages:smw-upgrade-maintenance-why-title','s:27:\"Warum sehe ich diese Seite?\";'),('de','messages:smw-upgrade-progress','s:26:\"Aktualisierungsfortschritt\";'),('de','messages:smw-upgrade-progress-create-tables','s:68:\"Die Datentabellen oder Indizes werden erstellt oder aktualisiert ...\";'),('de','messages:smw-upgrade-progress-explain','s:361:\"Eine Abschtzung hinsichtlich der Dauer der Aktualisierung ist schwierig. Der Zeitbedarf ist abhngig von der Gre der Datenbank und der Leistungsfhigkeit der Hardware des Servers. Bei greren Wikis wird mehr Zeit bentigt.\n\nUm nhere Informationen zum Fortschritt bei der Aktualisierung zu erhalten, kann der Serveradministrator kontaktiert werden.\";'),('de','messages:smw-upgrade-progress-post-creation','s:50:\"Allgemeine Wartungsaufgaben werden ausgefhrt ...\";'),('de','messages:smw-upgrade-progress-supplement-jobs','s:49:\"Zustzliche Wartungsaufgaben werden erstellt ...\";'),('de','messages:smw-upgrade-progress-table-optimization','s:42:\"Die Datenbanktabellen werden optimiert ...\";'),('de','messages:smw-upgrade-release','s:17:\"Verffentlichung\";'),('de','messages:smw-wantedproperties-docu','s:398:\"Diese Seite listet alle [https://www.semantic-mediawiki.org/wiki/Wanted_properties gewnschten Attribute] auf. Sie werden im Wiki verwendet, wurden indes noch nicht auf einer Seite im Namensraum Attribut: beschrieben. Fr eine differe