,('de','messages:smw_sbv_submit','s:17:\"Ergebnisse suchen\";'),('de','messages:smw_sbv_value','s:5:\"Wert:\";'),('de','messages:smw_smwadmin_datarefresh','s:19:\"Daten neu erstellen\";'),('de','messages:smw_smwadmin_datarefreshbutton','s:26:\"Datenaktualisierung planen\";'),('de','messages:smw_smwadmin_datarefreshdocu','s:614:\"Es ist mglich alle Datenbanken von Semantic MediaWiki auf Basis des aktuellen Inhalts des Wikis wiederherzustellen.\nDies kann hilfreich sein, um eine fehlerhafte Datenbank zu erneuern oder um Daten zu aktualisieren, sofern bspw. aufgrund einer Softwareaktualisierung die Datenbankstruktur gendert wurde.\nDie Datenaktualisierung wird fr jede Seite ausgefhrt und daher einige Zeit in Anspruch nehmen.\nNachfolgend wird angezeigt, ob eine momentan Aktualisierung luft bzw. ermglicht es eine Aktualisierung zu starten oder zu stoppen (sofern diese Funktion nicht vom Websiteadministrator deaktiviert wurde).\";'),('de','messages:smw_smwadmin_datarefreshprogress','s:660:\"<strong>Eine Aktualisierung wird bereits durchgefhrt.</strong>\nEine Aktualisierung geht normalerweise nur langsam voran, da die Daten lediglich in kleinen Schritten erneuert werden, und zwar jedes Mal, wenn ein Benutzer auf das Wiki zugreift.\nUm diese Aktualisierung schneller zu Ende zu fhren, kann man das MediaWiki-Wartungsskript runJobs.php einsetzen. Mit dem Parameter <code>--maxjobs 1000</code> beschrnkt man dabei die Anzahl der Aktualisierungsschritte, die in einem Durchgang durchgefhrt werden, um Probleme bei der Nutzung des hierfr erforderlichen Arbeitsspeichers zu vermeiden.\nGeschtzter Fortschritt der laufenden Aktualisierung:\";'),('de','messages:smw_smwadmin_datarefreshstop','s:33:\"Diese Datenaktualisierung beenden\";'),('de','messages:smw_smwadmin_datarefreshstopconfirm','s:37:\"Ja, ich bin mir {{GENDER:$1|sicher}}.\";'),('de','messages:smw_smwadmin_return','s:21:\"Zurck zur Seite $1.\";'),('de','messages:smw_smwadmin_updatenotstarted','s:74:\"Es luft bereits ein Aktualisierungsprozess.\nEs wird kein neuer begonnen.\";'),('de','messages:smw_smwadmin_updatenotstopped','s:182:\"Um den laufenden Aktualisierungsprozess vorzeitig zu beenden, muss das Kontrollkstchen markiert werden, um dadurch anzuzeigen, dass man sich diesbezglich tatschlich sicher ist.\";'),('de','messages:smw_smwadmin_updatestarted','s:253:\"Ein Aktualisierungsprozess zur Erneuerung der semantischen Daten wurde gestartet.\nAlle gespeicherten Daten werden, sofern notwendig, entweder neu erstellt oder repariert.\nDer Fortschritt der Aktualisierung kann auf dieser Spezialseite eingesehen werden.\";'),('de','messages:smw_smwadmin_updatestopped','s:64:\"Alle laufenden Aktualisierungsprozesse wurden vorzeitig beendet.\";'),('de','messages:smw_toomanyclosing','s:44:\"In der Abfrage kommen zu viele $1 vor.\";'),('de','messages:smw_true_words','s:11:\"wahr,w,ja,j\";'),('de','messages:smw_type_header','s:35:\"Attribute mit dem Datentyp $1\";'),('de','messages:smw_typearticlecount','s:85:\"Es {{PLURAL:$1|wird ein Attribut|werden $1 Attribute}} mit diesem Datentyp angezeigt:\";'),('de','messages:smw_types_docu','s:365:\"Dies ist eine [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes Liste aller Datentypen], die Attributen zugewiesen werden knnen. Jeder [https://www.semantic-mediawiki.org/wiki/Help:Datatype Datentyp] beschreibt eindeutige Merkmale zur Datenspeicherung und -anzeige eines Datenwerts fr ein Attribut, dem der entsprechende Datentyp zugeordnet wurde.\";'),('de','messages:smw_unexpectedpart','s:130:\"Der Teil $1 der Abfrage konnte nicht interpretiert werden. Die Ergebnisse entsprechen mglicherweise nicht den Erwartungen.\";'),('de','messages:smw_unitnotallowed','s:78:\"$1 wurde nicht als gltige Maeinheit fr dieses Attribut festgelegt.\";'),('de','messages:smw_unknowntype','s:53:\"Der Datentyp $1 dieses Attributs ist ungltig.\";'),('de','messages:smw_uri_blacklist','s:117:\"https://www.w3.org/1999/02/22-rdf-syntax-ns#\n https://www.w3.org/2000/01/rdf-sche