ot}</var>. If not supplied, it will be guessed based on the other parameters.\";'),('en','messages:apihelp-compare-param-fromid','s:25:\"First page ID to compare.\";'),('en','messages:apihelp-compare-param-frompst','s:59:\"Do a pre-save transform on <var>fromtext-&#x7B;slot}</var>.\";'),('en','messages:apihelp-compare-param-fromrev','s:26:\"First revision to compare.\";'),('en','messages:apihelp-compare-param-fromsection','s:63:\"Only use the specified section of the specified \'from\' content.\";'),('en','messages:apihelp-compare-param-fromsection-{slot}','s:237:\"When <var>fromtext-&#x7B;slot}</var> is the content of a single section, this is the section number. It will be merged into the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var> as if for a section edit.\";'),('en','messages:apihelp-compare-param-fromslots','s:326:\"Override content of the revision specified by <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>fromtext-&#x7B;slot}</var>, <var>fromcontentmodel-&#x7B;slot}</var>, and <var>fromcontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('en','messages:apihelp-compare-param-fromtext','s:75:\"Specify <kbd>fromslots=main</kbd> and use <var>fromtext-main</var> instead.\";'),('en','messages:apihelp-compare-param-fromtext-{slot}','s:78:\"Text of the specified slot. If omitted, the slot is removed from the revision.\";'),('en','messages:apihelp-compare-param-fromtitle','s:23:\"First title to compare.\";'),('en','messages:apihelp-compare-param-prop','s:35:\"Which pieces of information to get.\";'),('en','messages:apihelp-compare-param-slots','s:85:\"Return individual diffs for these slots, rather than one combined diff for all slots.\";'),('en','messages:apihelp-compare-param-tocontentformat','s:80:\"Specify <kbd>toslots=main</kbd> and use <var>tocontentformat-main</var> instead.\";'),('en','messages:apihelp-compare-param-tocontentformat-{slot}','s:62:\"Content serialization format of <var>totext-&#x7B;slot}</var>.\";'),('en','messages:apihelp-compare-param-tocontentmodel','s:79:\"Specify <kbd>toslots=main</kbd> and use <var>tocontentmodel-main</var> instead.\";'),('en','messages:apihelp-compare-param-tocontentmodel-{slot}','s:114:\"Content model of <var>totext-&#x7B;slot}</var>. If not supplied, it will be guessed based on the other parameters.\";'),('en','messages:apihelp-compare-param-toid','s:26:\"Second page ID to compare.\";'),('en','messages:apihelp-compare-param-topst','s:45:\"Do a pre-save transform on <var>totext</var>.\";'),('en','messages:apihelp-compare-param-torelative','s:165:\"Use a revision relative to the revision determined from <var>fromtitle</var>, <var>fromid</var> or <var>fromrev</var>. All of the other \'to\' options will be ignored.\";'),('en','messages:apihelp-compare-param-torev','s:27:\"Second revision to compare.\";'),('en','messages:apihelp-compare-param-tosection','s:61:\"Only use the specified section of the specified \'to\' content.\";'),('en','messages:apihelp-compare-param-tosection-{slot}','s:229:\"When <var>totext-&#x7B;slot}</var> is the content of a single section, this is the section number. It will be merged into the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var> as if for a section edit.\";'),('en','messages:apihelp-compare-param-toslots','s:314:\"Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('en','messages:apihelp-compare-param-totext','s:71:\"Specify <kbd>toslots=main</kbd> and use <var>totext-main</var> instead.\";'),('en','messages:apihelp-compare-param-totext-{slot}','s:78:\"Text of the specified slot. If omitted, the slot is removed 