ist.\";'),('en','messages:apihelp-delete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-delete-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-delete-summary','s:14:\"Delete a page.\";'),('en','messages:apihelp-disabled-summary','s:30:\"This module has been disabled.\";'),('en','messages:apihelp-edit-example-edit','s:12:\"Edit a page.\";'),('en','messages:apihelp-edit-example-prepend','s:47:\"Prepend <kbd>_&#95;NOTOC_&#95;</kbd> to a page.\";'),('en','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('en','messages:apihelp-edit-param-appendtext','s:127:\"Add this text to the end of the page. Overrides $1text.\n\nUse $1section=new to append a new section, rather than this parameter.\";'),('en','messages:apihelp-edit-param-baserevid','s:211:\"ID of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions]]. Self-conflicts cause the edit to fail unless basetimestamp is set.\";'),('en','messages:apihelp-edit-param-basetimestamp','s:196:\"Timestamp of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]]. Self-conflicts are ignored.\";'),('en','messages:apihelp-edit-param-bot','s:29:\"Mark this edit as a bot edit.\";'),('en','messages:apihelp-edit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-edit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-edit-param-createonly','s:41:\"Don\'t edit the page if it exists already.\";'),('en','messages:apihelp-edit-param-md5','s:159:\"The MD5 hash of the $1text parameter, or the $1prependtext and $1appendtext parameters concatenated. If set, the edit won\'t be done unless the hash is correct.\";'),('en','messages:apihelp-edit-param-minor','s:31:\"Mark this edit as a minor edit.\";'),('en','messages:apihelp-edit-param-nocreate','s:41:\"Throw an error if the page doesn\'t exist.\";'),('en','messages:apihelp-edit-param-notminor','s:100:\"Do not mark this edit as a minor edit even if the \"{{int:tog-minordefault}}\" user preference is set.\";'),('en','messages:apihelp-edit-param-pageid','s:77:\"Page ID of the page to edit. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-edit-param-prependtext','s:61:\"Add this text to the beginning of the page. Overrides $1text.\";'),('en','messages:apihelp-edit-param-recreate','s:71:\"Override any errors about the page having been deleted in the meantime.\";'),('en','messages:apihelp-edit-param-redirect','s:32:\"Automatically resolve redirects.\";'),('en','messages:apihelp-edit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-edit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-edit-param-starttimestamp','s:242:\"Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('en','messages:apihelp-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('en','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-edit-param-title','s:76:\"Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-token','s:94:\"The token should always