learchive-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-from','s:42:\"The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:35:\"How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:55:\"Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-prop','s:31:\"Which image information to get:\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:43:\"SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:50:\"SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-to','s:39:\"The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-description','s:38:\"Adds description of the image version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:33:\"Adds the media type of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:49:\"Lists Exif metadata for the version of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:23:\"Adds MIME of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:37:\"Parse the description of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:30:\"Adds SHA-1 hash for the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-size','s:89:\"Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-user','s:41:\"Adds user who uploaded the image version.\";'),('en','messages:apihelp-query+filearchive-summary','s:41:\"Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:40:\"Get information about file repositories.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:82:\"Which repository properties to get (properties available may vary on other wikis).\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:73:\"URL to the repository API - helpful for getting image info from the host.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:106:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:90:\"Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:47:\"The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:102:\"Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:106:\"Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:58:\"Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:48:\"Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:189:\"The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:30:\"Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:63:\"Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:96:\"Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:34:\"Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:21:\"Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:72:\"Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:19:\"How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:21:\"Page ID of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:31:\"Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-title','s:19:\"Title of each page.\";'),('en','messages:apihelp-query+fileusage-summary','s:40:\"Find all pages that use the given files.\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:113:\"If <kbd>$2prop=badfile</kbd> is set, this is the page title used when evaluating the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-param-end','s:29:\"Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:84:\"If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:180:\"What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:74:\"If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:43:\"How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:136:\"Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:157:\"Adds the filename of the archive version for non-latest versions. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:60:\"Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:126:\"Adds the bit depth of the version. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:129:\"Adds the canonical title of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:121:\"Comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:155:\"Lists file format generic metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:176:\"Lists formatted metadata combined from multiple sources. Results are HTML formatted. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:124:\"Adds the media type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:140:\"Lists Exif metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:119:\"Adds MIME type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:131:\"Parse the comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:121:\"Adds SHA-1 hash for the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:88:\"Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:166:\"Adds MIME type of the image thumbnail (requires url and param $1urlwidth). If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:119:\"Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-paramvalu