imit','s:179:\"How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+imageusage-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+imageusage-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+imageusage-param-redirect','s:106:\"If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+imageusage-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+imageusage-summary','s:46:\"Find all pages that use the given image title.\";'),('en','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-example-simple','s:52:\"Get information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+info-param-testactions','s:70:\"Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-testactionsdetail','s:196:\"Detail level for <var>$1testactions</var>. Use the [[Special:ApiHelp/main|main module]]\'s <var>errorformat</var> and <var>errorlang</var> parameters to control the format of the messages returned.\";'),('en','messages:apihelp-query+info-param-token','s:70:\"Use [[Special:ApiHelp/query+tokens|action=query&meta=tokens]] instead.\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:63:\"Gives the manner in which the page title is actually displayed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:50:\"The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:47:\"Gives the text returned by EditFormPreloadText.\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:39:\"List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:79:\"Whether the user can read this page. Use <kbd>intestactions=read</kbd> instead.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:50:\"The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-talkid','s:52:\"The page ID of the talk page for each non-talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-url','s:67:\"Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-varianttitles','s:69:\"Gives the display title in all variants of the site content language.\";'),('en','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:91:\"The number of watchers of each page who have visited recent edits to that page, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watched','s:37:\"List the watched status of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watchers','s:35:\"The number of watchers, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-boolean','s:39:\"Return a boolean value for each action.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-full','s:92:\"Return messages describing why the action is disallowed, or an empty array if it is allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-quick','s:51:\"Like <kbd>full</kbd> but skipping expensive checks.\";'),('en','messages:apihelp-query+info-summary','s:27:\"Get basic page information.\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:58:\"Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:40:\"Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-extended-description','s:153:\"Can be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+iwbacklinks-param-prefix','s:25:\"Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:70:\"Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:33:\"Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:32:\"Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-summary','s:53:\"Find all pages that link to the given interwiki link.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-summary','s:49:\"Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:52:\"Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:34:\"Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-extended-description','s:230:\"Can be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:31:\"Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:54:\"Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:44:\"Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:36:\"Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-summary','s:52:\"Find all pages that link to the given language link.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),