t-field','s:37:\"The value of this field is not valid.\";'),('en','messages:apisandbox-alert-page','s:34:\"Fields on this page are not valid.\";'),('en','messages:apisandbox-continue','s:8:\"Continue\";'),('en','messages:apisandbox-continue-clear','s:5:\"Clear\";'),('en','messages:apisandbox-continue-help','s:218:\"{{int:apisandbox-continue}} will [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Query#Continuing_queries continue] the last request; {{int:apisandbox-continue-clear}} will clear continuation-related parameters.\";'),('en','messages:apisandbox-deprecated-parameters','s:21:\"Deprecated parameters\";'),('en','messages:apisandbox-dynamic-error-exists','s:38:\"A parameter named \"$1\" already exists.\";'),('en','messages:apisandbox-dynamic-parameters','s:21:\"Additional parameters\";'),('en','messages:apisandbox-dynamic-parameters-add-label','s:14:\"Add parameter:\";'),('en','messages:apisandbox-dynamic-parameters-add-placeholder','s:14:\"Parameter name\";'),('en','messages:apisandbox-examples','s:8:\"Examples\";'),('en','messages:apisandbox-fetch-token','s:19:\"Auto-fill the token\";'),('en','messages:apisandbox-helpurls','s:10:\"Help links\";'),('en','messages:apisandbox-intro','s:460:\"Use this page to experiment with the <strong>MediaWiki web service API</strong>.\nRefer to [[mw:Special:MyLanguage/API:Main page|the API documentation]] for further details of API usage. Example: [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Tutorial#A_simple_query search for page titles matching a certain keyword]. Select an action to see more examples.\n\nNote that, although this is a sandbox, actions you carry out on this page may modify the wiki.\";'),('en','messages:apisandbox-jsonly','s:46:\"JavaScript is required to use the API sandbox.\";'),('en','messages:apisandbox-load-error','s:67:\"An error occurred while loading information for API module \"$1\": $2\";'),('en','messages:apisandbox-loading','s:42:\"Loading information for API module \"$1\"...\";'),('en','messages:apisandbox-loading-results','s:24:\"Receiving API results...\";'),('en','messages:apisandbox-multivalue-all-namespaces','s:19:\"$1 (All namespaces)\";'),('en','messages:apisandbox-multivalue-all-values','s:15:\"$1 (All values)\";'),('en','messages:apisandbox-no-parameters','s:34:\"This API module has no parameters.\";'),('en','messages:apisandbox-param-limit','s:46:\"Enter <kbd>max</kbd> to use the maximum limit.\";'),('en','messages:apisandbox-request-format-json-label','s:4:\"JSON\";'),('en','messages:apisandbox-request-format-url-label','s:16:\"URL query string\";'),('en','messages:apisandbox-request-json-label','s:13:\"Request JSON:\";'),('en','messages:apisandbox-request-selectformat-label','s:21:\"Show request data as:\";'),('en','messages:apisandbox-request-time','s:33:\"Request time: {{PLURAL:$1|$1 ms}}\";'),('en','messages:apisandbox-request-url-label','s:12:\"Request URL:\";'),('en','messages:apisandbox-reset','s:5:\"Clear\";'),('en','messages:apisandbox-results','s:7:\"Results\";'),('en','messages:apisandbox-results-error','s:59:\"An error occurred while loading the API query response: $1.\";'),('en','messages:apisandbox-results-fixtoken','s:26:\"Correct token and resubmit\";'),('en','messages:apisandbox-results-fixtoken-fail','s:27:\"Failed to fetch \"$1\" token.\";'),('en','messages:apisandbox-results-login-suppressed','s:238:\"This request has been processed as a logged-out user as it could be used to bypass browser Same-Origin security. Note that the API sandbox\'s automatic token handling does not work properly with such requests, please fill them in manually.\";'),('en','messages:apisandbox-retry','s:5:\"Retry\";'),('en','messages:apisandbox-sending-request','s:22:\"Sending API request...\";'),('en','messages:apisandbox-submit','s:12:\"Make request\";'),('en','messages:apisandbox-submit-invalid-fields-message','s:47:\"Please correct the marked fields and try again.\";'),('en','messages:apisandbox-submit-invalid-fields-title','s:23: