itors.\";'),('en','messages:sitejsonpreview','s:99:\"<strong>Remember that you are only previewing this JSON config.\nIt has not yet been saved!</strong>\";'),('en','messages:sitejsonprotected','s:85:\"You do not have permission to edit this JSON page because it may affect all visitors.\";'),('en','messages:sitejspreview','s:103:\"<strong>Remember that you are only previewing this JavaScript code.\nIt has not yet been saved!</strong>\";'),('en','messages:sitejsprotected','s:91:\"You do not have permission to edit this JavaScript page because it may affect all visitors.\";'),('en','messages:sitenotice','s:1:\"-\";'),('en','messages:siterawhtmlprotected','s:119:\"You do not have permission to edit this page because it contains raw HTML which can be modified to affect all visitors.\";'),('en','messages:sitesubtitle','s:0:\"\";'),('en','messages:sitetitle','s:12:\"{{SITENAME}}\";'),('en','messages:siteuser','s:20:\"{{SITENAME}} user $1\";'),('en','messages:siteusers','s:54:\"{{SITENAME}} {{PLURAL:$2|{{GENDER:$1|user}}|users}} $1\";'),('en','messages:size-bytes','s:27:\"$1 {{PLURAL:$1|byte|bytes}}\";'),('en','messages:size-exabytes','s:5:\"$1 EB\";'),('en','messages:size-exapixel','s:5:\"$1 EP\";'),('en','messages:size-gigabytes','s:5:\"$1 GB\";'),('en','messages:size-gigapixel','s:5:\"$1 GP\";'),('en','messages:size-kilobytes','s:5:\"$1 KB\";'),('en','messages:size-kilopixel','s:5:\"$1 KP\";'),('en','messages:size-megabytes','s:5:\"$1 MB\";'),('en','messages:size-megapixel','s:5:\"$1 MP\";'),('en','messages:size-petabytes','s:5:\"$1 PB\";'),('en','messages:size-petapixel','s:5:\"$1 PP\";'),('en','messages:size-pixel','s:29:\"$1 {{PLURAL:$1|pixel|pixels}}\";'),('en','messages:size-terabytes','s:5:\"$1 TB\";'),('en','messages:size-terapixel','s:5:\"$1 TP\";'),('en','messages:size-yottabytes','s:5:\"$1 YB\";'),('en','messages:size-yottapixel','s:5:\"$1 YP\";'),('en','messages:size-zetabytes','s:5:\"$1 ZB\";'),('en','messages:size-zetapixel','s:5:\"$1 ZP\";'),('en','messages:skin-preview','s:7:\"Preview\";'),('en','messages:skinname-chameleon','s:9:\"Chameleon\";'),('en','messages:skinname-monobook','s:8:\"MonoBook\";'),('en','messages:skinname-timeless','s:8:\"Timeless\";'),('en','messages:skinname-vector','s:6:\"Vector\";'),('en','messages:slot-name-main','s:4:\"Main\";'),('en','messages:smw-admin-alerts-section-intro','s:194:\"This section shows alerts and notices related to settings, operations, and other activities that have been classified to require attention from an administrator or user with appropriated rights.\";'),('en','messages:smw-admin-alerts-tab-deprecationnotices','s:19:\"Deprecation notices\";'),('en','messages:smw-admin-alerts-tab-maintenancealerts','s:18:\"Maintenance alerts\";'),('en','messages:smw-admin-announce','s:18:\"Announce your wiki\";'),('en','messages:smw-admin-announce-text','s:119:\"If your wiki is public, you can register it on <a href=\"https://wikiapiary.com\">WikiApiary</a>, the wiki tracking wiki.\";'),('en','messages:smw-admin-bugsreport','s:282:\"Bugs can be reported to the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">issue tracker</a>, the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Reporting_bugs\">reporting bugs</a> page provides some guidance on how to write an effective issue report.\";'),('en','messages:smw-admin-configutation-tab-namespaces','s:10:\"Namespaces\";'),('en','messages:smw-admin-configutation-tab-schematypes','s:12:\"Schema types\";'),('en','messages:smw-admin-configutation-tab-settings','s:8:\"Settings\";'),('en','messages:smw-admin-db','s:14:\"Database setup\";'),('en','messages:smw-admin-db-preparation','s:137:\"The table initialization is ongoing and may take a moment before results are displayed pending the size and possible table optimizations.\";'),('en','messages:smw-admin-dbbutton','s:28:\"Initialize or upgrade tables\";'),('en','messages:smw-admin-dbdocu','s:316:\"Semantic MediaWiki requires its own database structure (and is independent from MediaWiki hence do not affect the rest of the MediaWiki installation) in order to store the semantic data.\nThis setup function can be executed multiple times without doing any harm, but it is needed only once on installation or upgrade.\";'),('en','messages:smw-admin-deprecation-notice-config-notice','s:105:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> is deprecated and will be removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-notice-option','s:134:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> will remove (or replace) the following {{PLURAL:$2|option|options}}:\";'),('en','messages:smw-admin-deprecation-notice-config-notice-option-list','s:55:\"<code>$1</code> is deprecated and will be removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-removal','s:83:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was removed in $2\";'),('en','messages:smw-admin-deprecation-notice-config-replacement','s:147:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was replaced by <code>[https://www.semantic-mediawiki.org/wiki/Help:$2 $2]</code>\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-option','s:95:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> {{PLURAL:$2|option|options}}:\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-option-list','s:52:\"<code>$1</code> is being replaced by <code>$2</code>\";'),('en','messages:smw-admin-deprecation-notice-config-replacement-other','s:97:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> was replaced by <code>$2</code>\";'),('en','messages:smw-admin-deprecation-notice-docu','s:206:\"The following section contains settings that have been deprecated or removed but were detected to be active on this wiki. It is expected that any future release will remove support for these configurations.\";'),('en','messages:smw-admin-deprecation-notice-section','s:18:\"Semantic MediaWiki\";'),('en','messages:smw-admin-deprecation-notice-section-legend','s:6:\"Legend\";'),('en','messages:smw-admin-deprecation-notice-title','s:19:\"Deprecation notices\";'),('en','messages:smw-admin-deprecation-notice-title-notice','s:19:\"Deprecated settings\";'),('en','messages:smw-admin-deprecation-notice-title-notice-explanation','s:151:\"<b>Deprecated settings</b> shows settings that have been detected to be used on this wiki and are planned to be removed or changed in a future release.\";'),('en','messages:smw-admin-deprecation-notice-title-removal','s:16:\"Removed settings\";'),('en','messages:smw-admin-deprecation-notice-title-removal-explanation','s:131:\"<b>Removed settings</b> identifies settings that were removed in a previous release but have been detected to be used on this wiki.\";'),('en','messages:smw-admin-deprecation-notice-title-replacement','s:28:\"Replaced or renamed settings\";'),('en','messages:smw-admin-deprecation-notice-title-replacement-explanation','s:157:\"<b>Replaced or renamed settings</b> contains settings that were renamed or otherwise modified and it is recommended to forthwith update their name or format.\";'),('en','messages:smw-admin-docu','s:311:\"This special page helps you during installation, upgrade, maintenance and usage of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a> and also provides further administrative functions and tasks as well as statistics.\nRemember to back up valuable data before executing administrative functions.\";'),('en','messages:smw-admin-environment','s:20:\"Software environment\";'),('en','messages:smw-admin-feature-disabled','s:197:\"This feature has been disabled on this wiki, please consult the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">settings</a> help page or contact the system administrator.\";'),('en','messages:smw-admin-fulltext-active','s:50:\"A full-text search rebuild job has been scheduled.\";'),('en','messages:smw-admin-fulltext-button','s:26:\"Schedule full-text rebuild\";'),('en','messages:smw-admin-fulltext-intro','s:280:\"Rebuilds the search index from property tables with an enabled [https://www.semantic-mediawiki.org/wiki/Full-text full-text search] datatype. Changes to the index rules (altered stopwords, new stemmer etc.) and/or a newly added or altered table does require to run this job again.\";'),('en','messages:smw-admin-fulltext-title','s:24:\"Full-text search rebuild\";'),('en','messages:smw-admin-helplink','s:70:\"https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki\";'),('en','messages:smw-admin-iddispose-docu','s:342:\"It should be noted that the disposal operation is unrestricted and will remove the entity from the storage engine together with all its references in pending tables, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),('en','messages:smw-admin-iddispose-done','s:45:\"ID \"$1\" was removed from the storage backend.\";'),('en','messages:smw-admin-iddispose-no-references','s:53:\"The search was unable to match \"$1\" to a table entry.\";'),('en','messages:smw-admin-iddispose-references','s:59:\"ID \"$1\" has {{PLURAL:$2|no|at least one}} active reference:\";'),('en','messages:smw-admin-iddispose-references-multiple','s:58:\"List of matches with at least one active reference record.\";'),('en','messages:smw-admin-iddispose-title','s:8:\"Disposal\";'),('en','messages:smw-admin-idlookup-docu','s:303:\"This section shows technical details about an individual entity (wikipage, subobject, property, etc.) in Semantic MediaWiki. The input can be a numeric ID or a string value to match the relevant search field, yet any ID reference relates to Semantic MediaWiki and not to MediaWiki\'s page or revision ID.\";'),('en','messages:smw-admin-idlookup-input','s:7:\"Search:\";'),('en','messages:smw-admin-idlookup-title','s:6:\"Lookup\";'),('en','messages:smw-admin-installfile','s:299:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL file</a> and the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:Installation\">installation page</a>.\";'),('en','messages:smw-admin-job-scheduler-note','s:404:\"Tasks (those enabled) in this section are performed via the job queue to avoid deadlock situations during their execution. The [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] is responsible for the processing and it is critical that the <code>runJobs.php</code> maintenance script has an appropriate capacity (see also configuration parameter <code>$wgRunJobsAsync</code>).\";'),('en','messages:smw-admin-main-title','s:24:\"Semantic MediaWiki  $1\";'),('en','messages:smw-admin-maintenance-no-description','s:15:\"No description.\";'),('en','messages:smw-admin-maintenance-script-description-disposeoutdatedentities','s:45:\"Dispose of outdated entities and query links.\";'),('en','messages:smw-admin-maintenance-script-description-dumprdf','s:31:\"RDF export of existing triples.\";'),('en','messages:smw-admin-maintenance-script-description-populatehashfield','s:69:\"Populates the <code>smw_hash</code> field for rows missing the value.\";'),('en','messages:smw-admin-maintenance-script-description-purgeentitycache','s:65:\"Purge cache entries for known entities and their associated data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildconceptcache','s:124:\"This script is used to manage concept caches for Semantic MediaWiki where it can create, remove, and update selected caches.\";'),('en','messages:smw-admin-maintenance-script-description-rebuilddata','s:112:\"Recreates all the semantic data in the database, by cycling through all the pages that might have semantic data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildelasticindex','s:154:\"Rebuilds the Elasticsearch index (only for installations that use the <code>ElasticStore</code>), by cycling through all entities that have semantic data.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildelasticmissingdocuments','s:140:\"Find missing entities in Elasticsearch (only for installations that use the <code>ElasticStore</code>) and schedule appropriate update jobs.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildfulltextsearchtable','s:111:\"Rebuilds the <code>SQLStore</code> fulltext search index (for installations where the setting has been enabled.\";'),('en','messages:smw-admin-maintenance-script-description-rebuildpropertystatistics','s:56:\"Rebuilds the usage statistics for all property entities.\";'),('en','messages:smw-admin-maintenance-script-description-removeduplicateentities','s:83:\"Removes duplicate entities found in selected tables that have no active references.\";'),('en','messages:smw-admin-maintenance-script-description-runimport','s:136:\"Populate and import auto-discovered content from [https://www.semantic-mediawiki.org/wiki/Help:$smwgImportFileDirs $smwgImportFileDirs].\";'),('en','messages:smw-admin-maintenance-script-description-setupstore','s:83:\"Sets up the storage and query backend as defined in <code>LocalSettings.php</code>.\";'),('en','messages:smw-admin-maintenance-script-description-updateentitycollation','s:191:\"Updates the <code>smw_sort</code> field in the <code>SQLStore</code> (in accordance with the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEntityCollation $smwgEntityCollation] setting).\";'),('en','messages:smw-admin-maintenance-script-description-updatequerydependencies','s:179:\"Update queries and query dependencies (see the [https://www.semantic-mediawiki.org/wiki/Help:$smwgEnabledQueryDependencyLinksStore $smwgEnabledQueryDependencyLinksStore] setting).\";'),('en','messages:smw-admin-maintenance-script-section-intro','s:127:\"The following maintenance scripts require an administrator and access to the command line to be able to execute listed scripts.\";'),('en','messages:smw-admin-maintenance-script-section-rebuild','s:15:\"Rebuild scripts\";'),('en','messages:smw-admin-maintenance-script-section-title','s:37:\"List of available maintenance scripts\";'),('en','messages:smw-admin-maintenance-script-section-update','s:14:\"Update scripts\";'),('en','messages:smw-admin-maintenance-tab-scripts','s:19:\"Maintenance scripts\";'),('en','messages:smw-admin-maintenance-tab-tasks','s:5:\"Tasks\";'),('en','messages:smw-admin-maintenancealerts-invalidentities-alert','s:458:\"The system matched $1 [https://www.semantic-mediawiki.org/wiki/Invalid_entities {{PLURAL:$1|entity|entities}}] to an [https://www.semantic-mediawiki.org/wiki/Unmaintained_namespace unmaintained namespace] and it is recommended to run the [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php <code>disposeOutdatedEntities.php</code>] or [https://www.semantic-mediawiki.org/wiki/rebuildData.php <code>rebuildData.php</code>] maintenance script.\";'),('en','messages:smw-admin-maintenancealerts-invalidentities-alert-title','s:16:\"Invalid entities\";'),('en','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert','s:401:\"The system has found that the last [https://www.semantic-mediawiki.org/wiki/Table_optimization table optimization] was run $2 days ago (record from $1) which exceeds the $3 days maintenance threshold. As mentioned in the documentation, running optimizations will allow the query planner to make better decisions about queries therefore it is suggested to run the table optimization on a regular basis.\";'),('en','messages:smw-admin-maintenancealerts-lastoptimizationrun-alert-title','s:18:\"Table optimization\";'),('en','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert','s:352:\"The system has counted $1 [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and reached a critical level of unattended maintenance by exceeding the threshold of $2. It is recommended to run the [https://www.semantic-mediawiki.org/wiki/disposeOutdatedEntities.php <code>disposeOutdatedEntities.php</code>] maintenance script.\";'),('en','messages:smw-admin-maintenancealerts-outdatedentitiesmaxcount-alert-title','s:17:\"Outdated entities\";'),('en','messages:smw-admin-maintenancealerts-section-intro','s:146:\"The following alerts and notices should be resolved and while not essential it is expected to help improve system and operational maintainability.\";'),('en','messages:smw-admin-objectid','s:3:\"ID:\";'),('en','messages:smw-admin-operational-statistics','s:194:\"This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),('en','messages:smw-admin-other-functions','s:15:\"Other functions\";'),('en','messages:smw-admin-outdateddisposal-active','s:53:\"An outdated entities disposal job has been scheduled.\";'),('en','messages:smw-admin-outdateddisposal-button','s:17:\"Schedule disposal\";'),('en','messages:smw-admin-outdateddisposal-intro','s:279:\"Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),('en','messages:smw-admin-outdateddisposal-title','s:26:\"Outdated entities disposal\";'),('en','messages:smw-admin-permission-missing','s:210:\"The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),('en','messages:smw-admin-permissionswarn','s:432:\"If the operation fails with SQL errors, the database user employed by your wiki (check your \"LocalSettings.php\" file) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in the \"LocalSettings.php\" file, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),('en','messages:smw-admin-propertystatistics-active','s:53:\"A property statistics rebuild job has been scheduled.\";'),('en','messages:smw-admin-propertystatistics-button','s:27:\"Schedule statistics rebuild\";'),('en','messages:smw-admin-propertystatistics-intro','s:177:\"Rebuilds the entire property usage statistics and therein updates and corrects the [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count] of properties.\";'),('en','messages:smw-admin-propertystatistics-title','s:27:\"Property statistics rebuild\";'),('en','messages:smw-admin-questions','s:188:\"If you have further questions or suggestions, join the discussion on the Semantic MediaWiki <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">user mailing list</a>.\";'),('en','messages:smw-admin-settings-docu','s:251:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-admin-setupsuccess','s:30:\"The storage engine was set up.\";'),('en','messages:smw-admin-smwhomepage','s:139:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw-admin-statistics','s:10:\"Statistics\";'),('en','messages:smw-admin-statistics-extra','s:19:\"Statistic functions\";'),('en','messages:smw-admin-statistics-job-docu','s:307:\"The job statistics displays information about scheduled Semantic MediaWiki jobs that have not yet been executed. The number of jobs may be slightly inaccurate or contains failed attempts, please consult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue manual] for further information.\";'),('en','messages:smw-admin-statistics-job-title','s:14:\"Job statistics\";'),('en','messages:smw-admin-statistics-querycache-disabled','s:141:\"The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and hereby no statistics are available.\";'),('en','messages:smw-admin-statistics-querycache-legend','s:869:\"The cache statistics is to contain provisional cumulative as well as derived data including: \n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval \n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency) \n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources \n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process  \n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),('en','messages:smw-admin-statistics-querycache-title','s:11:\"Query cache\";'),('en','messages:smw-admin-statistics-section-explain','s:62:\"The section provides additional statistics for administrators.\";'),('en','messages:smw-admin-statistics-semanticdata-overview','s:8:\"Overview\";'),('en','messages:smw-admin-supplementary-duplookup-docu','s:298:\"This page lists entries from selected tables that have been categorized as [https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities duplicates]. Duplicate entries should (if at all) only occur on rare occasions potentially caused by a terminated update or unsuccessful rollback transaction.\";'),('en','messages:smw-admin-supplementary-duplookup-helplink','s:63:\"https://www.semantic-mediawiki.org/wiki/Help:Duplicate_entities\";'),('en','messages:smw-admin-supplementary-duplookup-intro','s:91:\"<u>$1</u> to find entities that are categorized as duplicates for the selected table matrix\";'),('en','messages:smw-admin-supplementary-duplookup-title','s:25:\"Duplicate entities lookup\";'),('en','messages:smw-admin-supplementary-elastic-config','s:14:\"Configurations\";'),('en','messages:smw-admin-supplementary-elastic-docu','s:256:\"This page contains information about settings, mappings, health, and index statistics related to an Elasticsearch cluster that is connected to Semantic MediaWiki and its [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore <code>ElasticStore</code>].\";'),('en','messages:smw-admin-supplementary-elastic-endpoints','s:9:\"Endpoints\";'),('en','messages:smw-admin-supplementary-elastic-functions','s:19:\"Supported functions\";'),('en','messages:smw-admin-supplementary-elastic-indices-intro','s:72:\"<u>$1</u> provides an overview of available indices and their statistics\";'),('en','messages:smw-admin-supplementary-elastic-indices-title','s:7:\"Indices\";'),('en','messages:smw-admin-supplementary-elastic-intro','s:59:\"<u>$1</u> shows details about settings and index statistics\";'),('en','messages:smw-admin-supplementary-elastic-mappings-docu','s:240:\"This page contains field mapping details used by the current index. It is recommended to monitor the mappings in connection with the <code>index.mapping.total_fields.limit</code> (specifies the maximum number of fields in an index allowed).\";'),('en','messages:smw-admin-supplementary-elastic-mappings-docu-extra','s:237:\"The <code>property_fields</code> refers to the count of indexed core fields while the <code>nested_fields</code> refers to an accumulated count of additional fields assigned to a core field to support specific structured search patterns.\";'),('en','messages:smw-admin-supplementary-elastic-mappings-fields','s:14:\"Field mappings\";'),('en','messages:smw-admin-supplementary-elastic-mappings-intro','s:44:\"<u>$1</u> to list indices and field mappings\";'),('en','messages:smw-admin-supplementary-elastic-mappings-summary','s:7:\"Summary\";'),('en','messages:smw-admin-supplementary-elastic-mappings-title','s:8:\"Mappings\";'),('en','messages:smw-admin-supplementary-elastic-no-connection','s:216:\"The wiki is currently \'\'\'unable\'\'\' to establish a connection to the Elasticsearch cluster, please contact the wiki administrator to investigate the issue as it incapacitates the index and query ability of the system.\";'),('en','messages:smw-admin-supplementary-elastic-nodes-intro','s:31:\"<u>$1</u> shows node statistics\";'),('en','messages:smw-admin-supplementary-elastic-nodes-title','s:5:\"Nodes\";'),('en','messages:smw-admin-supplementary-elastic-replication-docu','s:324:\"This page provides information about the [https://www.semantic-mediawiki.org/wiki/Help:Replication_monitoring replication status] of entities that were reported to have issues with the Elasticsearch cluster. It is recommended to review listed entities and purge the content in order to confirm that it was a temporary issue.\";'),('en','messages:smw-admin-supplementary-elastic-replication-files','s:5:\"Files\";'),('en','messages:smw-admin-supplementary-elastic-replication-files-docu','s:208:\"It should be noted that for the list of files, the [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/File_ingestion file ingest] job is required to be executed first and has to finish its processing.\";'),('en','messages:smw-admin-supplementary-elastic-replication-function-title','s:11:\"Replication\";'),('en','messages:smw-admin-supplementary-elastic-replication-header-title','s:18:\"Replication status\";'),('en','messages:smw-admin-supplementary-elastic-replication-intro','s:53:\"<u>$1</u> shows information about failed replications\";'),('en','messages:smw-admin-supplementary-elastic-replication-pages','s:5:\"Pages\";'),('en','messages:smw-admin-supplementary-elastic-section-subtitle','s:13:\"Elasticsearch\";'),('en','messages:smw-admin-supplementary-elastic-settings-intro','s:68:\"<u>$1</u> used by Elasticsearch to manage Semantic MediaWiki indices\";'),('en','messages:smw-admin-supplementary-elastic-settings-title','s:18:\"Settings (indices)\";'),('en','messages:smw-admin-supplementary-elastic-statistics-docu','s:346:\"This page provides an insight on indices statistics for different operations that are happening on an index level, the returned stats are aggregated with primaries and total aggregations. The [https://www.elastic.co/guide/en/elasticsearch/reference/current/indices-stats.html help page] contains a detailed description of available indices stats.\";'),('en','messages:smw-admin-supplementary-elastic-statistics-intro','s:38:\"<u>$1</u> shows index level statistics\";'),('en','messages:smw-admin-supplementary-elastic-statistics-title','s:10:\"Statistics\";'),('en','messages:smw-admin-supplementary-elastic-status-file-ingest-job-count','s:42:\"Injest (file) job backlog: $1 (estimation)\";'),('en','messages:smw-admin-supplementary-elastic-status-last-active-replication','s:27:\"Last active replication: $1\";'),('en','messages:smw-admin-supplementary-elastic-status-rebuild-lock','s:44:\"Replication locked: $1 (rebuild in-progress)\";'),('en','messages:smw-admin-supplementary-elastic-status-recovery-job-count','s:37:\"Recovery job backlog: $1 (estimation)\";'),('en','messages:smw-admin-supplementary-elastic-status-refresh-interval','s:20:\"Refresh interval: $1\";'),('en','messages:smw-admin-supplementary-elastic-status-replication','s:18:\"Replication status\";'),('en','messages:smw-admin-supplementary-elastic-status-replication-monitoring','s:35:\"Replication monitoring (active): $1\";'),('en','messages:smw-admin-supplementary-elastic-title','s:13:\"Elasticsearch\";'),('en','messages:smw-admin-supplementary-elastic-version-info','s:7:\"Version\";'),('en','messages:smw-admin-supplementary-idlookup-intro','s:36:\"Supports a simple <u>$1</u> function\";'),('en','messages:smw-admin-supplementary-idlookup-short-title','s:26:\"entity lookup and disposal\";'),('en','messages:smw-admin-supplementary-idlookup-title','s:26:\"Entity lookup and disposal\";'),('en','messages:smw-admin-supplementary-operational-statistics-cache-intro','s:58:\"<u>$1</u> shows a selected set of cache related statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-cache-title','s:16:\"Cache statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-intro','s:37:\"Displays an extended set of <u>$1</u>\";'),('en','messages:smw-admin-supplementary-operational-statistics-short-title','s:22:\"operational statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-title','s:22:\"Operational statistics\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-explain','s:172:\"This section contains selected table statistics to help administrators and data curators to make informed decisions about that state of the back-end and the storage engine.\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-intro','s:48:\"Generates <u>$1</u> for a selected set of tables\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend','s:81:\"The legend describes some of the keys used for the table statistics and includes:\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-blob-table','s:394:\"\n* <code>unique_terms_occurrence_in_percent</code> percentange of terms that are unique (a low percentange rate indicates that repetitve terms occupy the table content and index) \n* <code>rows.terms_occurrence.single_occurrence_total_count</code> number of terms that only appear once \n* <code>rows.terms_occurrence.multi_occurrence_total_count</code> number of terms that appear more than once\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-general','s:63:\"\n* <code>total_row_count</code> total number of rows in a table\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-legend-id-table','s:693:\"\n* <code>last_id</code> last ID currently in use \n* <code>duplicate_count</code> number of duplicates found in the id_table (see also [[Special:SemanticMediaWiki/duplicate-lookup|Duplicate entities lookup]]) \n* <code>rows.rev_count</code> number of rows that have a revision_id assigned indicating a direct wikipage link \n* <code>rows.smw_namespace_group_by_count</code> numbers of aggregated rows for namespaces used in the table \n* <code>rows.smw_proptable_hash.query_match_count</code> number of query subobjects with a corresponding table reference \n* <code>rows.smw_proptable_hash.query_null_count</code> number of query subobjects without a table reference (unlinked, floating reference)\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-short-title','s:16:\"table statistics\";'),('en','messages:smw-admin-supplementary-operational-table-statistics-title','s:16:\"Table statistics\";'),('en','messages:smw-admin-supplementary-section-intro','s:333:\"This section provides additional functions beyond the scope of maintenance activities and it is possible that some functions which are listed (see the [https://www.semantic-mediawiki.org/wiki/Help:Special:SemanticMediaWiki/Supplementary_functions documentation]) are restricted or unavailable and therefore inaccessible on this wiki.\";'),('en','messages:smw-admin-supplementary-section-subtitle','s:24:\"Supported core functions\";'),('en','messages:smw-admin-supplementary-section-title','s:23:\"Supplementary functions\";'