ion\";'),('en','messages:smw-ask-delete','s:6:\"Remove\";'),('en','messages:smw-ask-download-link-desc','s:37:\"Download queried results in $1 format\";'),('en','messages:smw-ask-empty','s:17:\"Clear all entries\";'),('en','messages:smw-ask-extra-other','s:5:\"Other\";'),('en','messages:smw-ask-extra-query-log','s:9:\"Query log\";'),('en','messages:smw-ask-format','s:6:\"Format\";'),('en','messages:smw-ask-format-change-info','s:120:\"The format was modified and it is required to execute the query again to match new parameters and visualization options.\";'),('en','messages:smw-ask-format-export-info','s:123:\"The selected format is an export format which has no visual representation therefore results are only provided as download.\";'),('en','messages:smw-ask-format-help-link','s:66:\"[https://www.semantic-mediawiki.org/wiki/Help:$1_format $1] format\";'),('en','messages:smw-ask-format-options','s:18:\"Format and options\";'),('en','messages:smw-ask-format-selection-help','s:33:\"Help with the selected format: $1\";'),('en','messages:smw-ask-help','s:545:\"This section contains some links to help explain how to use the <code>#ask</code> syntax.\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Selecting pages] describes how to selected pages and build conditions\n\n*[https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\n\n*[https://www.semantic-mediawiki.org/wiki/Help:Displaying_information Displaying information] outlines the use of printout statements and formatting options\";'),('en','messages:smw-ask-input-assistance','s:16:\"Input assistance\";'),('en','messages:smw-ask-message-keyword-type','s:67:\"This search matches the <code><nowiki>$1</nowiki></code> condition.\";'),('en','messages:smw-ask-no-cache','s:19:\"Disable query cache\";'),('en','messages:smw-ask-no-cache-desc','s:27:\"Results without query cache\";'),('en','messages:smw-ask