s supported. Other options are discussed on the [https://www.semantic-mediawiki.org/wiki/Help:$smwgBrowseByApi <code>$smwgBrowseByApi</code>] configuration parameter page.\";'),('en','messages:smw-browse-property-group-description','s:26:\"Property group description\";'),('en','messages:smw-browse-property-group-label','s:20:\"Property group label\";'),('en','messages:smw-browse-property-group-title','s:14:\"Property group\";'),('en','messages:smw-browse-show-group','s:11:\"Show groups\";'),('en','messages:smw-category','s:8:\"Category\";'),('en','messages:smw-category-change-propagation-locked-error','s:542:\"Category \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. In the meantime, the category page has been locked until the primary specification update is completed to prevent intermediary interruptions or contradictory specifications. The process may take moment before the page can be unlocked as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] scheduler.\";'),('en','messages:smw-category-change-propagation-locked-warning','s:461:\"Category \"$1\" was altered and requires assigned entities to be reevaluated using a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] process. The update may take moment as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] scheduler and it is suggested to postpone changes to the category to prevent intermediary interruptions or contradictory specifications.\";'),('en','messages:smw-category-change-propagation-pending','s:377:\"[https://www.semantic-mediawiki.org/wiki/Change_propagation Change propagation] updates are pending ($1 [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue {{PLURAL:$1|job|jobs}}] estimated) and it is recommended to wait with modifications to a category until the process has been finalized to prevent intermediary interruptions or contradictory specifications.\";'),('en','messages:smw-category-invalid-redirect-target','s:78:\"Category \"$1\" contains an invalid redirect target to a non-category namespace.\";'),('en','messages:smw-category-invalid-value-assignment','s:61:\"\"$1\" is not recognized as valid category or value annotation.\";'),('en','messages:smw-change-propagation-protection','s:355:\"This page is locked to prevent accidental data modification while a [https://www.semantic-mediawiki.org/wiki/Change_propagation change propagation] update is run. The process may take moment before the page is unlocked as it depends on the size and frequency of the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue job queue] scheduler.\";'),('en','messages:smw-cheat-sheet','s:11:\"Cheat sheet\";'),('en','messages:smw-clipboard-copy-link','s:22:\"Copy link to clipboard\";'),('en','messages:smw-collapse','s:8:\"Collapse\";'),('en','messages:smw-concept-cache-count','s:148:\"The [https://www.semantic-mediawiki.org/wiki/Help:Concept_cache_count concept cache] contains {{PLURAL:$1|\'\'\'one\'\'\' entity|\'\'\'$1\'\'\' entities}} ($2).\";'),('en','messages:smw-concept-cache-header','s:11:\"Cache usage\";'),('en','messages:smw-concept-cache-text','s:84:\"The concept has a total of $1 {{PLURAL:$1|page|pages}}, and was last updated $3, $2.\";'),('en','messages:smw-concept-indicator-cache-update','s:28:\"Cache count\nLast updated: $1\";'),('en','messages:smw-concept-no-cache','s:19:\"No cache available.\";'),('en','messages:smw-concept-tab-errors','s:6:\"Errors\";'),('en','messages:smw-concept-tab-list','s:4:\"List\";'),('en','messages:smw-constraint-error','s:16:\"Constraint issue\";'),('en','messages:smw-constraint-error-allows-value-list','s:95:\"\"$1\" is not in the list ($2) of [[Property:Allows value|allowed values]] for the \"$3\" property.\";'),('en','messages: