machines \'\'and\'\' humans ([https://www.semantic-mediawiki.org/wiki/Help:User_manual online documentation])\";'),('en','messages:smw-edit-protection','s:254:\"This page is [[Property:Is edit protected|protected]] to prevent accidental data modification and can only be edited by users with the appropriate edit right (\"$1\") or [https://www.semantic-mediawiki.org/wiki/Help:User_rights_and_user_groups user group].\";'),('en','messages:smw-edit-protection-auto-update','s:99:\"Semantic MediaWiki has updated the protection status according to the \"Is edit protected\" property.\";'),('en','messages:smw-edit-protection-disabled','s:118:\"The edit protection has been disabled therefore \"$1\" cannot be used to protect entity pages from unauthorized editing.\";'),('en','messages:smw-edit-protection-enabled','s:35:\"Edit protected (Semantic MediaWiki)\";'),('en','messages:smw-editpage-annotation-disabled','s:236:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace can be found on the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-annotation-enabled','s:559:\"This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help pages.\";'),('en','messages:smw-editpage-concept-annotation-enabled','s:189:\"This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:259:\"This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),('en','messages:smw-editpage-property-annotation-enabled','s:472:\"This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-elastic-rebuildelasticindex-run-incomplete','s:352:\"The <code>ElasticStore</code> has been selected as [https://www.semantic-mediawiki.org/wiki/Help:smwgDefaultStore default store], yet the extension was unable to find any record that the <code>[https://www.semantic-mediawiki.org/wiki/Help:rebuildElasticIndex.php rebuildElasticIndex.php]</code> script was executed, please run the script as instructed.\";'),('en','messages:smw-entity-examiner-associated-revision-mismatch','s:8:\"Revision\";'),('en','messages:smw-entity-examiner-check','s:61:\"Running {{PLURAL:$1|an examiner|examiners}} in the background\";'),('en','messages:smw-entity-examiner-deferred-check-awaiting-response','s:68:\"The \"$1\" examiner is currently awaiting a response from the backend.\";'),('en','messages:smw-entity-examiner-deferred-constraint-error','s:10:\"Constraint\";'),('en','messages:smw-entity-examiner-deferred-elastic-replication','s:7:\"Elastic\";'),('en','messages:smw-entity-examiner-deferred-fake','s:4:\"Fake\";'),('en','messages:smw-entity-examiner-indicator','s:18:\"Entity issue panel\";'),('en','messages:smw-entity-examiner-indicator-suggestions','s:210:\"As part of the entity examination, the following {{PLURAL:$1|issue was|issues were}} found and it is suggested to carefully review {{PLURAL:$1|the issue|them}} and take appropriate {{PLURAL:$1|action|actions}}.\";'),('en','messages:smw-error','s:5:\"Error\";'),('en','messages:smw-es-replication-check','s:33:\"Replication check (Elasticsearch)\";'),('en','messages:smw-es-replication-error','s:31:\"Elasticsearch replication issue\";'),('en','messages:smw-es-replication-error-bad-request-exception','s:169:\"The Elasticsearch connection handler has thrown a bad request exception (\"400 conflict http error\") indicating a continuing issue during replication and search requests.\";'),('en','messages:smw-es-replication-error-divergent-date','s:121:\"The replication monitoring has found that for the \"$1\" article (ID: $2) the <b>modification date</b> shows a discrepancy.\";'),('en','messages:smw-es-replication-error-divergent-date-detail','s:63:\"Referenced modification date:\n*Elasticsearch: $1 \n*Database: $2\";'),('en','messages:smw-es-replication-error-divergent-date-short','s:56:\"The following date information were used for comparison:\";'),('en','messages:smw-es-replication-error-divergent-revision','s:123:\"The replication monitoring has found that for the \"$1\" article (ID: $2) the <b>associated revision</b> shows a discrepancy.\";'),('en','messages:smw-es-replication-error-divergent-revision-detail','s:65:\"Referenced associated revision:\n*Elasticsearch: $1 \n*Database: $2\";'),('en','messages:smw-es-replication-error-divergent-revision-short','s:64:\"The following associated revision data were used for comparison:\";'),('en','messages:smw-es-replication-error-file-ingest-missing-file-attachment','s:191:\"The replication monitoring has found that \"$1\" is missing a [[Property:File attachment|File attachment]] annotation indicating that the file ingest