is list on a regular basis and correct invalid value annotations.\";'),('en','messages:smw-property-indicator-last-count-update','s:38:\"Estimated usage count\nLast updated: $1\";'),('en','messages:smw-property-indicator-type-info','s:42:\"{{PLURAL:$1|User|System}} defined property\";'),('en','messages:smw-property-label-similarity-docu','s:622:\"This pages compares the [https://www.semantic-mediawiki.org/wiki/Property_similarity similarity distance] (not to be confused with a semantic or lexical similarity) between property labels and reports them if they exceed the threshold. The report may help filter misspelled or equivalent properties that represent the same concept (see the [[Special:Properties|properties]] special page to help clarify concept and usage of reported properties). The threshold can be adjusted to widen or narrow the distance used for the approximate matching. <code>[[Property:$1|$1]]</code> is used to exempt properties from the analysis.\";'),('en','messages:smw-property-label-similarity-intro','s:62:\"<u>$1</u> calculates similarities for existing property labels\";'),('en','messages:smw-property-label-similarity-noresult','s:47:\"No results were found for the selected options.\";'),('en','messages:smw-property-label-similarity-threshold','s:10:\"Threshold:\";'),('en','messages:smw-property-label-similarity-title','s:32:\"Property label similarity report\";'),('en','messages:smw-property-label-similarity-type','s:15:\"Display Type ID\";'),('en','messages:smw-property-label-uniqueness','s:199:\"The \"$1\" label was matched to at least one other property representation. Please consult the [https://www.semantic-mediawiki.org/wiki/Help:Property_uniqueness help page] on how to resolve this issue.\";'),('en','messages:smw-property-name-invalid','s:52:\"Property $1 can not be used (invalid property name).\";'),('en','messages:smw-property-name-reserved','s:215:\"\"$1\" was listed as reserved name and should not be used as a property. The following [https://www.semantic-mediawiki.org/wiki/Help:Property_naming help page] may contain information as to why this name was reserved.\";'),('en','messages:smw-property-namespace-disabled','s:222:\"The property [https://www.semantic-mediawiki.org/wiki/Help:$smwgNamespacesWithSemanticLinks namespace] is disabled, attempting to declare a type or other property specific characteristics for this property is not possible.\";'),('en','messages:smw-property-page-filter-note','s:560:\"The [https://www.semantic-mediawiki.org/wiki/Help:Property_page/Filter search filter] allows the inclusion of [https://www.semantic-mediawiki.org/wiki/Help:Query_expressions query expressions] such as <code>~</code> or <code>!</code>. The selected [https://www.semantic-mediawiki.org/wiki/Query_engine query engine] might also support case insensitive matching or other short expressions like:\n\n* <code>in:</code> result should include the term, e.g. \'<code>in:Foo</code>\'\n\n* <code>not:</code> result should to not include the term, e.g. \'<code>not:Bar</code>\'\";'),('en','messages:smw-property-page-list-count','s:56:\"Showing $1 {{PLURAL:$1|page|pages}} using this property.\";'),('en','messages:smw-property-page-list-search-count','s:80:\"Showing $1 {{PLURAL:$1|page|pages}} using this property with a \"$2\" value match.\";'),('en','messages:smw-property-predefined-ask','s:269:\"\"$1\" is a predefined property that represents meta information (in form of a [https://www.semantic-mediawiki.org/wiki/Subobject subobject]) about individual queries and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askco','s:178:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to describe the state of a query or its components.\";'),('en','messages:smw-property-predefined-askde','s:174:\"\"$1\" is a predefined property that informs about the depth of a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askdu','s:221:\"\"$1\" is a predefined property containing a time value (in seconds) that was required to complete the query execution and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askfo','s:191:\"\"$1\" is a predefined property that holds the name of the result format used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askpa','s:186:\"\"$1\" is a predefined property describing parameters that influence a query result and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-asksc','s:194:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] that identifies alternative (e.g. remote, federated) query sources.\";'),('en','messages:smw-property-predefined-asksi','s:189:\"\"$1\" is a predefined property that collects the number of conditions used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-askst','s:189:\"\"$1\" is a predefined property that describes the conditions of the query as a string and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-attch-link','s:194:\"\"$1\" is a predefined property that collects embedded file and image links found in a page and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-boo','s:190:\"\"$1\" is a [[Special:Types/Boolean|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent boolean values.\";'),('en','messages:smw-property-predefined-cdat','s:198:\"\"$1\" is a predefined property that corresponds to the date of the first revision of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-chgpro','s:239:\"\"$1\" is a predefined property to hold [https://www.semantic-mediawiki.org/wiki/Help:Change_propagation change propagation] information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-common','s:290:\"This property is pre-deployed (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) and comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),('en','messages:smw-property-predefined-conc','s:176:\"\"$1\" is an internal predefined property to define an associated concept and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-constraint-schema','s:167:\"\"$1\" is a predefined property that defines a constraint schema and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-author','s:162:\"\"$1\" is a predefined property to store author information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-date','s:160:\"\"$1\" is a predefined property to store date information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-keyw','s:156:\"\"$1\" is a predefined property to represent keywords and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-lang','s:164:\"\"$1\" is a predefined property to store language information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-len','s:162:\"\"$1\" is a predefined property to store length information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-title','s:161:\"\"$1\" is a predefined property to store title information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-cont-type','s:165:\"\"$1\" is a predefined property to store file type information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-conv','s:211:\"\"$1\" is a declarative predefined property to define conversion factor for some unit of a physical quantity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-dat','s:184:\"\"$1\" is a [[Special:Types/Date|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent date values.\";'),('en','messages:smw-property-predefined-default','s:41:\"\"$1\" is a predefined property of type $2.\";'),('en','messages:smw-property-predefined-dtitle','s:188:\"\"$1\" is a predefined property that can assign a distinct display title to an entity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-edip','s:175:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to indicate whether editing is protected or not.\";'),('en','messages:smw-property-predefined-eid','s:208:\"\"$1\" is a [[Special:Types/External identifier|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent external identifiers.\";'),('en','messages:smw-property-predefined-err-type','s:250:\"\"$1\" is a predefined property to indentify a group or class of [https://www.semantic-mediawiki.org/wiki/Help:Processing_errors processing errors] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-errc','s:229:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] and represents errors that appeared in connection with improper value annotations or input processing.\";'),('en','messages:smw-property-predefined-errp','s:191:\"\"$1\" is a predefined property that tracks input errors for irregular value annotations and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-errt','s:179:\"\"$1\" is a predefined property containing a textual description of an error and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-file-attch','s:194:\"\"$1\" is a predefined property to represent a container that stores attachment information and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-format-schema','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-impo','s:251:\"\"$1\" is a predefined property that describes a relation to an [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-inst','s:202:\"\"$1\" is an internal predefined property that stores category information independent of MediaWiki and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-keyw','s:223:\"\"$1\" is a predefined property and [[Special:Types/Keyword|type]] provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] that normalizes a text and has a restricted character length.\";'),('en','messages:smw-property-predefined-label-skey','s:7:\"Sortkey\";'),('en','messages:smw-property-predefined-lcode','s:182:\"\"$1\" is a predefined property that represents a BCP47 formatted language code and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-ledt','s:204:\"\"$1\" is a predefined property that contains the page name of the user who created the last revision and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-list','s:224:\"\"$1\" is a predefined property to define a list of properties used with a [[Special:Types/Record|record]] typed property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-long-askco','s:165:\"The number or numbers assigned represent an internal codified state that is explained on the [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler help page].\";'),('en','messages:smw-property-predefined-long-askde','s:287:\"It is a numerical value computed on the basis of subquery nesting, property chains, and available description elements with the execution of a query being restricted by the <code>[https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth $smwgQMaxDepth]</code> configuration parameter.\";'),('en','messages:smw-property-predefined-long-askpa','s:132:\"It is part of a collection of properties that specify a [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler query profile].\";'),('en','messages:smw-property-predefined-long-cont-author','s:272:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store author information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-date','s:270:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store date information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-keyw','s:262:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store keywords retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-lang','s:274:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store language information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-len','s:272:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store length information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-title','s:271:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store title information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-cont-type','s:270:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect and store type information retrieved from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-edip','s:174:\"While any user is qualified to add this property to a subject, only a user with a dedicated permission can edit or revoke the protection to an entity after it has been added.\";'),('en','messages:smw-property-predefined-long-errc','s:166:\"Errors are collected in a [https://www.semantic-mediawiki.org/wiki/Help:Container container] that may include a reference to the property that caused the discrepancy.\";'),('en','messages:smw-property-predefined-long-errp','s:95:\"In most cases it is caused by a type mismatch or a [[Property:Allows value|value]] restriction.\";'),('en','messages:smw-property-predefined-long-file-attch','s:278:\"It is used in connection with the [https://www.semantic-mediawiki.org/ElasticStore ElasticStore] (and the [https://www.semantic-mediawiki.org/Attachment_processor attachment processor]) to collect all content specific information retrievable from an ingested file (if provided).\";'),('en','messages:smw-property-predefined-long-pefu','s:174:\"The URI is expected to contain a placeholder that will be adjusted with an [[Special:Types/External identifier|external identifier]] value to form a valid resource reference.\";'),('en','messages:smw-property-predefined-long-pvuc','s:154:\"Uniqueness is established when two values are not equal in their literal representation and any violation of that constraint will be categorized as error.\";'),('en','messages:smw-property-predefined-long-schema-tag','s:71:\"A label that identifies schemata of similar content or characteristics.\";'),('en','messages:smw-property-predefined-long-schema-type','s:265:\"Each [https://www.semantic-mediawiki.org/wiki/Help:Schema/Type type] provides its own interpretation of syntax elements and application rules and can be expressed with the help of a [https://www.semantic-mediawiki.org/wiki/Help:Schema#validation validation schema].\";'),('en','messages:smw-property-predefined-long-sobj','s:180:\"The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),('en','messages:smw-property-predefined-long-unit','s:86:\"A comma-separated list allows to describe units or formats to be used for the display.\";'),('en','messages:smw-property-predefined-mdat','s:201:\"\"$1\" is a predefined property that corresponds to the date of the last modification of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-media','s:184:\"\"$1\" is a predefined property that describes the media type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-mime','s:183:\"\"$1\" is a predefined property that describes the MIME type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-newp','s:181:\"\"$1\" is a predefined property that indicates whether a subject is new or not and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-num','s:189:\"\"$1\" is a [[Special:Types/Number|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent numeric values.\";'),('en','messages:smw-property-predefined-pdesc','s:194:\"\"$1\" is a predefined property that allows to describe a property in context of a language and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pefu','s:178:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to specify an external resource with a placeholder.\";'),('en','messages:smw-property-predefined-peid','s:172:\"\"$1\" is a predefined property that specifies an external identifier and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-ppgr','s:229:\"\"$1\" is a predefined property that identifies entities (mainly categories) that are used as grouping instance for properties and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pplb','s:256:\"\"$1\" is a declarative predefined property to specify a [https://www.semantic-mediawiki.org/wiki/Help:Preferred_property_label preferred property label] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-prec','s:172:\"\"$1\" is a predefined property that describes a [https://www.semantic-mediawiki.org/wiki/Help:Display_precision display precision] (in decimal digits) for numeric datatypes.\";'),('en','messages:smw-property-predefined-profile-schema','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pval','s:301:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value \"$1\"] is a predefined property that can define a list of permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvali','s:330:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvap','s:292:\"\"$1\" is a predefined property that can specify a [[MediaWiki:Smw allows pattern|pattern reference]] to apply [https://en.wikipedia.org/wiki/Regular_expression regular expression] matching and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-pvuc','s:205:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to restrict value assignments for each instance to be unique (or one at most).\";'),('en','messages:smw-property-predefined-qty','s:192:\"\"$1\" is a [[Special:Types/Quantity|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent quantity values.\";'),('en','messages:smw-property-predefined-redi','s:164:\"\"$1\" is an internal predefined property to record redirects and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-def','s:165:\"\"$1\" is a predefined property that stores the schema content and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-desc','s:167:\"\"$1\" is a predefined property that stores a schema description and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-link','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-schema-tag','s:164:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to identify a collection of schemata.\";'),('en','messages:smw-property-predefined-schema-type','s:191:\"\"$1\" is a predefined property that describes a type to distinguish a group of schemata and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-serv','s:181:\"\"$1\" is a declarative predefined property to add service links to a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-skey','s:169:\"\"$1\" is an internal predefined property to hold a sort reference and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-sobj','s:226:\"\"$1\" is a predefined property representing a [https://www.semantic-mediawiki.org/wiki/Help:Container container] construct and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-subc','s:267:\"\"$1\" is a predefined property to define that a category is a [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Subcategory_of subcategory of] another and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-subp','s:279:\"\"$1\" is a declarative predefined property to define that a property is a [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Subproperty_of subproperty of] another and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-text','s:175:\"\"$1\" is a predefined property that represents text of arbitrary length and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans-group','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-trans-source','s:105:\" and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-type','s:194:\"\"$1\" is a predefined property that describes the [[Special:Types|datatype]] of a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-property-predefined-unit','s:202:\"\"$1\" is a declarative predefined property to define units of display for numeric typed properties and is provided by [https://