.org/wiki/Change_propagation Change propagation] updates are pending ($1 [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Job_queue {{PLURAL:$1|job|jobs}}] estimated) and it is recommended to wait with modifications to a property until the process has been finalized to prevent intermediary interruptions or contradictory specifications.\";'),('en','messages:smw-property-req-violation-forced-removal-annotated-type','s:420:\"The [https://www.semantic-mediawiki.org/wiki/Help:Mandatory_parent_type_inheritance mandatory parent type inheritance] enforcement has been enabled, the annotate type for the \"$1\" property doesn\'t match its parent property \"$2\" type and has been altered to reflect that requirement. It is recommended to adjust the in-page type definition so that the error message and mandatory enforcement is removed for this property.\";'),('en','messages:smw-property-req-violation-import-type','s:222:\"A type declaration was detected that is incompatible with the predefined type of the imported \"$1\" vocabulary. In general, it is not necessary to declare a type because information are retrieved from the import definition.\";'),('en','messages:smw-property-req-violation-missing-fields','s:166:\"Property \"$1\" is missing a required [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Has_fields <code>Has fields</code>] declaration for this \"$2\" type.\";'),('en','messages:smw-property-req-violation-missing-formatter-uri','s:138:\"Property \"$1\" is missing declaration details for the annotated type by failing to define the <code>External formatter URI</code> property.\";'),('en','messages:smw-property-req-violation-missing-maps-extension','s:255:\"Semantic MediaWiki was unable to detect the [https://www.semantic-mediawiki.org/wiki/Extension:Maps \"Maps\"] extension which is a prerequisite and as a consequence limits the functionality (i.e. unable to store or process geographic data) of this property.\";'),('en','messages:smw-property-req-violation-multiple-fields','s:204:\"Property \"$1\" contains multiple (hereby competing) [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Has_fields <code>Has fields</code>] declarations, only one is expected for this \"$2\" type.\";'),('en','messages:smw-property-req-violation-parent-type','s:84:\"Property \"$1\" and the assigned parent property \"$2\" have different type annotations.\";'),('en','messages:smw-property-req-violation-predefined-type','s:130:\"Property \"$1\" as predefined property contains a \"$2\" type declaration that is incompatible with the default type of this property.\";'),('en','messages:smw-property-req-violation-type','s:164:\"The property contains competing type specifications which may result in invalid value annotations therefore it is expected that a user assigns one appropriate type.\";'),('en','messages:smw-property-reserved-category','s:8:\"Category\";'),('en','messages:smw-property-tab-constraint-schema','s:17:\"Constraint schema\";'),('en','messages:smw-property-tab-constraint-schema-title','s:26:\"Compiled constraint schema\";'),('en','messages:smw-property-tab-errors','s:20:\"Improper assignments\";'),('en','messages:smw-property-tab-profile-schema','s:14:\"Profile schema\";'),('en','messages:smw-property-tab-redirects','s:8:\"Synonyms\";'),('en','messages:smw-property-tab-specification','s:8:\"... more\";'),('en','messages:smw-property-tab-subproperties','s:13:\"Subproperties\";'),('en','messages:smw-property-tab-usage','s:5:\"Usage\";'),('en','messages:smw-property-userdefined-fixedtable','s:350:\"\"$1\" was configured as [https://www.semantic-mediawiki.org/wiki/Fixed_properties fixed property] and any modification to its [https://www.semantic-mediawiki.org/wiki/Type_declaration type declaration] requires to either run <code>setupStore.php</code> or to complete the special [[Special:SemanticMediaWiki|\"Database installation and upgrade\"]] task.\";'),('en','messages:smw-propertylist-count','s:49:\"Showing $1 related