he remote request support!\";'),('en','messages:smw-remote-source-unavailable','s:44:\"Unable to connect to the remote \"$1\" target.\";'),('en','messages:smw-remote-source-unmatched-id','s:101:\"The \'\'\'$1\'\'\' source does not match a version of Semantic MediaWiki that can support a remote request.\";'),('en','messages:smw-report','s:6:\"Report\";'),('en','messages:smw-schema-description','s:18:\"Schema description\";'),('en','messages:smw-schema-description-class-constraint-schema','s:100:\"This schema type supports the definition of constraint rules for a class instance (a.k.a. category).\";'),('en','messages:smw-schema-description-link-format-schema','s:183:\"This schema type supports the definition of characteristics for creating context sensitive links in connection with a [[Property:Formatter schema|formatter schema]] assigned property.\";'),('en','messages:smw-schema-description-property-constraint-schema','s:112:\"This supports the definition of constraint rules for a property instance as well as those values assigned to it.\";'),('en','messages:smw-schema-description-property-group-schema','s:225:\"This schema type supports the definition of [https://www.semantic-mediawiki.org/wiki/Help:Property_group property groups] to help structure the [https://www.semantic-mediawiki.org/wiki/Help:Special:Browse browsing] interface.\";'),('en','messages:smw-schema-description-property-profile-schema','s:132:\"This schema type supports the definition of a profile to declare characteristics to the assigned property and its annotation values.\";'),('en','messages:smw-schema-description-search-form-schema','s:307:\"This schema type supports the definition of input forms and characteristics for the [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch extended search] profile where it contains instructions on how to generate input fields, define default namespaces, or declare prefix expressions for a search request.\";'),('en','messages:smw-schema-error-input','s:299:\