mw-schema-error-violation','s:12:\"[\"$1\", \"$2\"]\";'),('en','messages:smw-schema-namespace-edit-protection','s:174:\"This page is protected and can only be edited by users with the appropriate <code>smw-schemaedit</code> [https://www.semantic-mediawiki.org/wiki/Help:Permissions permission].\";'),('en','messages:smw-schema-namespace-edit-protection-by-import-performer','s:201:\"This page was imported by a listed [https://www.semantic-mediawiki.org/wiki/Import_performer import performer] and means that changing the content of this page is restricted to only those listed users.\";'),('en','messages:smw-schema-namespace-editcontentmodel-disallowed','s:115:\"Changing the content model of a [https://www.semantic-mediawiki.org/wiki/Help:Schema schema page] is not permitted.\";'),('en','messages:smw-schema-summary-title','s:7:\"Summary\";'),('en','messages:smw-schema-tag','s:22:\"{{PLURAL:$1|Tag|Tags}}\";'),('en','messages:smw-schema-title','s:6:\"Schema\";'),('en','messages:smw-schema-type','s:11:\"Schema type\";'),('en','messages:smw-schema-type-description','s:16:\"Type description\";'),('en','messages:smw-schema-type-help-link','s:59:\"https://www.semantic-mediawiki.org/wiki/Help:Schema/Type/$1\";'),('en','messages:smw-schema-usage','s:5:\"Usage\";'),('en','messages:smw-schema-validation-error','s:145:\"The \"$1\" type is not registered and cannot be used for content in the [https://www.semantic-mediawiki.org/wiki/Help:Schema smw/schema] namespace.\";'),('en','messages:smw-schema-validation-schema-title','s:11:\"JSON schema\";'),('en','messages:smw-search-help-ask','s:371:\"The following links will explain how to use the <code>#ask</code> syntax.\n\n* [https://www.semantic-mediawiki.org/wiki/Help:Selecting_pages Selecting pages] describes how to selected pages and build conditions\n\n*[https://www.semantic-mediawiki.org/wiki/Help:Search_operators Search operators] lists available search operators including those for range and wildcard queries\";'),('en','messages:smw-search-help-input-assistance','s:356:\"[https://www.semantic-mediawiki.org/wiki/Help:Input_assistance Input assistance] is provided for the input field and requires to use one of following prefixes:\n\n*<code>p:</code> to enable property suggestions (e.g. <code><nowiki>[[p:Has ...</nowiki></code>)\n\n*<code>c:</code> to enable category suggestions\n\n*<code>con:</code> to enable concept suggestions\";'),('en','messages:smw-search-help-intro','s:317:\"A <code><nowiki>[[ ... ]]</nowiki></code> input will signal to the input processor to use the Semantic MediaWiki search back-end. It should be noted that combining <code><nowiki>[[ ... ]]</nowiki></code> with an unstructured text search such as <code><nowiki>[[ ... ]] OR Lorem ipsum</nowiki></code> is not supported.\";'),('en','messages:smw-search-help-proximity','s:344:\"Proximity searches (a property being unknown, \'\'\'only\'\'\' available for those back-ends that provide a full-text search integration):\n\n*<code><nowiki>[[in:lorem ipsum]]</nowiki></code> (search in all documents for \"lorem\" and \"ipsum\" that have been indexed)\n\n* <code><nowiki>[[phrase:lorem ipsum]]</nowiki></code> (match \"lorem ipsum\" as phrase)\";'),('en','messages:smw-search-help-structured','s:365:\"Structured searches:\n\n*<code><nowiki>[[Category:Lorem ipsum]]</nowiki></code>, <code><nowiki>[[Has number::123]]</nowiki></code> (as [https://www.semantic-mediawiki.org/wiki/Help:Search#Filter_context filtered context])\n\n*<code><nowiki>[[Has text::~*lorem*]]</nowiki></code> (with a [https://www.semantic-mediawiki.org/wiki/Help:Search#Query_context query context])\";'),('en','messages:smw-search-hide','s:4:\"Hide\";'),('en','messages:smw-search-input','s:16:\"Input and search\";'),('en','messages:smw-search-input-assistance','s:165:\"The [https://www.semantic-mediawiki.org/wiki/Help:Input_assistance input assistant] is also enabled to ease the pre-selection of available properties and categories.\";'),('en','messages:smw-search-profile','s:8:\"Extended\";'),('en','messages:smw-search-profile-extended-help-find-forms','s:15:\"available forms\";'),('en','messages:smw-search-profile-extended-help-form','s:213:\"Forms are provided (if maintained) to match specific use cases by exposing different property and value fields to narrow down the input process and make it easy for users to proceed with a search request. (see $1)\";'),('en','messages:smw-search-profile-extended-help-intro','s:209:\"The Special:Search [https://www.semantic-mediawiki.org/wiki/Help:SMWSearch/Extended_profile extended profile] provides access to search functions specific to Semantic MediaWiki and its supported query backend.\";'),('en','messages:smw-search-profile-extended-help-namespace','s:137:\"The namespace selection box will be hidden as soon as a form is selected but can be made visible with the help of the \"show/hide\" button.\";'),('en','messages:smw-search-profile-extended-help-query','s:47:\"Used <code><nowiki>$1</nowiki></code> as query.\";'),('en','messages:smw-search-profile-extended-help-query-link','s:36:\"For more details, please use the $1.\";'),('en','messages:smw-search-profile-extended-help-search-syntax','s:155:\"The search input field supports the use of the <code>#ask</code> syntax to define a Semantic MediaWiki specific search context. Useful expressions include:\";'),('en','messages:smw-search-profile-extended-help-search-syntax-note','s:116:\"\'\'Some of the listed operations are only useful in connection with an enabled full-text index or the ElasticStore.\'\'\";'),('en','messages:smw-search-profile-extended-help-search-syntax-prefix','s:66:\"* Additional custom prefixes are available and defined such as: $1\";'),('en','messages:smw-search-profile-extended-help-search-syntax-reserved','s:60:\"* Some expressions are reserved such as: <nowiki>$1</nowiki>\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-has','s:170:\"* <code>has:</code> to match any entity with a property \"...\" (e.g. <code>has:(Foo && Bar)</code> is equivalent to <code><nowiki>[[Foo::+]] && [[Bar::+]]</nowiki></code>)\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-in','s:258:\"* <code>in:</code> to find anything that contains \"...\" and is especially useful when the search context or properties involved are unknown (e.g. <code>in:(lorem && ipsum)</code> is equivalent to <code><nowiki>[[~~*lorem*]] && [[~~*ipsum*]]</nowiki></code>).\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-not','s:63:\"* <code>not:</code> to not match any entity that includes \"...\"\";'),('en','messages:smw-search-profile-extended-help-search-syntax-simplified-phrase','s:83:\"* <code>phrase:</code> to find anything that contains \"...\" in the exact same order\";'),('en','messages:smw-search-profile-extended-help-sort','s:59:\"Specifies a sorting preference for the result display with:\";'),('en','messages:smw-search-profile-extended-help-sort-best','s:156:\"* \"Best match\" will sort entities by [https://www.semantic-mediawiki.org/wiki/Help:ElasticStore/Relevancy relevancy] based on scores provided by the backend\";'),('en','messages:smw-search-profile-extended-help-sort-recent','s:197:\"* \"Most recent\" will show the most recent modified entities first (subobject entities will be suppressed as those entities are not annotated with a [[Property:Modification date|Modification date]])\";'),('en','messages:smw-search-profile-extended-help-sort-title','s:66:\"* \"Title\" using the page title (or display title) as sort criteria\";'),('en','messages:smw-search-profile-extended-section-form','s:5:\"Forms\";'),('en','messages:smw-search-profile-extended-section-namespace','s:9:\"Namespace\";'),('en','messages:smw-search-profile-extended-section-query','s:5:\"Query\";'),('en','messages:smw-search-profile-extended-section-search-syntax','s:12:\"Search input\";'),('en','messages:smw-search-profile-extended-section-sort','s:7:\"Sort by\";'),(