i/Help:SetupStore.php setupStore.php] maintenance script.\";'),('en','messages:smw-upgrade-error-how-explain-links','s:256:\"You may also consult the following pages for further assistance:\n* [https://www.semantic-mediawiki.org/wiki/Help:Installation Installation] instructions\n* [https://www.semantic-mediawiki.org/wiki/Help:Installation/Troubleshooting Troubleshooting] help page\";'),('en','messages:smw-upgrade-error-how-title','s:24:\"How do I fix this error?\";'),('en','messages:smw-upgrade-error-title','s:27:\"Error  Semantic MediaWiki\";'),('en','messages:smw-upgrade-error-why-explain','s:388:\"Semantic MediaWiki\'s internal database structure has changed and requires some adjustments to be fully functional. There can be several reasons including:\n* Additional fixed properties (requires additional table setup) were added \n* An upgrade contains some changes to tables or indices making an interception obligatory before accessing the data \n* Changes to the storage or query engine\";'),('en','messages:smw-upgrade-error-why-title','s:23:\"Why do I see this page?\";'),('en','messages:smw-upgrade-maintenance-explain','s:401:\"The extension tries to minimize the impact and downtime by deferring most of its maintenance tasks to after the <code>update.php</code> but some database related changes are required to finish first to avoid data inconsistencies. It can include:\n* Changing table structures such as adding new or modify existing fields  \n* Changing or adding table indices \n* Running table optimizations (when enabled)\";'),('en','messages:smw-upgrade-maintenance-note','s:339:\"The system is currently undergoing an [https://www.semantic-mediawiki.org/wiki/Help:Upgrade upgrade] of the [https://www.semantic-mediawiki.org/ Semantic MediaWiki] extension together with its data repository and we would like to ask you for your patience and allow the maintenance to continue before the wiki can be made accessible again.\";'),('en','messages:smw-upgrade-maintenance-title','s:33:\"Maintenance  Semantic MediaWiki\";'),('en','messages:smw-upgrade-maintenance-why-title','s:23:\"Why do I see this page?\";'),('en','messages:smw-upgrade-progress','s:8:\"Progress\";'),('en','messages:smw-upgrade-progress-create-tables','s:45:\"Creating (or updating) tables and indices ...\";'),('en','messages:smw-upgrade-progress-explain','s:297:\"An estimation as to when the upgrade is going to be finished is difficult to predict as it depends on the size of the data repository and the available hardware and can take a moment for larger wikis to complete.\n\nPlease contact your local administrator to get more information about the progress.\";'),('en','messages:smw-upgrade-progress-post-creation','s:31:\"Running post creation tasks ...\";'),('en','messages:smw-upgrade-progress-supplement-jobs','s:26:\"Adding supplement jobs ...\";'),('en','messages:smw-upgrade-progress-table-optimization','s:31:\"Running table optimizations ...\";'),('en','messages:smw-upgrade-release','s:7:\"Release\";'),('en','messages:smw-wantedproperties-docu','s:290:\"This page lists [https://www.semantic-mediawiki.org/wiki/Wanted_properties wanted properties] that are used in the wiki but do not have a page describing them. For a differentiated view, see the [[Special:Properties|entire]] or  [[Special:UnusedProperties|unused properties]] special pages.\";'),('en','messages:smw-wantedproperty-template','s:30:\"$1 ($2 {{PLURAL:$2|use|uses}})\";'),('en','messages:smw_add_sortcondition','s:23:\"[Add sorting condition]\";'),('en','messages:smw_adminlinks_datastructure','s:14:\"Data structure\";'),('en','messages:smw_adminlinks_displayingdata','s:12:\"Data display\";'),('en','messages:smw_adminlinks_inlinequerieshelp','s:19:\"Inline queries help\";'),('en','messages:smw_allows_pattern','s:290:\"This page is expected to contain a list of references (followed by [https://en.wikipedia.org/wiki/Regular_expression regular expressions]) to be made available by the [[Property:Allows pattern|All