INSERT INTO `text` VALUES (1,'<strong>MediaWiki wurde installiert.</strong>\n\nHilfe zur Benutzung und Konfiguration der Wiki-Software findest du im [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents Benutzerhandbuch].\n\n== Starthilfen ==\n\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Liste der Konfigurationsvariablen]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki-FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Mailingliste neuer MediaWiki-Versionen]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources bersetze MediaWiki fr deine Sprache]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Erfahre, wie du Spam auf deinem Wiki bekmpfen kannst]','utf-8'),(2,'{\n    \"type\": \"PROPERTY_GROUP_SCHEMA\",\n    \"groups\": {\n        \"schema_group\": {\n            \"canonical_name\": \"Schema properties\",\n            \"message_key\": \"smw-property-group-label-schema-group\",\n            \"property_keys\": [\n                \"_SCHEMA_TYPE\",\n                \"_SCHEMA_DEF\",\n                \"_SCHEMA_DESC\",\n                \"_SCHEMA_TAG\",\n                \"_SCHEMA_LINK\",\n                \"_FORMAT_SCHEMA\",\n                \"_CONSTRAINT_SCHEMA\",\n                \"_PROFILE_SCHEMA\"\n            ]\n        }\n    },\n    \"tags\": [\n        \"group\",\n        \"property group\"\n    ]\n}','utf-8'),(3,'{\n    \"type\": \"PROPERTY_GROUP_SCHEMA\",\n    \"groups\": {\n        \"administrative_group\": {\n            \"canonical_name\": \"Adminstrative properties\",\n            \"message_key\": \"smw-property-group-label-administrative-properties\",\n            \"property_keys\": [\n                \"_MDAT\",\n                \"_CDAT\",\n                \"_NEWP\",\n                \"_LEDT\",\n                \"_DTITLE\",\n                \"_CHGPRO\",\n                \"_EDIP\",\n                \"_ERRC\"\n            ]\n        },\n        \"classification_group\": {\n            \"canonical_name\": \"Classification properties\",\n            \"message_key\": \"smw-property-group-label-classification-properties\",\n            \"property_keys\": [\n                \"_INST\",\n                \"_PPGR\",\n                \"_SUBP\",\n                \"_SUBC\"\n            ]\n        },\n        \"content_group\": {\n            \"canonical_name\": \"Content properties\",\n            \"message_key\": \"smw-property-group-label-content-properties\",\n            \"property_keys\": [\n                \"_SOBJ\",\n                \"_ASK\",\n                \"_MEDIA\",\n                \"_MIME\",\n                \"_ATTCH_LINK\",\n                \"_FILE_ATTCH\",\n                \"_CONT_TYPE\",\n                \"_CONT_AUTHOR\",\n                \"_CONT_LEN\",\n                \"_CONT_LANG\",\n                \"_CONT_TITLE\",\n                \"_CONT_DATE\",\n                \"_CONT_KEYW\",\n                \"_TRANS\",\n                \"_TRANS_SOURCE\",\n                \"_TRANS_GROUP\"\n            ]\n        },\n        \"declarative_group\": {\n            \"canonical_name\": \"Declarative properties\",\n            \"message_key\": \"smw-property-group-label-declarative-properties\",\n            \"property_keys\": [\n                \"_TYPE\",\n                \"_UNIT\",\n                \"_IMPO\",\n                \"_CONV\",\n                \"_SERV\",\n                \"_PVAL\",\n                \"_LIST\",\n                \"_PREC\",\n                \"_PDESC\",\n                \"_PPLB\",\n                \"_PVAP\",\n                \"_PVALI\",\n                \"_PVUC\",\n                \"_PEID\",\n                \"_PEFU\"\n            ]\n        }\n    },\n    \"tags\": [\n        \"group\",\n        \"property group\"\n    ]\n}','utf-8'),(4,'http://www.w3.org/2004/02/skos/core#|[http://www.w3.org/TR/skos-reference/skos.rdf Simple Knowledge Organization System (SKOS)]\n altLabel|Type:Monolingual text\n broader|Type:Annotation URI\n broaderTransitive|Type:Annotation URI\n broadMatch|Type:Annotation URI\n changeNote|Type:Text\n closeMatch|Type:Annotation URI\n Collection|Class\n Concept|Class\n ConceptScheme|Class\n definition|Type:Text\n editorialNote|Type:Text\n exactMatch|Type:Annotation URI\n example|Type:Text\n hasTopConcept|Type:Page\n hiddenLabel|Type:String\n historyNote|Type:Text\n inScheme|Type:Page\n mappingRelation|Type:Page\n member|Type:Page\n memberList|Type:Page\n narrower|Type:Annotation URI\n narrowerTransitive|Type:Annotation URI\n narrowMatch|Type:Annotation URI\n notation|Type:Text\n note|Type:Text\n OrderedCollection|Class\n prefLabel|Type:String\n related|Type:Annotation URI\n relatedMatch|Type:Annotation URI\n scopeNote|Type:Text\n semanticRelation|Type:Page\n topConceptOf|Type:Page\n\n[[Category:Imported vocabulary]]','utf-8'),(5,'http://xmlns.com/foaf/0.1/|[http://www.foaf-project.org/ Friend Of A Friend]\n name|Type:Text\n homepage|Type:URL\n mbox|Type:Email\n mbox_sha1sum|Type:Text\n depiction|Type:URL\n phone|Type:Text\n Person|Category\n Organization|Category\n knows|Type:Page\n member|Type:Page\n\n[[Category:Imported vocabulary]]','utf-8'),(6,'http://www.w3.org/2002/07/owl#|[http://www.w3.org/2002/07/owl Web Ontology Language (OWL)]\n AllDifferent|Category\n allValuesFrom|Type:Page\n AnnotationProperty|Category\n backwardCompatibleWith|Type:Page\n cardinality|Type:Number\n Class|Category\n comment|Type:Page\n complementOf|Type:Page\n DataRange|Category\n DatatypeProperty|Category\n DeprecatedClass|Category\n DeprecatedProperty|Category\n differentFrom|Type:Page\n disjointWith|Type:Page\n distinctMembers|Type:Page\n equivalentClass|Type:Page\n equivalentProperty|Type:Page\n FunctionalProperty|Category\n hasValue|Type:Page\n imports|Type:Page\n incompatibleWith|Type:Page\n intersectionOf|Type:Page\n InverseFunctionalProperty|Category\n inverseOf|Type:Page\n isDefinedBy|Type:Page\n label|Type:Page\n maxCardinality|Type:Number\n minCardinality|Type:Number\n Nothing|Category\n ObjectProperty|Category\n oneOf|Type:Page\n onProperty|Type:Page\n Ontology|Category\n OntologyProperty|Category\n owl|Type:Page\n priorVersion|Type:Page\n Restriction|Category\n sameAs|Type:Page\n seeAlso|Type:Page\n someValuesFrom|Type:Page\n SymmetricProperty|Category\n Thing|Category\n TransitiveProperty|Category\n unionOf|Type:Page\n versionInfo|Type:Page\n\n[[Category:Imported vocabulary]]','utf-8'),(7,'* [[Imported from::foaf:knows]]\n* [[Property description::A person known by this person (indicating some level of reciprocated interaction between the parties).@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:knows}}','utf-8'),(8,'* [[Imported from::foaf:name]]\n* [[Property description::A name for some thing or agent.@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:name}}','utf-8'),(9,'* [[Imported from::foaf:homepage]]\n* [[Property description::URL of the homepage of something, which is a general web resource.@en]] \n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:foaf:homepage}}','utf-8'),(10,'* [[Imported from::owl:differentFrom]]\n* [[Property description::The property that determines that two given individuals are different.@en]]\n\n[[Category:Imported vocabulary]] {{DISPLAYTITLE:owl:differentFrom}}','utf-8'),(11,'__NOTOC__\n__NOTITLE__\n<h1>Glossar</h1>\n{{DISPLAYTITLE:Glossar}}\n<h3 class=\"underline\">Direktsuche im Glossar</h3>\n<div class=\"container-fluid\">\n  <div class=\"row\">\n    <div class=\"col-xs-12\" style=\"padding: 10px;\">\n<div id=\"Glossar-Inputbox\">\n<inputbox>\nbgcolor=#FFF\ntype=fulltext\nsearchbuttonlabel=Suchen\nnamespaces=\nwidth=50\nprefix={{urlencode:Category=Term&sort=newest|PATH}}\n}}\nplaceholder=Suchbegriff eingeben...\nbreak=no\n</inputbox></div>\n</div></div></div>\n<h3 class=\"underline\">Alle Terme des Glossars</h3>\n{{#ask:\n [[Kategorie:Term]]\n| ?#=Name\n| ?Kurzbeschreibung\n| mainlabel=-\n| format=category\n| template=Template:GlossarEintrag\n| named args=no\n| columns=2\n| delim=,\n}}','utf-8'),(12,'<big>Willkommen im Balmung Wikipedia!</big>\n<br><br>\n[[Datei:Balmung_Logo_300dpi_RGB-01.jpg|640px|center|link=]]\n<br><br>\n<p>Sie knnen hier nach Glossareintrgen suchen:</p>\n\n<inputbox>\nbgcolor=#FFF\ntype=fulltext\nsearchbuttonlabel=Finden\nnamespaces=\nwidth=50\nplaceholder=Suchbegriff eingeben...\nbreak=no\nprefix=\n</inputbox>\n<br><br>\n<br><br>','utf-8'),(13,'','utf-8'),(14,'/* Das folgende CSS wird fr alle Benutzeroberflchen geladen. */\n\ntable.broadtable {\ntext-align: right;\n}\n\ntable.broadtable th {\ntext-align: right;\n}\n\na, a[href], a[href].external {\ncolor: #005aa6 !important;\n}\n\na:hover, a[href]:hover, a[href].external:hover {\ncolor: #00a0df !important;\n}\n\n.mw-ui-button, #search_button {\n    background-color: #005aa6;\n    color: white;\n}','utf-8'),(15,'* navigation\n** mainpage|mainpage-description\n* Glossar\n** Glossar/Hauptseite|Glossar\n** Spezial:Mit_Formular_bearbeiten/GlossarTermAnlegen|Neuen Glossarterm anlegen\n* Hilfe\n** Hilfe:Hauptseite|Hilfeseiten\n* SEARCH\n* TOOLBOX\n* LANGUAGES','utf-8'),(16,'<noinclude>\n;Zweck:\nReprsentiert einen Term auf der Glossarseite\n\n;Parameter:\n<pre>\n|?Term=1\n|?Description=2\n</pre>\n</noinclude><includeonly>\n<dt> {{{1|}}} </dt>\n<dd> {{{2|}}} </dd></includeonly>','utf-8'),(17,'<noinclude>\n;Zweck:\nReprsentiert einen Term.\n\n[[Ist bearbeitungsgeschtzt::wahr|Diese Seite ist bearbeitungsgeschtzt.]]\n\n;Parameter:\n<pre>\n{{GlossarTerm\n|Name=Astronautenform\n|Kurzbeschreibung=OP-Haube (Kurzbeschreibung)\n}}\n</pre>\n</noinclude><includeonly>\n<h1>{{{Name}}}</h1>\nKurzbeschreibung: [[Kurzbeschreibung::{{{Kurzbeschreibung|}}}]]\n{{{Richtext|}}}\n{{DISPLAYTITLE:{{{Name|}}}}}\n{{DEFAULTSORT:{{{Name|}}}}}\n[[Letzter Kommentar::{{#sub:{{#stripTags:{{#latestRevisionComment:{{FULLPAGENAME}}}}}}|0|50}}...| ]] __NOTITLE__ [[Kategorie:Term]]\n</includeonly>','utf-8'),(18,'__NOTOC__\n__NOTITLE__\n<h1>Hilfeseiten</h1>\n{{DISPLAYTITLE:Hilfeseiten}}\n* Hauptseite\n** [[Hauptseite]] Hauptseite des Wiki\n* Glossar\n** Wo sehe ich alle Glossareintrge?\n*** [[Glossar/Hauptseite|Hauptseite des Glossars]] \n** Wie lege ich einen neuen Glossareintrag an?\n*** [[Formular:GlossarTermAnlegen|Formular zum Anlegen von Glossartermen]]\n** Wichtige Seiten fr die Pflege des Glossars:\n*** [[:Kategorie:Term]] Kategorieseite fr alle Terme\n*** [[Vorlage:GlossarEintrag]] Vorlage fr einen Term, wird in der Hauptseite \"Glossar\" benutzt\n*** [[Vorlage:GlossarTerm]] Vorlage, die in jedem Term benutzt wird\n* Artikel editieren\n** Welche Dateitypen kann ich in einen Artikel laden?\n*** Gngige Bildformate, wie: gif, jpg, png\n*** Office Dokumente, wie: PDF/doc/docx/xls/xlsx/ppt/pptx \n\n\n= Importskript =\nDie zu importierende CSV-Datei muss das folg. Format besitzen:\n* Eine Header-Zeile mit 5 tab-separierten Spaltenberschriften\n* Jeder Glossar-Eintrag ist eine Zeile mit 5 tab-separierten Spalten\n* Folg. Spalteninhalte werden erwartet:\n** Name\n** Kurzbeschreibung\n** Erklrung\n** Quelle\n** Link zum Bild (HTTP/S)\n\n\nZum importieren der CSV-Datei mssen Sie folgendes tun:\n\n* Admin-Konsole in Windows ffnen\n* Folgendes Kommando eingeben. <pfad zur CSV-Datei> bitte durch den Pfad zur CSV-Datei ersetzen.\n<pre>\nphp.bat D:\\METWiki\\mediawiki\\extensions\\ImportCSVBalmung\\maintenance\\import.php --file=<pfad zur CSV-Datei> --dryrun\n</pre>\n* Wenn dieses Kommando ohne Fehler durchluft, dann fhren Sie es erneut aus, aber ohne den Parameter \"--dryrun\"\n\n= Berechtigungskonzept =\n* Wo verwalte ich die Benutzer?\n** Im Balmung Active Directory\n** Die AD-User werden nicht ins Wiki importiert, d.h. sie sind nicht in der Wiki-Benutzerliste sichtbar.\n* Welche Benutzergruppen gibt es?\n** s. [http://metwiki/balmung/index.php/Spezial:Gruppenrechte]\n* Welche Benutzergruppen sind relevant fr das Berechtigungskonzept:\n** Administratoren, Brokraten (entsprechen der AD-Gruppe \"MW_Administrator\")\n** contributor (entspricht der AD-Gruppe \"MW_Contributor\")\n* Welche Rechte haben Administratoren, Brokraten?\n** drfen alle Seiten ndern und alle Spezialseiten ffnen\n** s. [http://metwiki/balmung/index.php/Spezial:Gruppenrechte]\n* Welche Rechte haben contributors?\n** drfen alle Seiten ndern.\n** Zum Testen der Contributor-Gruppe bitte diesen User benutzen: \"Contributor\" (hier anmelden [http://metwiki/balmung/index.php?title=Spezial:Anmelden])\n* Welche Rechte haben die anderen User\n** drfen keine Seiten ndern.','utf-8'),(19,'[[Ignoriere als Facette::wahr]]','utf-8'),(20,'[[Ignoriere als Facette::wahr]]','utf-8'),(21,'[[Ignoriere als Facette::wahr]]','utf-8'),(22,'Diese Kategorie enthlt alle Terme, vergleichbar zu SKOS-Konzepten.\n\nTerme werden mittels Formular {{#default_form:GlossarTermAnlegen}} bzw. [[Form:GlossarTermAnlegen]] angelegt.\nKlicken Sie hier um einen neuen allgemeinen Term anzulegen:\n* {{#formlink:form=GlossarTermAnlegen|link text=Termformular}}\n\n{{#default_form:GlossarTermAnlegen}}','utf-8'),(23,'[[Ignoriere als Facette::wahr]]','utf-8'),(24,'[[Ignoriere als Facette::wahr]]','utf-8'),(25,'[[Ignoriere als Facette::wahr]]','utf-8'),(26,'Dieses Attribut enthlt die Kurzbeschreibung eines Terms.\n[[Has type::String|:String]]','utf-8'),(27,';Zweck\nEnthlt den Kommentar der letzten Revision des geg. Artikel und wird mit Hilfe von \n<nowiki>{{#latestRevisionComment:{{FULLPAGENAME}}}}</nowiki> ermittelt.\n\n[[Has type::String]]','utf-8'),(28,'[[Ignoriere als Facette::wahr]]','utf-8'),(29,'[[Ignoriere als Facette::wahr]]','utf-8'),(30,'[[Ignoriere als Facette::wahr]]','utf-8'),(31,'<noinclude>\nHier knnen Sie einen neuen Term fr das Glossar anlegen: {{#formlink:form=GlossarTermAnlegen|link text=neuen Term anlegen}}\n\n[[Ist bearbeitungsgeschtzt::wahr|Diese Seite ist bearbeitungsgeschtzt.]]\n</noinclude>\n<includeonly>\n{{{info|create title=Neuen Term anlegen|edit title=Term bearbeiten|page name=Term_<unique number;start=1>}}}__NOTOC__\n{{{for template|GlossarTerm}}}\n{| class=\"formtable\"\n! Name:\n| {{{field|Name|input type=string|size=75|mandatory}}}\n|-\n! Kurzbeschreibung:\n| {{{field|Kurzbeschreibung|input type=textarea|cols=77|rows=3|mandatory}}}\n|}\n\'\'\'Freitext:\'\'\'\n{{{standard input|free text|input type=textarea|editor=visualeditor|cols=133|rows=15}}}\n\n</includeonly>','utf-8');
